    "title": "Help End the Coronavirus Supply Crisis!",
    "description": "   Please join us during this time of urgency with our cause to aid hospitals in the prevention and control of the virus. The money we collect will go directly to a the DFW based chinese organizations that are currently buying and shipping surgical masks, \u00a0protective masks, \u00a0and gowns directly to Wuhan's hospitals. ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ Video footage of the dire situation in Wuhan's overcrowded hospitals have appeared all over the Internet. \u00a0Another video circulating on social media appeared to show covered dead bodies lining hospital hallways. While a disturbing clip that was also shot at a Wuhan hospital shows a patient writhing around on the floor desperately scattering money around. (Source: New York Post) ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ Wuhan China- One week into lockdown, anger, resentment and panic \u00a0has taken over China. \u00a0Frustrated citizens are left untreated and hospitals are overcrowded.\u00a0 Meanwhile, \u00a0doctors are pleading for supplies, which are quickly disappearing, as the center of the virus endures shortages of hospital beds, \u00a0medical supplies and resources. \u00a0According to the \u00a0New York Times,\u00a0 \"These shortages have become especially severe in Huanggang, a city of seven million not far from Wuhan, where some medical staff members were wearing raincoats and garbage bags as shoe covers to protect against infection.\"\u00a0 Anotherstaff member from the Guangzhou hospital \u00a0has reported, \u00a0\u00a0\"There were 40 companies in China that made the suits, and their combined daily output was about 30,000. However, Hubei province alone needed about 100,000 protective suits every day.\" \u00a0 Hospitals in Wuhan are seeking medical supplies including some 40 million medical masks, 5 million protective suits and more infrared thermometers. \"Many people have contacted us but the problem is, we can't find the supplies,\" said the employee.   Sources: The New York Times, AsiaOne ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~   EpochArts4Hope is an organization dedicated to changing the world through the music and the arts. Our hope is to create an epoch of joy through the power of what we do. We are looking to host a fundraiser concert showcasing music, dance, martial arts, and more to raise money for the coronavirus situation of 2020. If you know of a potential venue that we could use for this cause, please feel free to contact us at epocharts4hope@gmail.com. Thank you!",
