    "title": "Together - Support Wuhan Fight Through Coronavirus",
    "description": "Dear all,  We urgently need your help and donation! YES, We need help ASAP!  This Gofundme page is setup to help fundraising for purchasing medical supplies for Wuhan hospitals, doctors, nurses,\u00a0 healthcare workers,\u00a0 medical microbiologists, volunteers in Wuhan, China whose currently fighting to save all these innocent lives. Yes, we know the virus spread too quickly for anyone to react. We know the cause of the virus and we know there are human responsibilities in this BUT not everyone deserves to be infected or die.\u00a0  Wuhan was once my home when I was a child and I still have family there. Unfortunately, 2 of my close family members including\u00a0 a healthcare worker are currently isolated in hospital in Wuhan suffering from the coronavirus. We are lucky that they received treatment. We are lucky that we had these healthcare workers to save them! We are grateful, and we are heart broken at the same time, because we know how serious this is and we are still experiencing the possibilities of loosing close family members we want to help! And we need your help! We want every doctor, nurse, healthcare workers, medical microbiologist, volunteer, and patient to go home safely! I am lucky, I live in USA currently, I am lucky that I did not get stuck in Wuhan city because I no longer live in Wuhan. I am lucky I have so much resources! But whose there to help them, and the true heroes?  Currently, my cousin who was a reporter in Wuhan is in direct contact with many hospitals bypassing government or other organizations. Yes, we want to make sure that every pieces of supply gets delivered directly to the hospitals! We need to help and protect the frontline fighters whose risking everything to save our family and my home.\u00a0  Due to Wuhan city and many other cities lockdowns, shortage of supplies, increased pricing on these supplies set lots of restrictions and limitation. In Wuhan, China, we raised about $10000 and purchased only 600 pieces of protected clothing delivered to assigned hospitals.\u00a0 This is truly NOT ENOUGH...Therefore, our family decided to connect together at this tough time to raise more fundings to help even if the prices are expensive...these medical supplies are life savers!\u00a0  Right now, flights no longer go to Wuhan and due to varies of other reasons, even if we ship supplies to Wuhan, it does not get distributed to the needed hospitals. So we have to purchase and gather the supplies in China! To make sure we get the required high quality supplies, we need more funds to purchase them. We will guarantee to purchase the medical supplies and deliver them directly to each hospitals that we work with. We already completed round 1 so we know this works! That's why we want to continue!          Many people are in lockdown in their community in Wuhan, Hubei,\u00a0 other areas in China so we have to depend on these warm hearted volunteers to help us move and deliver these items to hospitals! We need to protect them too!!!!!\u00a0       And IF you have resources or supplies in Wuhan and China, please please contact me and I can link you up with my cousin. During this time, please stop the discrimination to Wuhan people. We know human beings made mistakes, other organizations did too but we should stop blaming and hating, we should stick together to help! We need to have a kind heart and generous actions to support! Even if is just a little help, even if you could just help me share the page, we truly appreciated! And we are thankful for everyone whose helping and praying to get through this tough times!\u00a0  We know there's lots of different voices, political views, fake supplies etc. BUT let's put that all aside and just focus on one purpose, HELP and SUPPORT Wuhan and save innocent lives! Inside Wuhan City, we\u00a0 truly are still in urgent need of supplies!  Please find the news links to see more details about the coronavirus.   https://www.cnn.com/2020/02/01/asia/coronavirus-wuhan-discrimination-intl-hnk/index.html     https://www.wsj.com/articles/what-we-know-about-the-wuhan-virus-11579716128       https://www.worldometers.info/coronavirus/    Please contact me through Gofundme if you have resources or supplies in China!\u00a0  I would like to thank everyone in advance!  Anna",
