    "title": "Helping Hong Kong through Coronavirus",
    "description": "\u6211\u5011\u662f\u4e00\u7fa4\u4f86\u81f3\u9999\u6e2f\u7684\u7f8e\u570b\u7559\u5b78\u751f\uff0c\u5f97\u6089\u8fd1\u6708\u4f86\u5728\u9999\u6e2f\u8086\u8650\uff0c\u78ba\u8a3a\u500b\u6848\u4e0a\u5347\u81f313\u5b97\u3002 \u7136\u800c\u653f\u5e9c\u6c92\u6709\u505a\u597d\u5c01\u95dc\u7ba1\u5236\u53ca\u9632\u79a6\u63aa\u62d6\uff0c\u4ee4\u78ba\u8a3a\u500b\u6848\u6301\u7e8c\u589e\u52a0\uff0c\u53e3\u7f69\u53ca\u6d88\u6bd2\u7528\u54c1\u5f97\u4e0d\u61c9\u6c42\u3002\u5f88\u591a\u5e02\u6c11\u88ab\u903c\u81ea\u88fd\u4f4e\u9632\u79a6\u53e3\u7f69\u6216\u6c92\u6709\u6234\u53e3\u7f69\u60c5\u6cc1\u4e0b\u5916\u51fa\u3002  we are a group of students who study in the United State, we have realized that the situation of coronavirus in Hong Kong is getting serious and the number of confirmed cases has risen to 13 cases in this short period of time.\u00a0 However, the Hong Kong government has not done a good job in the custom control and coronavirus defense measures, which cause increasing the number of confirmed cases and the demand for face masks is overwhelmed. Which many Hong Kong citizens are forced to self-made and low-defense mask or go out without wearing masks dangerously.      \u65b0\u578b\u51a0\u72c0\u75c5\u6bd2\u6700\u65e9\u65bc12\u6708\u4e2d\u767c\u73fe\uff0c\u9999\u6e2f\u653f\u5e9c\u537b\u523b\u610f\u96b1\u779e\u75ab\u60c5\u53ca\u6301\u7e8c\u8b93\u5167\u5730\u65c5\u5ba2\u9032\u6e2f\u3002\u76f4\u81f3\u4e0d\u8db3\u4e00\u500b\u6708\u5167\u75ab\u60c5\u64f4\u6563\u81f3\u5927\u534a\u500b\u570b\u5927\u9678\uff0c\u4e2d\u570b\u4e8c\u5341\u4e09\u500b\u7701\u5730\u5340\u767c\u73fe\u65b0\u578b\u51a0\u72c0\u75c5\u6bd2\uff0c\u4e2d\u570b\u5883\u5167\u6b7b\u4ea1\u75c5\u4f8b\u5df2\u6709213\u4f8b\uff0c\u78ba\u8a3a\u75c5\u4f8b9692\u4f8b\u3002\u5728\u6b64\u56b4\u91cd\u60c5\u6cc1\u4e0b\uff0c\u9999\u6e2f\u653f\u5e9c\u66f4\u4e0d\u55ae\u6c92\u6709\u5b8c\u5584\u61c9\u8b8a\u75ab\u60c5\u7684\u63aa\u65bd\uff0c\u6c92\u6709\u63d0\u4f9b\u8db3\u5920\u7684\u91ab\u7642\u7528\u54c1\uff0c\u4e26\u88ab\u8fd1\u65e5\u767c\u73fe\u653f\u5e9c\u6709\u4e00\u5343\u842c\u500b\u53e3\u7f69\u5eab\u5b58\uff0c\u537b\u6c92\u6709\u9069\u7576\u5730\u5411\u516c\u773e\u6d3e\u767c\uff0c\u5c0e\u81f4\u4eba\u5fc3\u60f6\u60f6\u3002  This new type of coronavirus was first discovered in the middle of December, but the Hong Kong government deliberately concealed the epidemic and continued to allow mainland tourists to enter Hong Kong. Until less than a month, the epidemic had spread to more than half of the continent, and new coronaviruses were found in 23 provinces of China. There were 213 deaths in China and 9,692 confirmed cases. In this serious situation, the Hong Kong government has not only failed to improve the measures to respond to the epidemic, has not provided enough medical supplies, and was recently discovered that the government has a stock of 10 million masks, but it has not properly distributed them to the public, causing people panic.    Credit: Billy H.C. Kwok  \u6211\u5011\u4f5c\u70ba\u4e00\u7fa4\u5728\u7f8e\u570b\u7559\u5b78\u7684\u5b78\u751f\u5f88\u60f3\u70ba\u9999\u6e2f\u51fa\u4e00\u5206\u529b\uff0c\u6211\u5011\u4e86\u89e3\u5230\u76ee\u524d\u9999\u6e2f\u5341\u5206\u7f3a\u4e4f\u53e3\u7f69\u53ca\u6d88\u6bd2\u7528\u54c1\uff0c\u6211\u5011\u5df2\u5411\u6709\u95dc\u4f9b\u61c9\u5546\u806f\u7e6b\u53ef\u8cfc\u53d6\u5927\u91cf\u53e3\u7f69(N95 respirators \u53cavirus filtration efficiency masks)\u53ca\u7269\u8cc7\u904b\u9001\u5230\u9999\u6e2f\u5404\u5340\u53ca\u591a\u9593\u9999\u6e2f\u5927\u5b78\u9644\u8fd1\u6d3e\u767c\u3002\u6211\u5011\u7684\u8cc7\u6599\u5c07\u516c\u958b\u53ca\u900f\u660e\uff0c\u73cd\u60dc\u9999\u6e2f\u4eba\u7684\u4e00\u5206\u4e00\u6beb\uff0c\u4e26\u6301\u7e8c\u5411\u9999\u6e2f\u652f\u63f4\u7269\u8cc7\u3002\u6211\u5011\u7684\u529b\u91cf\u5f88\u5f31\uff0c\u56e0\u6b64\u6211\u5011\u60f3\u85c9\u6b64\u51dd\u805a\u9999\u6e2f\u53ca\u5168\u4e16\u754c\u7684\u529b\u91cf\uff0c\u4e00\u8d77\u8d70\u904e\u9019\u6bb5\u96e3\u95dc\u3002 We, as a group of Hong Kong people in oversea, would like to contribute as much as we can to Hong Kong. We noticed that there is a shortage of masks and disinfection products right now in Hong Kong. We have contacted relevant suppliers to purchase a huge amount of masks (N95 respirators and virus filtration efficiency masks), distributing to various districts and universities in Hong Kong. Our information will keep transparent,\u00a0 we will cherish every cent from Hong Kong people, continue to support Hong Kong with supplies. Single person\u2019s strength is weak, so we want to use this platform to unite the strength of Hong Kong people and the world to walk through this difficult time together.   \"\u9019\u662f\u4eba\u798d\uff0c\u4e0d\u662f\u5929\u707d\" P.S: \u201cThis is a human-made disaster, not a natural disaster\u201d  #\u4e94\u5927\u8a34\u6c42\uff0c\u6c7a\u4e00\u4e0d\u53ef #Five demands, not one less #\u6e2f\u4eba\u6551\u6e2f #SAVE Hong Kong",
