    "title": "Coronavirus Defends for Saving Suffering Lives",
    "description": "Flight with us! Pray with us! I\u2019m such an ordinary person quiet on social, I never thought I would be so desperate and devastated to draft a letter for help with face covering in tears! This January with the  outbreak of Coronavirus  at Wuhan my hometown\u2764, I realized and is experiencing such a life-threatening moment for my family who are infected with the virus and hundreds of thousands of people are suffering this novel virus with pneumonia and hard to breath problem (China\u2019s number is less than what\u2019s real). They are on the fringe of fighting the virus through their own Immune Systems and Antivirus/antibacterial medicines with the city under quarantine, but the  sad thing is they lack medical supplies of masks, goggles, protection suits  to prevent the virus  from transmission to more people at the hospitals and communities at Wuhan  (even they also lack medicines, since those are prescription drugs there is no way we can purchase). Even though lots of people are trying to help in this matter including myself and my husband, there still lots of things we need to do and lots of supplies we need to send to China. As you may know Alibaba, Taobao those big online stores in China is sold out of masks, goggles, we are purchasing  supplies here at US to send back to China . Since its two of us on our part, we realized its wiser and better if we can collect help from the humanitarian society to help accelerate the process. If you are there and willing to help this effort, any dollar or connection with those supplies is welcomed! I attached all those first-hand information and the real moments of my friends circle on Wechat (a Chinese chat tool) to show you what\u2019s really going on. And with all the dollars raised I\u2019ll  buy those supplies  and reply this crowdfunding with the  purchasing sheets and shipping information  to show how your money goes. Please also  send prayers  for Wuhan, I believe God can hear us! It\u2019s near the time to re-examine ourselves and the world around us. 1.\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Who I am: Xinyu born at Wuhan, have been living at US since 2012 Fall came here for Graduate degree  2.\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Where I\u2019m from: Wuchang District, Wuhan City, China  3.\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Relationship with parties raising funds: Family friends community hospitals in Wuhan. My father is hospitalized at Wuhan University Renmin Hospital, my grandpa is at Wuhan Tianyou Hospital. My mom and grandma currently don\u2019t have any spots available at the Hospital.  4.\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 The Fund spent: will all be used for purchasing supplies like masks, goggles, protection suit and ship back to Wuhan.",
