    "title": "HELP FIGHT CORONAVIRUS",
    "description": "\n For people who love sports, last week was a rough beginning for 2020. On the one side, NBA legend Kobe Bryant passed away at age 41; this was heartbreaking news in China as many esports fans share a love of basketball. Meanwhile, China braced itself for a difficult Chinese New Year (CNY) due to the new coronavirus outbreak.\u00a0 \u60c5\u7cfb\u5bb6\u4e61\uff0c\u4f17\u5fd7\u6210\u57ce | \u6b66\u6c49\u5927\u5b66\u5927\u7ebd\u7ea6\u5730\u533a\u6821\u53cb\u4f1a\u52df\u6350\u516c\u544a The Spring Festival has come, but a sudden coronavirus has changed the hustle and bustle of the past. The rapidly expanding outbreak has overwhelmed the Chinese province\u2019s hospitals and fueled fears of a global pandemic. Chinese health officials reported on 1/24/2020 that there had been 41 deaths from the outbreak and 1287 cases of the coronavirus. Tons of medical workers are still struggle on the front line , the day and night. Facing the current shortage of medical consumables, Wuhan University Alumni Association of Greater New York has obtained official contacts and approvals with the Chinese Red Cross, the Consulate General of the People's Republic of China in New York, China Eastern Airlines, and major medical consumable manufacturers worldwide. Overseas payment methods are now being opened, and all-out efforts are being made to open overseas material transportation and fundraising channels. We appeal to all people with kindness, please participate in our crowdfunding! Gathering sand into a tower, love is boundless! Together we work together!\u00a0 We firmly believe that with your help, we will definitely win this fight against the disease! Our alumni will announce the fundraising amount in real time, and ensure that all the funds received will be used to purchase the materials needed to prevent the epidemic. We will announce the progress and whereabouts of materials and fundraising every day. \u6625\u8282\u5c06\u81f3\uff0c\u4e00\u573a\u7a81\u5982\u5176\u6765\u7684\u65b0\u578b\u80ba\u708e\u8ba9\u5bb6\u4e61\u4e00\u6539\u5f80\u65e5\u7684\u55a7\u56a3\uff0c\u786e\u8bca\u75c5\u4f8b\u4ecd\u5728\u4e0d\u65ad\u6500\u5347\uff0c\u6211\u4eec\u7684\u5e08\u957f\u3001\u540c\u5b66\u3001\u4eb2\u53cb\u7ec4\u6210\u7684\u533b\u52a1\u5de5\u4f5c\u8005\u56e2\u961f\u6b63\u9006\u884c\u800c\u4e0a\uff0c\u591c\u4ee5\u7ee7\u65e5\u7684\u594b\u6597\u5728\u524d\u7ebf\u3002 \ufffc \u9762\u5bf9\u533b\u7597\u8017\u6750\u6781\u5ea6\u7d27\u7f3a\u7684\u73b0\u72b6\uff0c\u6b66\u6c49\u5927\u5b66\u5927\u7ebd\u7ea6\u5730\u533a\u6821\u53cb\u4f1a\u5df2\u4e0e\u4e2d\u56fd\u7ea2\u5341\u5b57\u603b\u4f1a\uff0c\u4e2d\u534e\u4eba\u6c11\u5171\u548c\u56fd\u9a7b\u7ebd\u7ea6\u603b\u9886\u4e8b\u9986, \u4e2d\u56fd\u4e1c\u65b9\u822a\u7a7a\u4ee5\u53ca\u5168\u7403\u5404\u5927\u533b\u7597\u8017\u6750\u5382\u5546\u53d6\u5f97\u5b98\u65b9\u8054\u7cfb\u548c\u8ba4\u53ef\u3002 \u73b0\u5f00\u901a\u6d77\u5916\u652f\u4ed8\u65b9\u5f0f\uff0c\u5168\u529b\u6253\u901a\u6d77\u5916\u7269\u8d44\u8fd0\u8f93\u4ee5\u53ca\u52df\u6350\u6e20\u9053\u3002\u6211\u4eec\u5411\u6240\u6709\u5173\u5fc3\u4e2d\u56fd\u5bb6\u4e61\u7684\u6d77\u5916\u534e\u4eba\u547c\u5401\uff0c\u8bf7\u5c3d\u81ea\u5df1\u7684\u4e00\u4efd\u529b\uff0c\u53c2\u4e0e\u5230\u4f17\u7b79\u4e2d\uff01 \u805a\u6c99\u6210\u5854\u3001\u5927\u7231\u65e0\u7586\uff01 \u4f17\u5fd7\u6210\u57ce\uff0c\u540c\u821f\u5171\u6d4e\uff01 \u6211\u4eec\u575a\u4fe1\uff0c\u5728\u4f60\u7684\u5e2e\u52a9\u4e0b\uff0c\u6211\u4eec\u4e00\u5b9a\u53ef\u4ee5\u62ff\u4e0b\u8fd9\u573a\u80ba\u708e\u6297\u51fb\u6218\uff01 \u6211\u4eec\u6b66\u6c49\u5927\u5b66\u5927\u7ebd\u7ea6\u5730\u533a\u6821\u53cb\u4f1a\u5c06\u4ee5\u5929\u4e3a\u5355\u4f4d\u5b9e\u65f6\u516c\u5e03\u7b79\u6b3e\u91d1\u989d\uff0c\u5e76\u786e\u4fdd\u5c06\u6536\u5230\u7684\u6240\u6709\u6b3e\u9879\u5168\u90e8\u7528\u4e8e\u9632\u6cbb\u75ab\u60c5\u6240\u9700\u7269\u8d44\u7684\u91c7\u8d2d\u3002\u6211\u4eec\u4f1a\u6bcf\u5929\u516c\u5e03\u7269\u8d44\u53ca\u8d44\u91d1\u52df\u96c6\u8fdb\u5c55\u4e0e\u53bb\u5411\u3002 \u00a0 \u4f5c\u4e3a\u6d77\u5916\u7387\u5148\u6b63\u5f0f\u4ee5\u534e\u4eba\u534e\u4fa8\u793e\u4f1a\u56e2\u4f53\u4e3a\u540d\u4e49\u53d1\u8d77\u7684\u52df\u6350\u9879\u76ee\uff0c\u6211\u4eec\u5df2\u7ecf\u53d7\u5230\u4f17\u591a\u6d77\u5916\u534e\u4eba\u534e\u4fa8\u56e2\u4f53\u3001\u5a92\u4f53\u4ee5\u53ca\u4e2a\u4eba\u7684\u6350\u732e\u54a8\u8be2\u548c\u5408\u4f5c\u54a8\u8be2\u3002 \u6211\u4eec\u6b63\u5728\u79ef\u6781\u5f81\u96c6\u5168\u7403\u533b\u7597\u7269\u8d44\uff0c\u533b\u9662\u548c\u533b\u7597\u8017\u6750\u5382\u5546\u5408\u4f5c\u3002\u5982\u679c\u8eab\u4e3a\u6d77\u5916\u534e\u4eba\u534e\u4fa8\u7684\u4f60\uff0c\u5df2\u7ecf\u8d2d\u4e70\u597d\u7269\u8d44\uff0c\u800c\u82e6\u4e8e\u6ca1\u6709\u6e20\u9053\u8fd0\u9001\uff0c\u4e5f\u8bf7\u8054\u7edc\u6211\u4eec\u5fae\u4fe1\u516c\u4f17\u53f7\u3002 \u5408\u4f5c\u65b9\u540d\u5355\uff1a \u6e56\u5317\u540c\u4e61\u4f1a \u7ebd\u7ea6\u9ec4\u9e64\u4f1a \u7f8e\u56fd\u534e\u4eba\u6267\u4e1a\u533b\u5e08\u534f\u4f1a \u5317\u4eac\u5927\u5b66\u4f11\u65af\u987f\u6821\u53cb\u4f1a \u4e2d\u79d1\u5927\u6ce2\u58eb\u987f\u6821\u53cb\u4f1a \u9ed1\u9f99\u6c5f\u5927\u5b66\u4e2a\u4eba\u6821\u53cb\u4eec \u4e2d\u79d1\u5927\u5317\u7f8e\u4e2a\u4eba\u6821\u53cb\u4eec \uff08\u6301\u7eed\u66f4\u65b0\u4e2d\uff09 \u8bf7\u5408\u4f5c\u56e2\u4f53\u65b9\u8054\u7edc\uff1a \u6b66\u6c49\u5927\u5b66\u5927\u7ebd\u7ea6\u5730\u533a\u6821\u53cb\u4f1a\u4f1a\u957f\u6bdb\u5b66\u519b \u6b66\u6c49\u5927\u5b66\u5927\u7ebd\u7ea6\u5730\u533a\u6821\u53cb\u4f1a\u6267\u884c\u4f1a\u957f\u5bab\u4e39\u4e39 \u6b66\u6c49\u5927\u5b66\u5927\u7ebd\u7ea6\u5730\u533a\u6821\u53cb\u4f1a\u8d22\u52a1\u5ba1\u8ba1\u59d4\u5458\u4f1a\uff1a \u80e1\u667a\u52c7 \u9ec4\u5c0f\u519b \u66fe\u6587\u6d9b *** *** Please note that this campaign is for pure donations only. Donors will NOT receive anything in return for their donations. Updates\u00a0(7) TODAYby WHU Alumni,\u00a0Organizer Dear Friends, We truly appreciate your trust and help. As WHO declares the Coronavirus outbreak as a public health emergency of international concern, our task became even harder, as a lot of medical suppliers and distributors now post limitation on purchases. If any of you know NGOs that could help with the consumable medical supplies, please feel free to contact us at info@nywhu.org. We would be more than happy to discuss a feasible plan together. We truly believe, we would defeat this outbreak if we fight together. Warmest Regards, Wuhan University Alumni Association of Greater New York. JANUARY 30, 2020by WHU Alumni,\u00a0Organizer Dear donors, Our medical supplies reached the front line of Coronarius fight in Wuhan. Please see attached some pictures and confirmation example from a hospital. We plan to ship out another 120,002 count of medical supplies today with Flight\u2026Read more JANUARY 29, 2020by WHU Alumni,\u00a0Organizer Great News: After long hours of transportation from Shanghai to Wuhan, our first pack of consumable medical supplies arrived at 3 different local hospitals in Wuhan. Please below some of the pictures and our order history. Government support The two institutes that discovered Shuanghuanglian's alleged ability to \"inhibit\" the coronavirus are both state-run bodies. The Shanghai Institute of Materia Medica is under the Chinese Academy of Sciences (CAS), a top government think tank. The Wuhan Institute of Virology is also\u00a0administered by the CAS\u00a0and is among the country's most advanced virus research laboratories. Thousands of people have been sickened by a new coronavirus, called 2019-nCoV, in at least a dozen countries, including the US. Coronaviruses attack the respiratory system, sometimes targeting the cells deep within the lungs. Only seven, including 2019-nCoV, SARS, and MERS, have evolved to infect humans.",
