    "title": "Raising money for Coronavirus",
    "description": "Deaths from coronaviruses have quickly surpassed with no sign of stopping or slowing down. A further 24,324 people on the Chinese mainland have been infected China's National Health Commission said on Wednesday. It has now spread to the U.S and is infecting American citizens with 12 cases already confirmed.\u00a0   Our Mission   For the past month, China has been suffering in a new epidemic known as the coronavirus. Our goal is to raise money and buy supplies and directly send them to Chinese hospitals for use and treatment on patients due to the lack of supplies. The lack of equipment/supplies, workers, and space in hospitals is inadequate and needs to be helped ASAP. We will try to aid and try to slow down the spread of coronavirus in China because America is better suited to handle these outbreaks then China.   \u6211\u4eec\u7684\u76ee\u6807   \u5728\u8fc7\u53bb\u7684\u4e00\u4e2a\u6708\u4e2d\uff0c\u4e2d\u56fd\u6b63\u906d\u53d7\u7740\u4e00\u79cd\u88ab\u79f0\u4e3a\u51a0\u72b6\u75c5\u6bd2\u7684\u65b0\u6d41\u884c\u75c5\u7684\u6298\u78e8\u3002\u6211\u4eec\u7684\u76ee\u6807\u662f\u7b79\u96c6\u8d44\u91d1\u5e76\u8d2d\u4e70\u8017\u6750\uff0c\u5e76\u7531\u4e8e\u7f3a\u5c11\u8017\u6750\u800c\u76f4\u63a5\u5c06\u5b83\u4eec\u53d1\u9001\u7ed9\u4e2d\u56fd\u533b\u9662\u4ee5\u5bf9\u60a3\u8005\u8fdb\u884c\u4f7f\u7528\u548c\u6cbb\u7597\u3002\u533b\u9662\u7f3a\u4e4f\u8bbe\u5907/\u4f9b\u5e94\uff0c\u5de5\u4eba\u548c\u7a7a\u95f4\u4e0d\u8db3\uff0c\u9700\u8981\u5c3d\u5feb\u5f97\u5230\u5e2e\u52a9\u3002    Who we are   We are an organization that originated in Michigan, and we are a group of students who want to help the world. As a result, we are starting with the coronavirus epidemic in China. We have lots of passionate people in our organization that want to help reduce the number of casualties in the rapidly spreading coronavirus outbreak.   \u6211\u4eec\u662f\u8c01   \u6211\u4eec\u662f\u4e00\u4e2a\u7531\u9ad8\u4e2d\u751f\u5728\u5bc6\u6b47\u6839\u5dde\u6210\u7acb\u7684\u7ec4\u7ec7\uff0c\u65e8\u5728\u9632\u6b62\u75be\u75c5\u4f20\u64ad\u3002\u6211\u4eec\u7684\u7ec4\u7ec7\u4e2d\u5145\u6ee1\u4e86\u70ed\u5fc3\u4e8e\u5e2e\u52a9\u4eba\u4eec\u7684\u4eba\u4eec\uff0c\u6211\u4eec\u51b3\u5b9a\u4ece\u4e2d\u56fd\u5f00\u59cb\uff0c\u5e76\u5e2e\u52a9\u4ed6\u4eec\u5728\u90a3\u91cc\u7206\u53d1\u51a0\u72b6\u75c5\u6bd2\u3002    What we will accomplish   We will fund hospitals in China that don\u2019t have enough room for patients or require more supplies. Some examples of equipment and supplies that we give are gloves, face masks, and more medical supplies. We will fund the hospitals so that they can get more money to expand and make rooms for their patients. The money we raise and will send to them will also be used for hiring more workers to ensure that most, if not all, of the patients, can be treated in time and not die waiting for medical help.    \u6211\u4eec\u5c06\u5b8c\u6210\u4ec0\u4e48   \u6211\u4eec\u5c06\u8d44\u52a9\u5728\u4e2d\u56fd\u6ca1\u6709\u8db3\u591f\u7684\u75c5\u4eba\u7a7a\u95f4\u6216\u9700\u8981\u66f4\u591a\u7269\u8d44\u7684\u533b\u9662\u3002\u6211\u4eec\u63d0\u4f9b\u7684\u8bbe\u5907\u548c\u7528\u54c1\u7684\u4e00\u4e9b\u793a\u4f8b\u5305\u62ec\u624b\u5957\uff0c\u53e3\u7f69\u548c\u66f4\u591a\u533b\u7597\u7528\u54c1\u3002\u6211\u4eec\u5c06\u4e3a\u533b\u9662\u63d0\u4f9b\u8d44\u91d1\uff0c\u4ee5\u4fbf\u4ed6\u4eec\u80fd\u591f\u83b7\u5f97\u66f4\u591a\u7684\u8d44\u91d1\u6765\u6269\u5c55\u5e76\u4e3a\u5176\u60a3\u8005\u817e\u51fa\u7a7a\u95f4\u3002\u6211\u4eec\u7b79\u96c6\u5e76\u5bc4\u7ed9\u4ed6\u4eec\u7684\u94b1\u4e5f\u5c06\u7528\u4e8e\u96c7\u7528\u66f4\u591a\u7684\u5de5\u4eba\uff0c\u4ee5\u786e\u4fdd\u5927\u591a\u6570\uff08\u5982\u679c\u4e0d\u662f\u5168\u90e8\uff09\u60a3\u8005\u80fd\u591f\u5f97\u5230\u53ca\u65f6\u6cbb\u7597\uff0c\u5e76\u4e14\u4e0d\u4f1a\u6b7b\u4e8e\u7b49\u5f85\u533b\u7597\u6551\u52a9\u3002",
