    "title": "Corona Virus - Help  doctors and nurses in China",
    "description": " Hello Everyone!  My name is Tina and I am a Chinese born Australian. I was born and raised by the very mothering land of China and as I feel the need to do something to help my motherland to overcome this terrifying Crisis!  As I work in the health care industry for the past 12 years, I travel to Chinese hospitals often, and I have a vast amount of channels to receive most up to date news. It is now WuHan hospitals that are most in demand of these medical equipments, there are more than 30k confirmed diagnosis, and much more infected. The hospitals in Wuhan are already OUT OF surgical masks and protective gowns, unfortunately, the government is also in shortage.  Your donations will be spent to purchasing N95 masks, procedural masks that has 99% bacterial filtration rate, and medical/surgical gowns which I have already sourced from. With the existing amount funded, I have already purchased (out of my own pocket for now until gofundme allows for withdrawal) 1100 procedural masks, 100 N95 masks and 50 surgical gowns. Note that there are still 350 gowns, 900 N95 masks and 4900 procedural masks available for purchase before they get sold out (which will happen in less than a couple of days), I need your support to ensure that our Chinese front line fighters are protected while they serve their patients.\u00a0  My friend will then bring back all these gears in person from Sydney to Beijing on 12th Feb and that is when the fundraising will stop.   Chinese Doctors and Nurses are currently treating tens of thousands of infected patients using recycled (washed in disinfectant solution) surgical masks, and lab coat\u2026\u2026\u2026. as there are NO MORE protective gear left for use!  So many of them are infected EVERYDAY, and then they go home and infect their family members. Every time I read a story, I am in tears\u2026\u2026\u00a0  Please chip in and help out to the first line Hero and Angels!  I thank you very much in advance! Tina  To update on the most recent progression of this activity (07Feb2020) - I have successfully sourced 1100 Procedural masks and 180 N95/P2 masks ready for shipping. - I am awaiting to receive 50 surgical gowns and am looking for more, if anyone has resources for medical equipments, please reach out to me on 0450225004.   UPDATE on 10Feb2020:   Thank you all so very much my dearest Chinese brothers and sister, together, we have made a total of almost 9000 over the past 5 days!! This is unreal!!  As many of you would have noticed, that the donation was disabled as of last night. The reason for this is because we have saturated existing stocks that we could get hold of, and the campaign needs to close prior to 11th Feb as all stocks will depart to Beijing on 13Feb.\u00a0  Having said that, I have obtained 2 more potential resources as of last night, and with successful establishment of both connections, and confirmed supply, the Campaign maybe reopened again, so please watch the space.  Wish me luck :)  All the very best to Chinese civilians...and hope that the outbreak will not be worsened with the end of the holiday period, today. ..",
