    "description": "I don\u2019t know where to start... it was the night if Thursday, Febuary 6th. I was hosting a medium sized gathering at my home in Narragansett, RI. Everything was going fine, and then it happened. A drunk girl smashed into my beloved corona sign, ending its life prematurely. The neon tubes shattered, and the palm tree shined its last light. Heartbroken would be an understatement. \n\nCan you find it in your heart to make up for this girls mistakes? Any amount helps, we need to get this sign fixed so that our house can be restored to its former glory. While money may ease the pain, nothing could ever fix the loss that all of us here at 9 feel in our hearts. Have a blessed day.",
