    "title": "Crona Strong! Please help Robert in his fight!",
    "description": "October 16, 2019 everything changed for Robert Corona, loving husband to Rachelle and father to Rae, Joey, Elijah and Nessa when they found out he had\u00a0 Stage IV Colon Cancer  at the age of 36.\u00a0\u00a0 From that moment Robert has said he will beat this! Robert has a large extended family and friends who we know will be right beside him loving and fighting with him!   \u00a0Hitting the ground running they decided to start curative treatment as fast as they could. With 3 months of chemotherapy, surgery \u00a0and another 3 months of Chemotherapy. He and his family will need our support and love as he embarks on this journey. There are many ways we can rally around Robert and his incredible family: prayers, meals, love and financial support.\u00a0    This means giving up a few things He loves and enjoys for the near future, like his job and little league. Robert has been a loyal hardworking employee for Berryessa Union School District for the last 18 years, a job which he has excelled at. He is well respected and loved at his job even being awarded employee of the year for all his hard work.\u00a0    Robert has since stepped down from being President of Berryessa Little League a passion of his, since his diagnosis.Robert has been an active part of little league since he first coached his daughter Rae in 2007 at North Valley. \u00a0In 2008 he started coaching for Berryessa Little League where he coached all of his kids, his nephews and countless children. \u00a0His loving sprit was always noticed on the field from racing the kids around the bases with 60 of his work keys clipped to his belt. Maintaining the fields for the league and at countless board meetings. If you didn\u2019t see him coaching or working on the field you could find him umpiring games .\u00a0    Robert is one of the easiest people to love and friend in minutes. \u00a0He is the only person I know who makes friends every single place he goes. Robert can walk into a party not knowing one person and by the end of the night he has made friends with everyone there making plans to see them again. With his outgoing and joking personality who wouldn\u2019t want to be his new friend. He would also give the shirt off his back and if you need any help he\u2019s the first to volunteer without you even asking. \u00a0He has the ability to make you feel as if you\u2019ve known him for years even after only just minutes of knowing him.    Robert also loves his wife Rachelle who he has been with for 20 years. He\u2019s a family man through and through You see that love and devotion in his 4 children. \u00a0His family is the most important thing to him. \u00a0Cancer will not stop him from doing anything and everything he can for them.   Anyone who knows Robert knows how loved he makes everyone around him feel. Through this journey Robert, Rachelle and kids will need our help. Robert and Rachelle will both be out of work during this (Robert being the main provider)and have lots of added expenses with lots of doctors visits, tests ,medicines special diet, gas and care along with their regular monthly expenses. All donations will go directly towards these things. Please help us make their next few months a little easier with one less thing to worry about. \u00a0Every little bit helps and we can\u2019t thank you enough in advance for your love and support.\u00a0    The road to recovery will have its ups and downs but we know that we will all rally around Robert, Rachelle and kids with any and all support we can give! \u00a0    Remember rule #1 from Coach Robert. \u00a0Have fun and always give 100%!!\u00a0     THEY WILL BEAT THIS!  \u00a0   If you\u2019d like to help support them in any other way please email chellelarae430@gmail.com   #CRONASTRONG \u00a0 #YOURFIGHTISOURFIGHT",
