    "title": "Help Vietnam fight through Coronavirus",
    "description": "English version:\n\n     My name is Quang Pham, a sophomore in high school who has recently moved to the USA to study.\n     As you are already aware of, the whole world has been concerned about the newly rise yet dangerous virus called coronavirus (Covid-19), which creates lung problems. Originated in Wuhan, China, the virus has spread throughout every continent, infecting more than 75000 people with 2009 killed as of February 19, 2020. The World Health Organization has declared the virus \u201ca global threat.\u201d And we need to help those in need of basic medical supplies to prevent the spread of the virus.\n     I want to address this issue to my home country, Vietnam, which declared the novel coronavirus outbreak an epidemic on February 01 with 16 people infected so far. Here, although many people are aware of the disease and try to take precautions, there are some \u2013 especially THE POOR - who do not have the fair chance to access the most basic safety. Because of the virus, the cost of face masks has risen dramatically; worse still, they are out of stock in many areas due to different reasons. The situation creates a huge disadvantage for the needy. I am organizing this fund to buy masks from the U.S. and give them to the people in poor areas in Vietnam which are currently facing a huge shortage of masks.\n     My goal is to get $2,500 for this fund; and we need to act quickly since the price of masks is changing constanly due to the shortage. The money will then be sent to a doctor that I have contact with to buy masks; then the masks will be sent back to some friends of mine in Vietnam who will help me distribute them to poor people. To start, I will donate $200 and I hope you will act quickly as well. Thank you for your consideration. Every penny counts!\n\nTi\u1ebfng Vi\u1ec7t:\n\n     T\u00ean con l\u00e0 Quang Ph\u1ea1m, con \u0111ang du h\u1ecdc l\u1edbp 10 t\u1ea1i m\u1ed9t tr\u01b0\u1eddng trung h\u1ecdc t\u1ea1i M\u1ef9.\n     Nh\u01b0 m\u1ecdi ng\u01b0\u1eddi \u0111\u00e3 bi\u1ebft, c\u1ea3 th\u1ebf gi\u1edbi \u0111ang quan t\u00e2m \u0111\u1ebfn d\u1ecbch c\u00fam virus corona, d\u1ecbch n\u00e0y tuy m\u1edbi nh\u01b0ng r\u1ea5t nguy hi\u1ec3m v\u00ec t\u1ea1o n\u00ean b\u1ec7nh vi\u00eam ph\u1ed5i. T\u00ean khoa h\u1ecdc c\u1ee7a lo\u1ea1i virus n\u00e0y l\u00e0 Covid-19. B\u1eaft ngu\u1ed3n t\u1eeb V\u0169 H\u00e1n, Trung Qu\u1ed1c, 2019-nCoV \u0111\u00e3 lan truy\u1ec1n \u0111\u1ebfn m\u1ecdi ch\u00e2u l\u1ee5c, l\u00e0m l\u00e2y nhi\u1ec5m h\u01a1n 75 ng\u00e0n ng\u01b0\u1eddi v\u00e0 gi\u1ebft ch\u1ebft 2009 ng\u01b0\u1eddi, t\u00ednh \u0111\u1ebfn ng\u00e0y 19 th\u00e1ng Hai, 2020. T\u1ed5 Ch\u1ee9c Y T\u1ebf Th\u1ebf Gi\u1edbi \u0111\u00e3 tuy\u00ean b\u1ed1 \u0111\u00e2y l\u00e0 \u201cm\u1ed1i nguy to\u00e0n c\u1ea7u\u201d. Ch\u00fang ta c\u1ea7n gi\u00fap \u0111\u1ee1 nh\u1eefng ng\u01b0\u1eddi trong v\u00f9ng c\u00f3 d\u1ecbch ng\u0103n ch\u1eb7n s\u1ef1 l\u00e2y lan c\u1ee7a virus n\u00e0y.\n     Con mu\u1ed1n \u0111\u00f3ng g\u00f3p s\u1ef1 gi\u00fap \u0111\u1ee1 n\u00e0y cho ng\u01b0\u1eddi d\u00e2n \u1edf Vi\u1ec7t Nam, l\u00e0 n\u01a1i \u0111\u00e3 tuy\u00ean b\u1ed1 t\u00ecnh tr\u1ea1ng d\u1ecbch v\u00e0o ng\u00e0y 1 th\u00e1ng Hai, v\u1edbi 16 ng\u01b0\u1eddi b\u1ecb nhi\u1ec5m b\u1ec7nh. M\u1eb7c d\u1ea7u ng\u01b0\u1eddi d\u00e2n Vi\u1ec7t Nam \u0111\u00e3 bi\u1ebft v\u1ec1 t\u00ecnh tr\u1ea1ng b\u1ec7nh d\u1ecbch v\u00e0 \u0111\u00e3 \u00e1p d\u1ee5ng m\u1ed9t s\u1ed1 bi\u1ec7n ph\u00e1p ng\u0103n ng\u1eeba, nh\u01b0ng v\u1eabn c\u00f3 nh\u1eefng nh\u00f3m ng\u01b0\u1eddi kh\u00e1c \u2013 nh\u1ea5t l\u00e0 NG\u01af\u1edcI NGH\u00c8O - \u00a0kh\u00f4ng c\u00f3 c\u01a1 h\u1ed9i c\u00f4ng b\u1eb1ng \u0111\u1ec3 ti\u1ebfp c\u1eadn s\u1ef1 an to\u00e0n c\u0103n b\u1ea3n nh\u1ea5t. Do t\u00ecnh tr\u1ea1ng b\u1ec7nh d\u1ecbch, gi\u00e1 kh\u1ea9u trang che m\u1eb7t t\u0103ng \u0111\u00e1ng k\u1ec3; nguy hi\u1ec3m h\u01a1n, nhi\u1ec1u n\u01a1i t\u1ea1i Vi\u1ec7t Nam kh\u00f4ng c\u00f2n kh\u1ea9u trang \u0111\u1ec3 b\u00e1n. T\u00ecnh hu\u1ed1ng n\u00e0y t\u1ea1o n\u00ean thi\u1ec7t th\u00f2i cho nh\u1eefng ai \u0111ang c\u1ea7n kh\u1ea9u trang. Con ti\u1ebfn h\u00e0nh cu\u1ed9c g\u00e2y qu\u1ef9 n\u00e0y \u0111\u1ec3 mua kh\u1ea9u trang t\u1eeb M\u1ef9 v\u00e0 g\u1edfi v\u1ec1 cho ng\u01b0\u1eddi d\u00e2n \u1edf nh\u1eefng v\u00f9ng ngh\u00e8o t\u1ea1i Vi\u1ec7t Nam.\n     M\u1ee5c ti\u00eau c\u1ee7a con l\u00e0 g\u00e2y qu\u1ef9 \u0111\u01b0\u1ee3c $2,500; v\u00e0 ch\u00fang ta c\u1ea7n h\u00e0nh \u0111\u1ed9ng nhanh v\u00ec gi\u00e1 kh\u1ea9u trang \u0111ang t\u0103ng li\u00ean t\u1ee5c do t\u00ecnh tr\u1ea1ng khan hi\u1ebfm. S\u1ed1 ti\u1ec1n n\u00e0y con s\u1ebd d\u00f9ng \u0111\u1ec3 mua kh\u1ea9u trang t\u1eeb m\u1ed9t v\u1ecb b\u00e1c s\u0129 con bi\u1ebft; sau \u0111\u00f3 con s\u1ebd g\u1edfi s\u1ed1 kh\u1ea9u trang n\u00e0y cho v\u00e0i ng\u01b0\u1eddi b\u1ea1n c\u1ee7a c\u00f4 n\u1edf Vi\u1ec7t Nam \u0111\u1ec3 \u0111i ph\u00e2n ph\u00e1t cho ng\u01b0\u1eddi ngh\u00e8o. C\u00e1 nh\u00e2n con xin \u0111\u00f3ng g\u00f3p $200 t\u1eeb s\u1ed1 ti\u1ec1n l\u00ec x\u00ec con \u0111\u01b0\u1ee3c cho trong d\u1ecbp n\u0103m m\u1edbi v\u00e0 con hy v\u1ecdng m\u1ecdi ng\u01b0\u1eddi c\u00f9ng h\u00e0nh \u0111\u1ed9ng nhanh. Con xin c\u00e1m \u01a1n m\u1ecdi ng\u01b0\u1eddi. M\u1ecdi s\u1ed1 ti\u1ec1n \u0111\u00f3ng g\u00f3p \u0111\u1ec1u c\u00f3 gi\u00e1 tr\u1ecb nh\u01b0 nhau!",
