    "title": "Nashville Double Tragedy - Tornado & Corona Virus",
    "description": "\n My name is Michael Gray and I'm homeless here in Nashville. A few weeks ago a tornado hit Nashville killing 8 homeless people as it tore through the Jefferson Street bridge homeless camp, destroying all the tents there and displacing a lot of people. Most of the resources we relied on to get by were now focused on the victims of the tornado who lost their homes; and rightfully so. \n \n\n Now we have the flu pandemic and we still have not recovered from the tornado. Most of the resources we depend on closed down because of the flu and we have been unable to get needed supplies now for weeks. The homeless camp I stay in has a lot of people with mental health issues who are homeless by no fault of their own. Most are unable to head into town to find help even if there was a place to go. I have been here for almost 6 months helping make sure everyone has what they need and it is now very difficult. \n \n\n We need supplies. Mostly water and food but we also need propane for cooking and for heat at night and batteries and flashlights. Essential items that we cannot get by without. Other problems most people don't realize we have being homeless are things like money to wash bedding and clothing and to purchase shoes, socks and new tents. If it wasn't for a few amazing people that have sent food and water, I don't know how we would have gotten by so far.\n \n\n If you can help, we need it. I would be able to purchase and distribute supplies where they are needed most if we had some funding, so please donate a few dollars if you are able. If not, please check on your neighbors even if you don't know them. Or ask someone who looks distressed if they need help. Because it's the right thing to do and a small act of kindness can travel through the hearts of dozens of people, and change the world. \n \n\n Thank you, \n \n\n Michael Gray - Founder of H.E.A.L. \"Helping Escape Addictive Lifestyles\" 615-541-3661",
