    "title": "COVID-19 adding to the struggle",
    "description": "We need emergency help with rent , bills and car payment. We have been given a short time to pay the late payments on our rent or we have been asked to move out. We have no place to go and no money to move if we had to leave. Had to stop Lyft driving which is my only source of income to protect my 82 yo mother who lives with me. No income for two or three weeks will really hurt our already drastic situation. If it goes longer than 3 weeks I am sure things will be so bad for us and many other families. Trying to get assistance to keep us in the house we are renting, but I know the landlords need to pay their bills too. Any help would be gratefully appreciated.\u00a0\nMy 82 yo mother who is in fragile health came to live with me in 2016 to make things easier on her and give her a better place to live and enjoy the rest of her life. She has survived breast cancer and is now needing new dentures but the dentist has major concerns that mom's lower jaw is too thin to get new dentures. So she is waiting to get into an oral surgeon to see if there is anything they can do. She has been on antibiotics to clear up a chest cold or infection in her sinuses that makes her cough and labors her breathing. \nMom's recent pain in the area where her breast was removed was examined by a doctor who ordered more tests. The tech that did her ultrasound said that she thought everything was looking okay. Hopefully the doctor will review the test and agree.",
