    "description": "      Hello. I'm \"Jae Hoon\" living in Korea. I am poor at English.  So if you use a language machine, please understand.   Thank you.  Currently, the Wnhan coronavirus is a very large threat worldwide. It's more dangerous than the Ebola virus, which was deadly years ago. The infection is very high, and today in China, it's a deadly evolution of human-to-human infections. I didn't take it seriously because I thought it was happening in China. However, over time, many felt infected and felt that they did not look at the current situation.  I investigated, but the situation was serious.  I wanted to help China and the country of the infected. But I do not have the knowledge of making vaccines. Currently, China and countries with infected people are said to be very short of masks and hand sanitizers.  Currently, foreign traders have purchased large quantities of high-grade masks in Korea. They sell at very high prices in their own country.  The cost of a Korean mask is $ 0.25. They sell at least $ 3 to up to $ 6 in their home country. The average income of a family in China is $500 a month.  It is very unfortunate and sad.  Currently, some parts of China are isolated when they are rich or poor or not wearing masks. If the number of infected continues to increase, all countries will be in danger.  So I want to help China and the infected country and the future. I will make a mask factory with my money. I will send relief goods to every country that needs a mask for free. But I have money that only makes factories.   Start fund-raising for mask parts purchase   Please.    I do not want the situation of Wuhan Coronavirus to get worse. And help people who are poor and cannot buy masks. I will build the factory early. And I'll make a mask and send it to many countries as a relief Help me. For the country and the world. If help is difficult. Tell your friends and family about this.      Thank you for reading this long article.",
