    "title": "DONATE MASKS TO WUHAN FIGHTING CORONAVIRUS",
    "description": "2019 Novel Coronavirus (2019-nCoV), first detected in Wuhan, China, is identified as the cause of an international outbreak of potentially fatal respiratory illness. The highly contagious virus spreads from person to person via respiratory droplets produced by the infected and contact with them. \n2019\u5e74\u5e95\uff0c\u4e2d\u56fd\u6b66\u6c49\u7206\u53d1\u65b0\u578b\u51a0\u72b6\u75c5\u6bd2\u80ba\u708e\u75ab\u60c5\u3002\u7814\u7a76\u663e\u793a\uff0c2019\u65b0\u578b\u51a0\u72b6\u75c5\u6bd2\u4e3a\u6b64\u6b21\u81f4\u547d\u75ab\u60c5\u7684\u7f6a\u9b41\u7978\u9996\u3002\u8fd9\u79cd\u75c5\u6bd2\u5177\u6709\u6781\u5f3a\u7684\u4f20\u67d3\u6027\uff0c\u80fd\u591f\u901a\u8fc7\u547c\u5438\u9053\u98de\u6cab\u6216\u8005\u63a5\u89e6\u4eba\u4f20\u4eba\u3002\n\n\nThe death toll worldwide has hit 170 with 7742 infected (including a 8-month-old baby, many other children and pregnant women) and 12167 suspected infected, and the numbers are still spiking. \n\u622a\u81f31\u670830\u65e5\uff0c\u6b64\u6b21\u75ab\u60c5\u5df2\u5728\u5168\u7403\u8303\u56f4\u5185\u4f20\u64ad\uff0c\u9020\u6210170\u4eba\u6b7b\u4ea1\uff0c7742\u4eba\u611f\u67d3\uff0c12167\u4eba\u7591\u4f3c\u611f\u67d3\uff0c\u60a3\u8005\u6700\u5c0f\u7684\u4e3a8\u4e2a\u6708\u5927\u7684\u5a74\u513f\uff0c\u5f88\u591a\u513f\u7ae5\u548c\u5b55\u5987\u4e5f\u611f\u67d3\u4e86\uff0c\u800c\u4e14\u8fd9\u4e9b\u6570\u5b57\u8fd8\u5728\u4e0d\u65ad\u5267\u589e\u3002\n\nMany more medical professionals are facing deadly threats as basic medical equipment like surgical masks are severely in short supply. Medical workers are saving millions of lives without considering their own safety; they are almost fighting with their bear hands in a dangerous environment while patients are flooding to the hospitals everyday. \n\u8d8a\u6765\u8d8a\u591a\u7684\u533b\u62a4\u5de5\u4f5c\u6295\u5165\u5230\u6551\u6cbb\u75c5\u60a3\u7684\u6218\u6597\u4e2d\uff0c\u4ed6\u4eec\u65f6\u523b\u9762\u4e34\u7740\u751f\u547d\u5371\u9669\uff0c\u56e0\u4e3a\u57fa\u672c\u7684\u533b\u7597\u7269\u8d44\u5947\u7f3a\u3002\u4ed6\u4eec\u62ef\u6551\u7740\u5343\u5343\u4e07\u4e07\u4eba\u7684\u751f\u547d\uff0c\u5374\u4e0d\u8ba1\u8f83\u4e2a\u4eba\u751f\u6b7b\uff0c\u4ed6\u4eec\u51e0\u4e4e\u662f\u8d64\u624b\u7a7a\u62f3\u5730\u594b\u6218\u5728\u6781\u5176\u5371\u9669\u7684\u73af\u5883\u4e2d\uff0c\u800c\u75c5\u4eba\u4eec\u6bcf\u5929\u5982\u6d2a\u6c34\u4e00\u6837\u6d8c\u5411\u533b\u9662\u3002\n\nHowever, nearly all N95 masks in China, Japan, and surrounding regions have been sold out. Luckily, we found a factory in St. Petersburg producing medical-use masks. \n\u4f46\u662f\uff0c\u4e2d\u56fd\u3001\u65e5\u672c\u6781\u5176\u5468\u8fb9\u5730\u533a\u7684N95\u53e3\u7f69\u51e0\u4e4e\u5168\u90e8\u552e\u7f44\u3002\u5e78\u800c\uff0c\u6211\u4eec\u5728\u4fc4\u7f57\u65af\u5723\u5f7c\u5f97\u5821\u627e\u5230\u4e00\u5bb6\u5de5\u5382\u53ef\u4ee5\u751f\u4ea7\u7b26\u5408\u533b\u7528\u6807\u51c6\u7684\u53e3\u7f69\u3002\n\nNow we are organizing this fund raising to purchase masks from Russia, and ship them directly to hospitals in Wuhan, China, the epicenter of the outbreak. We have contacted the local hospital (Wuhan Union Hospital) and they confirmed that the masks conform to standard. \n\u73b0\u5728\uff0c\u6211\u4eec\u53d1\u8d77\u8fd9\u573a\u52df\u6b3e\uff0c\u5168\u90e8\u5584\u6b3e\u6263\u9664\u8fd0\u8d39\u3001\u901a\u5173\u5173\u7a0e\u5c06\u5168\u90e8\u7528\u4ee5\u4ece\u4fc4\u7f57\u65af\u8d2d\u4e70\u53e3\u7f69\u5e76\u76f4\u63a5\u8fd0\u9001\u56de\u8fd9\u6b21\u75ab\u60c5\u7684\u4e2d\u5fc3\uff0c\u6e56\u5317\u6b66\u6c49\u3002\u6211\u4eec\u5df2\u7ecf\u4e0e\u5f53\u5730\u533b\u9662\uff08\u6b66\u6c49\u534f\u548c\u533b\u9662\uff09\u8054\u7cfb\uff0c\u4ed6\u4eec\u786e\u8ba4\u8fd9\u6279\u53e3\u7f69\u7b26\u5408\u4ed6\u4eec\u7684\u63a5\u6536\u6807\u51c6\u3002\n\nJust now, doctors of Wuhan Union Hospital cried for medical supplies. The storage is not insufficient, it is depleted!\n\u4e0d\u4e45\u524d\uff0c\u6b66\u6c49\u534f\u548c\u533b\u9662\u7684\u533b\u751f\u53d1\u51fa\u6c42\u63f4\u4fe1\u606f\uff1a\u4ed6\u4eec\u7684\u533b\u7528\u7269\u8d44\u4e0d\u662f\u544a\u6025\uff0c\u800c\u662f\u5168\u90e8\u8017\u5c3d\uff01\n\nWe need your help!\n\u6211\u4eec\u4e9f\u9700\u4f60\u7684\u5e2e\u52a9\uff01",
