    "title": "Defeat COVID-19 with portable protection",
    "description": "With the continued epidemic's coming from China,  SARS-CoV ,  Bird Flu  (H5N1),  Middle East Respiratory Syndrome  (MERS) and now  COVID-19  we need a device that can protect people from airborne viruses.\u00a0 This would also help eliminate the yearly flu, when used with proper precautions, such as washing your hands.\u00a0 I have already developed, patented and tested the cartridge idea, but now need to make it a reality for personal use.\u00a0 I started working on the idea when the SARS outbreak happened, but as all great ideas, personal life gets in the way.\u00a0   The original idea was for a room sized device that could protect a large area.\u00a0 I called it the UVBioClean.   This is still valid but the cost to manufacture is higher and there is still a higher chance that it would not filter the virus in the placed room, or in travel before it could make contact with someone. For this reason, I would like to take the same principles and design a small personal device, that could be carried (similar to cell phone), and could be used everywhere. I need your help to bring this to reality!\u00a0 With the proper amount of funding and moving forward with all previous work, time and money spent, I believe we can make such a device that can be affordable and practical to use everyday and SAVE LIVES!\u00a0 ( Death toll from the CoVID-19 already at 3,043 with 88,948 infected globally )     All studies are scientifically proven and so a personal device could be as small as a can of soda, using a USB charge port/battery to provide power. This is a reboot of many years of work and concern for the health of everyone that are effected every year by the flu and then the OUTBREAKS of unknown killer viruses that come from around the world. To build such a device is the humane and practical idea that could be disseminated to everyone who is susceptible with low immunity to all airborne viruses know today. (AIDS, elderly, cancer treatment, etc.)\u00a0\u00a0 I will be needing to find a smart team of design engineers (already have some concept ideas), manufacturing, developers, etc...    We need to start now, as the re-design (small device), prototype and manufacture process takes time and we need to get this personal safety device distributed to many people to STOP the spread of the virus and save lives!    Watch a dramatization of a virus being destroyed within the cartridge.      UVC destroys the viruses ability to propagate, it makes it sterilized. The DNA of Virus Destroyed!       https://www.who.int/emergencies/diseases/novel-coronavirus-2019/situation-reports/",
