    "title": "Poor Vietnam Dealing Corona Virus on Risk!",
    "description": "\n\n\n\n\n\n\n\n\n\n\n\n\n Hi ,   \n \n\n\n\n\n\n\n\n\n\n\n\n\n\n As you have known that corona virus widely spread out in China. And now, in Vietnam, there are cases increasingly and there having people get isolated even though we could not know how many as an exact number have died. From the countryside and uplifted areas of Vietnam, there are a lot of the poor. It is actually hard for them to survive if there aren\u2019t enough medical supplies and food. I am afraid in the coming days the Corona virus could able to spread out. As you know that my hometown-Vietnam is one of low growth countries, they don\u2019t have foods, medicine or even medical supply or even the hospital to secure the patient as Chinese people did. I don\u2019t want to see my home country Vietnam will become the second center of disease outbreak in the upcoming days. It is sympathy for the death in China and it is heartbroken since I know that one day it can able happen in Vietnam in near future because my country is having lack of foods medical supplies, and many of poor in uplifted areas and countryside are facing dealing with many difficulties. \n\n\n\n\n\n\n\n\n\n\n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n  I watched videos everyday, I felt heartbroken to know in China the number of death increases everyday and can not count how many the number of people and places getting infections. I think that it would happen in Vietnam soon. I think I may do something other than just seat and watch videos. I want to do something to help other people in my hometown. I want to give hand to help others prevent this disease because I knew that they need our help. I think I have to do something other than just scowl in silence.\u00a0\n\n\n\n\n\n\n\n\n\n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n  My family is Catholic, my mom and my dad told me pray for the disease everyday. Yes, of course, I do pray everyday, I pray for the health of the world. I knew praying is necessary but still not enough to prevent the epidemic from spreading and harsh, I need to do something more realistic. That is a reason why I make this fundraiser because I hope I could able to receive some fund in order to buy more foods, medicine and medical supplies for the poor people in Vietnam.   Everybody have a dream, yes, they are now dream of being cured in times of danger. China is now a center of the disease. Vietnam is close to China if Vietnam is going to be an outbreak, it will break out in the coming days. Wealthy China still has the ability to cope, and Vietnam is a slow-growing poor country, poor people will be miserable. For those people who live in the countryside, the uplifted the highland areas are the people who need to help because their life is still hungry, torn clothes, let alone plague. They do not have the means to cope with the Corona disease. They need food, medicine and medical supplies to prepare for the coming disease. \n\n\n\n\n\n\n\n\n\n\n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Yes, counting people in sickness in one country is tough. We can do math here, it is hard to imagine if we can count how many country have their residents involved to the sickness and from there, it spread out to other relatives and community, number would be increased. Please do math again, we can multiply them together, get any number you want. Next, for rich country they can able to secure them or have enough food and medical supply to help the patient, but with poor country, there will be more people die in silence and the virus could be able to widespread. I feel sad if I keep continue to multiple them again and again...I have thought that is there are any way to stop the spreading. I just cannot imagine which is the better way to help them, but I knew that they need our help sooner. I think the more we try stoping spread out of Corona disease sooner is the more better for everybody surround and better for also other country near by.     \u00a0\n\n\n\n\n\n\n\n\n\n\n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Last but not least, I hope I can have your helping hand. I will use all this donation for the charity - getting more foodstuffs and medical supply for the poor in Vietnam. I am appreciated for any help that you could make. Please save the poor Vietnam on preventing the Corona Virus. We need your help in the near future. Please\u00a0save  Vietnam on preventing the Corona diseases. God bless you, Amen!\n\n\n https://www.change.org/p/united-nations-call-for-the-resignation-of-tedros-adhanom-ghebreyesus-who-director-general?recruiter=1043450372 utm_source=share_petition utm_medium=sms utm_campaign=psf_combo_share_initial recruited_by_id=f47da0b0-51d1-11ea-a544-938f2b557b3e \n\n\n\n\n!",
