    "description": "Jaime and I have lived in Hong Kong for 15 years and the experiences this city provides, shapes us into the people we are today. Its given us the opportunity to build great personal and professional relationships.\u00a0 It is our home and the people of Hong Kong are our community.\u00a0  The coronavirus has spread to HK and the exact course it will take is unknown. Currently, the focus of many HK citizens is prevention and the ability to take care of themselves and their family. There has been a run on basic supplies, lack of supplies and retailers who take advantage by price gauging. Some call this survival instincts, hysteria and others think it's fueled my rumors. Either way, the reality is people gain peace of mind when they have reserves of necessities and others simply do not have the means to procure them.  My family and I were able to leave HK before the virus spread and receive daily requests to send supplies from the US back. Many of the requests come from work colleagues, other factory owners and my own China workers/team.  The main requests are:  Face Masks - basic surgical and N95\u00a0 Hand Sanitizer Antibacterial Wipes - for hands and home Lysol Disinfectant Spray\u00a0 Toilet Paper\u00a0  We purchased a lot of supplies ourselves but ask our friends and community to help in our ability to do more. We hope through fund raising we can purchase larger quantities and more frequently ship items back by Fedex (USPS suspended shipping to HK/China).  None of the items purchased through fund raising will be put to personal use. We will disseminate the products to the families of our factory workers , local cleaners, the elderly (drop off at local elderly homes and centers) and charities who help those with limited financial means.  We truly appreciate all the support, concern and love.",
