    "title": "In the pursuit of science!",
    "description": "As we\u2019ve all heard, the new coronavirus has swept through China and is slowly creeping into the rest of the world. Currently there has been a lot of speculation on whether or not the virus can be spread during its incubation period. Or through Individuals who show no symptoms. If this page raises 100,000 dollars I will contact the CDC on and offer myself as a Guinea Pig. To be locked in a room with either confirmed cases with no symptoms, or confirmed cases that are too early to show symptoms. If it\u2019s proved that neither Asymptomatic nor incubating individuals are transmitting it. Then I will allow them to test the distance the virus travels in aerosols or how long droplets can live on a surface. My only real rule would be that the tests be done in a western country (preferably the United States) and atleast 20% of the staff speak English so I understand what\u2019s going on.",
