    "title": "Medical Supplies for Corona Virus Prevention",
    "description": "\n My hometown Wuhan is deeply affected by the coronavirus outbreak and my family members, as healthcare professionals, are working in Tongji hospital, one of the major hospitals in the province helping with the infected patients. As of now, the death toll from the coronavirus rose to roughly 1,360, and the total confirmed cases worldwide surpassed 60,000.\n \n\n Tongji hospital is currently in great need of medical supplies, including n95 masks, surgical masks, safety goggles, surgical gloves etc. All medical personnel will be starting to work full-time in the following weeks and all masks need to be changed every 4 hours to ensure their effectiveness. Therefore, with your donation of a small amount could prevent people from being endangered by the virus.\u00a0  As the supplies have run out in stores, we are fortunate to collaborate with Tzu Chi Medical Foundation located in Alhambra, CA to get the medical supplies and donate them directly to the Tongji hospital in Wuhan.  Again, your contribution is greatly greatly appreciated! Please email me at  linadu628@gmail.com \u00a0should you have any questions.",
