    "title": "Coronavirus Dancing Victims",
    "description": "The recent Coronavirus crisis has touched on every aspect of our lives and livelihoods. \u00a0And, this epidemic has severely affected our beloved dance world. \u00a0From the cancellation of three major Asian Open competitions, to the lockdown of an entire city, and to the many travel restrictions in and out of Asia that has been set in place our world, and especially our dance world, has been severely impacted.  In the meantime, one can only imagine how difficult it must be for some dancers in the Far East to dance, find work, and even continue to survive in the current conditions. \u00a0Some of them have lost all their work and income completely. \u00a0Studios are being closed down. \u00a0They are struggling to not only earn enough money but to even just stay healthy as some are even fighting the deadly virus. \u00a0These people, these dancers, are our colleagues, students, and friends. \u00a0They are suffering and struggling to survive!  We, at the WDC Competitors Commission as well as the WDC and WDCAL, would like to ensure that we do everything we can to help our fellow colleagues and dancers in the Far East. \u00a0We would have set up this GoFundMe page to help our fellow dancers in the Far East and we want to encourage our friends, patrons, vendors, suppliers, and colleagues from around the world to pull together and help one another in overcoming this crisis. \u00a0We are asking everyone to extend your hand and support for our fellow dancers. \u00a0Your donation will be a great help for the dancers that have been affected the most by this deadly virus in the epidemic city of Wuhan and other neighboring affected cities in the Hubei Province. \u00a0  Your donations will be greatly appreciated and all donations will go to the NDC of China, a member organization of the World Dance Council, for distribution to those dancers that need it the most. \u00a0Any donation will go a long way for those greatly affected by this terrible virus! We at the WDC CC would like to thank you for your time, consideration, and support for your fellow dancer!  The Management Committee of the WDC Competitors Commission",
