    "title": "Aufkl\u00e4rung zu Coronavirus Covid-19",
    "description": "  Das Coronavirus Covid-19\u00a0 hat viel Aufmerksamkeit in der letzten Zeit erfahren.\u00a0      Man wei\u00df, dass dieses Virus die Gefahr in sich birgt, zu einer Pandemie zu werden, der Millionen an Menschen zum Opfer fallen.    Doch wie man handeln sollte, muss jeder sich erst m\u00fchsam selbst zusammen-suchen.    Im Interesse eines jeden ist es, dass er kurz und knapp informiert wird, wie weit das Virus sich verbreitet hat, welche Schutzma\u00dfnahmen entsprechend der fortschreitenden Entwicklung er ergreifen sollte und wie er sich am besten verh\u00e4lt, wenn er mit Infizierten in Kontakt kommt oder selbst erkrankt.      Mit dieser Sammlung hier, soll f\u00fcr diesen Zweck von meiner Seite ein Beitrag geleistet werden, um die negativen Folgen f\u00fcr die Menschheit zu minimieren.      Dieses Programm wird dann sukzessive um weitere Gefahrenpotentiale erweitert.\u00a0      Damit diese Aufgabe erledigt werden kann, bitte ich um zahlreiche Spenden, f\u00fcr die ich mich dieser Stelle schon jetzt bedanke.\u00a0      Bitte schauen Sie in den folgenden Tagen auf diese Seite, da hier noch der Verweis auf die zugeh\u00f6rige Webseite ver\u00f6ffentlicht wird.      Auch noch einmal am besten Dank f\u00fcr Ihre Unterst\u00fctzung\u00a0      Dirk",
