    "title": "ICBCers Combat Novel Corona Virus",
    "description": "Novel Coronavirus(2019-nCoV) is a new respiratory virus first identified in Wuhan, a big transportation hub in China. The virus is highly contagious and it's appearance during the peak of Chinese New Year has allowed it to spread to other cities. It has now passed SARS in deaths, and is several times more infectious in its spread.   As of February 13, 2020, according to the government's report in China, 63,851 people have been diagnosed with coronavirus, 10,109 people are suspected of being infected and 1,380 people have died.  These numbers increase every day, it is threatening the lives of hundreds of millions not only in China, but around the world.   China estimates that the peak of the infection rate will be around mid-February, the most difficult time has yet to come. In all Chinese cities, schools are delayed and all public facilities are shut down. Due to the unexpected outbreak, hundreds of millions of Chinese people's lives are at stake.   Items such as: masks, goggles and protective suits which are used to combat the spread of this disease are high in demand but low in supply. We need your help to fight against this devastating illness.\u00a0  We appeal to all people with kindness, please participate in our crowdfunding!  Gathering sand into a tower, love is boundless! Together we work together!\u00a0  We firmly believe that with your help, we will definitely win this fight against the disease!  \u6ca1\u6709\u4e00\u4e2a\u51ac\u5929\u4e0d\u4f1a\u8fc7\u53bb\uff0c \u6ca1\u6709\u4e00\u4e2a\u6625\u5929\u4e0d\u4f1a\u5230\u6765\uff01  \u805a\u6c99\u6210\u5854\u3001\u5927\u7231\u65e0\u7586\uff01 \u4f17\u5fd7\u6210\u57ce\uff0c\u540c\u821f\u5171\u6d4e\uff01",
