    "days_active": "28.0",
    "days_created": "28.0",
    "title": "Help Fight the Coronavirus!",
    "description": "The current NCP (Novel coronavirus pneumonia) epidemic in China has caused tens of thousands of infections. As of February 11th, there were 42,715 confirmed infections and 1,017 deaths, and number of confirmed and suspected cases has increased by more than 5,000 every day. Wuhan is the largest outbreak area in China, however, the total geographic area affected by the virus encompasses approximately 70% of the county at present. And the number of infected people in various provinces across China is increasing.   \u00a0  Since the outbreak of pneumonia (which is caused by the coronavirus), Shenyang City, as the center of Liaoning Province, is implementing a centralized treatment program for patients with corona virus-related pneumonia in Shenyang and 7 surrounding cities. And the Chinese government also remains at the forefront of efforts to contain the current epidemic prevention, as well. Together with the medical community (hospitals and physicians) and Chinese citizens, the government of China is aggressively working to curb the spread of the virus and protect everyone\u2019s health. Everyone should continue to work together to help eradicate this public health threat. \u00a0  The medical community is also taking steps to maximize the supply of available protective clothing and sanitary masks; however, demand for these items currently exceeds available supply. In order to improve prevention and control of the epidemic, several key hospitals in Liaoning Province have put forth proposals to all sectors of the society, asking for domestic and international assistance by donating urgently needed protective garments and masks to Liaoning Province.   As a Liaoning native living here in the United States, Mr. Ming Li has been working to help provide protective medical garments and masks for the people in his hometown, as well as for medical staff members. Thanks to everyone\u2019s assistance, the first batch of N95 protective masks and medical protective clothing are already on their way to China.   Primary protective healthcare materials include:   \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 N95 mask (International Standard: ISO22609:2005, American Standard: NIOSH, N95/N99 + Fluid resistant, European Standard: EN14683-2005, Chinese Standard: GB19083-2010)  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Protective Eyewear (elastic wear (compatible with myopia), wide field of vision, splash-proof function, without ventilations, such as: 3M 1623AF)  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Protective Clothing (International Standard: ISO22609:2004, American Standard: ASTMF1671-A, SH 42 CFR84; ANSI/AAMI, EU Standard: EN14126, Chinese Standard: GB 19082) \u00a0 We continue to need donations to provide desperately needed medical supplies to all affected areas in China.\u00a0 All donations will strictly be used to purchase medical supplies and provide shipping costs for sending to key hospitals in Liaoning Province, such as:  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 The Sixth People\u2019s Hospital of Shenyang (Liaoning Infectious Disease Hospital)  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 The First Affiliated Hospital of China Medical University  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Shengjing Hospital Affiliated to China Medical University \u00a0 Please help us with your generous donations and we\u2018ll continue to do our best to provide the assistance needed to help everyone who has been affected by this event. With your support and best wishes, more of those in need will be treated!   Thank you for your support!   Co-Organizers:   Ming Li\uff0cUSEWARE.INC CEO  Alana Zhang\uff0cUSEWARE., INC   White Yang\uff0cShenYang Xixin Technology Co., Ltd.\u00a0 Marketing Manager  \u00a0 Tracking information: Liaoning sent more than a thousand medical staff to Hubei to fight the epidemic   An epidemic is currently raging in China! Under the strong leadership of the Liaoning Provincial Party Committee and the Provincial Government, and in accordance with the decision of the provincial epidemic prevention and control headquarters, Liaoning Province supports the Hubei Medical Team, the Disease Control Team, the critically ill medical team, and the Liaoning National Emergency Team. The Medical Rescue Team successfully went to Hubei to fight the epidemic on the ground. From January 26th to the evening of February 9th, Liaoning Province has sent a total of 6 medical teams and a CDC team with a total of 7 doctors, a total of 1382 people have assisted Hubei and assisted Wuhan, Xianning and other places to carry out the new crown pneumonia epidemic prevention and control.  \u00a0 It\u2019s understood that after arriving in Hubei, most of the medical staff of the Liaoning Medical Team will enter the Lei Shenshan Hospital to work with medical staff at the Wuhan University Zhongnan Hospital and other institutions to fight the new coronavirus pneumonia epidemic. \u00a0  The value of your donations is powerful and desperately needed.   For example: your $100 pledge purchases N95 type protection masks with varying levels of effectiveness, based on specific use.  A $100 donation will allow us to supply the following valuable protective material:   \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Five 3M 1860 Medical Masks (4-hour effectiveness time rating)  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Thirty 3M 8210 Standard N95 masks (4-hour effectiveness time rating)  Healthcare providers wearing these masks protect them from being exposed to the virus while providing help to those who are infected, which is critical for success in overcoming this health crisis!  \u00a0 \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 For any donations, you\u2019ll receive a poster pin or background screen saver about supporting the Wuhan Virus Relief Campaign.  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 For donations over $100, you\u2019ll receive USB flash drive with \u201cWuhan Jiayou\u201d inscribed.  \u00b7\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 For donations over $200, you\u2019ll receive a \u201cWuhan Jiayou\u201d T-Shirt.  Able Software is offering to help provide badly needed medical supplies to the affected areas in China.  The Able Software cooperative corporate donation program allows our valued customers an opportunity to generously donate to the Wuhan Virus Relief Effort campaign. Able Software will gladly provide complimentary Utility Star technical services free of charge to our customers who wish to make a corporate donation. \u00a0 Please note: all pictures provided are from taken from internet content. If there is any infringement issue, please inform us as soon as possible so we can remove the content.",
