    "title": "Helping with Coronavirus in China",
    "description": "\n Current situation: The  coronavirus  (SARS-Cov-2) is spreading, which as of today 14th Feb 2020 has infected  56951  people in China and  57396  people around the world in total. Wuhan, where the outbreak started, has 34289 people infected, and has been quarantined for 22 days.  Medical\u00a0supplies such as protective clothing are in shortage  and hospital workers are contacting the virus, especially as the gear needs to be changed.\u00a0 If you would like to find out more: [  https://www.cnn.com/2020/02/13/asia/coronavirus-health-care-workers-infected-intl-hnk/index.html  ]  What we think: Even in this overwhelming situation, we are still trying to contribute what we can as ordinary people. My friends and I have been wanting to do something, to protect the people that are fighting the virus in the hospital, and to protect individual from getting infected. For those who may not know, the Red Cross has been notoriously unreliable for getting supplies hospitals in the current crisis, and we want to act directly. [  https://www.cnn.com/2020/02/06/asia/red-cross-china-donations-intl-hnk/index.html ] \u00a0  What we are going to do: We are in contact with  a Chinese manufacturer of protective clothing , to purchase more supplies to send to  Tianyou Hospital in Wuhan .  Tianyou Hospital is a designated hospital for coronavirus. (We have contacted the hospital and confirmed that they are in shortage of the protective clothing we could provide).   While unfortunately we  have not been able to find protective suits that would meet the highest requirements for use by ICU staff ,  these suits will go to protect other hospital workers who is facing the risk . Those suits meet  the specification of GB19082-2009 (Chinese official standard), and manufacturer\u2019s qualification has been verified by the receiving hospital.\u00a0 My friends and I will be donating 200 suits, and I would like to invite anyone else who would like to contribute to donating more units.  As\u00a0 we hope to contribute as soon as possible,  we aim to place the order with however much we can raise by the end of today .\u00a0\n \n\n current and future situation will be updated here:   https://docs.google.com/spreadsheets/d/11Jkkc0ksYspk4iqxgPKpdrMjdQt-qKCW01ePJwkoYXo",
