    "title": "care about corona virus",
    "description": "we fight the corona virus together  The number of deaths due to Coronavirus Novel (2019-nCoV) or COVID-19, continues to double around 100 lives each day. Today, as of 08.20 Jakarta time, there were 44,911 cases infected with Corona Virus, 1,114 of whom died, and 4,699 others were declared recovered. It was based on data compiled by Johns Hopkins University Center for Systems Science and Engineering (JHU CCSE).  If calculated from the previous day, today has added 1,770 new cases that have been infected, claimed 96 lives, and 359 people have been cured.  Based on data released by WHO yesterday: In Singapore, there were 47 cases of someone infected with the Corona Virus, 23 of whom were traced to have a travel history from China. Whereas in the Philippines there were 3 cases and 1 person died because of this virus. Then in other nearby countries of Indonesia: 15 cases in Malaysia, 15 Australia, 33 Thailand, and 15 Vietnam.  World Health Organization (WHO) Director General Tedros Adhanom Ghebreyesus confirmed that 42,708 confirmed patients were located in China. A total of 1,017 people in the country have died due to Corona Virus. The highest mortality rate is in Wuhan, Hubei Province, China.  \"Outside of China, there are 393 cases in 24 countries, and 1 death,\" Ghebreyesus said yesterday.  Ghebreyesus asserted, since yesterday, the number of deaths has exceeded a thousand. He warned of the global threat of death from the Corona Virus, potentially worse than terrorism.  \"Viruses can have stronger consequences than any terrorist act,\" he said.  The Indonesian government, until now still claims that no Corona Virus has been detected in the country. Minister of Health Terawan Agus Putranto asserted, until now the filtering pattern carried out has been in accordance with international standards.  \"Everything has been checked. Our equipment has been fixed yesterday with the US Embassy, \u200b\u200bwe are using kits (equipment) from America,\" Terawan said yesterday.",
