    "title": "AMERICAN CORONAVIRUS PATIENT",
    "description": "Hello,\u00a0 My son, Emmanuel, and I were evacuated from Wuhan on the 4th of February by the US embassy. My wife was not able to leave on the evac flight, because she is a Chinese citizen who only has a tourist visa and not a green card.\u00a0 In addition, her father is infected with the corona virus and she wanted to stay to take care of him. Since we arrived in the US, his condition have seriously declined.\u00a0 His oxygen level plummeted to 70, from 99 just two days before.\u00a0 \u00a0We are waiting for CT scans, but we were told he is dying.\u00a0 The hospitals won't admit him to the intensive care unit because there are no beds available.\u00a0\u00a0  Three months ago, we lost her mother to a massive stroke.\u00a0 This is just too much for us, especially my wife and son, who constantly asks where \"Nai Nai\" is (grandma). If the worst happens, my wife would not be able to hold a traditional funeral, as bodies are immediately sequestered and cremated, without the family being around.\u00a0\u00a0  We hope that with this money, we can help pay our bills in America for Emmanuel and I.\u00a0 The quarantine is free, but flights out of California to family in the East coast is very expensive, as was the 3,600 dollar trip from China.\u00a0 We also hope to be able to get my wife here with us.\u00a0 I can't imagine her going through another funeral, all alone this time. We hope to use the funds to pay for our expenses here in American, but also to send much needed supplies to my wife in China.\u00a0 Roads and public transport in the city are closed and medication is extremely hard to get a hold of.\u00a0 Even face masks are being sold one per person. Now that my baby is safe, my concern is making things easier for my wife, as much as possible.\u00a0 We miss her dearly and I know what she is going through with her father, without her family to support her, is destroying here.\u00a0 I don\u2019t know what to do, but I want to try anything I can. With your donations, I hope to be able to pay for these unexpected expenses. These include repaying the US government 3,600 dollars for the flight to New York, additional flights to my families home in Philadelphia, clothing for my three year old (we were told to pack light and the weather where we live is much warmer than in Philadelphia ). In addition, since Chinese banks only issue one bank card per account, we decided my wife should keep it so she can pay for medical bills there, but food, pay rent, etc. As such, paying for necessities here in America will be a challenge. Also, in the unfortunate occurrence that my son and I need medical care (I take prescription medicine) my insurance is not valid in the United States. Finally, we hope to be able to fly my wife to America, to reunite our family Thank you for taking the time to read this and thank you for any donation you may give.",
