    "title": "Help a Teacher during the Corona Virus Outbreak",
    "description": "Hello, I am currently an elementary teacher in Hanoi, Vietnam. It\u2019s a very rewarding and exciting job- that is when the COVID-19 aka Corona Virus doesn\u2019t force the schools to close. The information about the closures has come to the public schools within a days\u2019 notice one week at a time. It has been proposed by Ho Chi Minh city that schools could stay closed until April. I am on forced unpaid leave and it is likely going to last 2 months.\u00a0 During this time of uncertainty we don\u2019t know until when as the information comes out at the last minute.  \u00a0I really miss teaching my students and guiding them to enjoy learning English through games, activities, and prizes.     Since I can\u2019t teach my students due to the forced shut down, I would like to do something more useful and meaningful with my time. Instead of hiding from the Virus in my little apartment in Hanoi for another month, I\u2019ve decided to try and make the most of my time to go back to volunteering for a bit. So, I am asking if anyone would like to help me make it to Nepal/ or the Philippines, wherever the need is the greatest and cheapest to volunteer. \u00a0  \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 I am 100% committed to using my skills and time volunteering during this break so I will make whatever I get work! So, every dollar, penny, dong, like, share, or positive message you can share, whatever you can throw my way counts! I have already been approved to go volunteer so now I just need to get there!!! Thank you for reading/sharing  3  Some of the cost include the transportation, visa, food/accommodations, and some materials needed. If you have any questions, please do not hesitate to ask!",
