    "title": "Fight COVID-19, Stand with Wuhan",
    "description": "Change a Life Today. Donate now. \u00a0 Dear friends,  COVID-19 doesn\u2019t discriminate against our race, age, gender or nationality. Helping people in Wuhan, the epicentre of the deadly coronavirus outbreak to contain the spread of the epidemic is helping ourselves.  A plague at such scale would be disastrous for any city in the world. All hospitals in Wuhan reported low stock on medical supplies as they are experiencing an unprecedented patients intake each day.  Frontline healthcare professionals and first responders, amidst the lunar New Year holiday, are working 24/7 to treat the sick, save lives and bring this outbreak under control. They skip meals and washroom breaks in order to save on disposal of protective coveralls.  The emerging, rapidly evolving situation touches the hearts of billions of people worldwide.  This coronavirus relief campaign aims to provide desperately needed medical supplies such as masks, hazmat suits and gloves to the frontline healthcare workers and hospitals in Wuhan, to help prevent the spread of the virus.  To date, 40,000 pairs of gloves and 10,000 isolation gowns are en route to Wuhan. Protective goggles, impact-proof masks and hazmat suits worth $25,000 are being purchased.  We are proud to announce our partnership with the Crackup Ottawa Comedy Festival! A portion of their ticket sales for DASHAN AND FRIENDS on Thursday, March 26 and CRACKUP OTTAWA FESTIVAL FINALE on Friday, March 27 will be donated to our coronavirus relief. Details of the events can be found here -   http://www.crackup.ca/events  .  Crackup Ottawa will also be promoting our \u201cGoFundMe\u201d campaign with the goal of raising an additional $100,000 in private and corporate donations from the Ottawa and Canadian comedy community.",
