    "days_created": "25.0",
    "title": "Wuhan Coronavirus",
    "description": "Hello everyone, My name is Kirsten and i am a Chinese Australian living in Melbourne. As a Chinese, I feel the need to help my people in need.\u00a0 As you all know, the Corona Virus disease has claimed the lives of over 1000 people and over 70,000 people are affected with the numbers going up every single day.  Hospitals in Wuhan are running out of medical supplies and the money donated will go towards hardworking medical staff who are risking their lives to help fight the virus and victims affected by the deadly virus. It will also go towards buying protective supplies from around the world and send it to hospitals in Wuhan and all the small cities in the Hubei province. for patients and medical workers to ensure they are safe and protected from the virus.\u00a0  The money donated will go into buying N95 masks from different places around the world, these masks will go to medical workers and people in Wuhan and the other small cities in the Hubei province, those people have less access to medical supplies but the virus there is just as deadly.\u00a0  The masks will also go to regular citizens in Wuhan and Hubei province who may not have enough money to buy masks as many sellers have raised the price of face masks when people need them most to ridiclously high prices.  You may not know this but Hospitals in Wuhan right now are a living hell, hospitals have run out of beds for patients and medical supplies like masks are running low. People are collapsing in hospital hallways and medical workers are working hours non stop to save lives. Doctors and nurses and other medical staff have been infected by the virus and are dying every single day.  Even a bit of your money can help those people in desperate need, although this might not affect your daily lives, people in Wuhan are in a living hell right now. As humans, we must stick together during tough times and together we can help fight this virus.\u00a0  If you cannot donate, please share this around and help spread awareness, thank you for your kindness and willingness to help. \u6b66\u6c49\u52a0\u6cb9!!   I will keep you guys updated :)\u00a0 \u00a0  Here are some links and videos of the situation in Wuhan right now   https://youtu.be/OSi9fCSZbgE      https://youtu.be/XAHOnZNRvZI  \u00a0   https://youtu.be/2Dpf7pli5Ag  \u00a0   https://youtu.be/m6S51KPWKCY",
