    "title": "Help Wuhan and Other Cities Defeat COVID-19",
    "description": "Keep Helping China! Keep Saving Lives! Help Reconstruction!\u00a0  The outbreak of the novel coronavirus (2019-nCoV) is sill under way in China, especially in Wuhan and other cities in Hubei province. Wuhan and at least 15 other cities (including Huanggang, Huangshi, Jingzhou, Yichang, ... ) have been quarantined as China attempts to halt the spread of the coronavirus. That's more than 50 million people on lockdown. Plenty of stress but shortage of everything else for these cities. There are not enough hospitals and not enough beds, not enough doctors and not enough nurses, not enough rubber gloves and not enough face masks. Millions of people are suffering from infections, panic attacks, and even death in these lockdown cities. Things are worst in many small cities.\u00a0  Lots of families are faced with the difficult task of recovery and reconstruction after disaster. Many of them lost their family members during outbreak. Many of them have serious after-effects of a disaster, especially for children and young people.\u00a0 Many of them are devastated by the coronavirus . They need help. They need our support.\u00a0  Let's help China defeat 2019-nCov.\u00a0 We will continue to help persons in affected areas of China (Wuhan and other seriously affected cities) to overcome this crisis and build back their life. We believe unity is strength; we beliveve faith will overcome panic attacks; and we believe we can win the battle against the virus.\u00a0  The donations will be used to purchase medical supplies for medical staff and people who are fighting against the 2019-nCoV in Wuhan and other cities. The donations will also be used for helping hard-hit families during the outbreak and after disaster.\u00a0  This donation campaign is launched by our Chinese community from Greater Memphis United Chinese Association, University of Memphis, University of Tenenssee, St. Jude Children's Research Hospital, Memphis Chinese Evangelical Church, the Confucius Insititute at the University of Memphis and other organizations at Memphis.  Contact:  Xinhua Yu\u00a0 \u00a0 xyu2@memphis.edu  Zhaohui Wu\u00a0 \u00a0 zwu6@uthsc.edu  Liang Hong\u00a0 \u00a0 lhong2@uthsc.edu  Fei Zheng\u00a0 \u00a0 fei.zheng@stjude.org  Dan Ye\u00a0 \u00a0 dye1@memphis.edu  Liang Zhang\u00a0 \u00a0 lzhang13@memphis.edu",
