    "title": "Wedding Fundraising for Combating COVID-19",
    "description": "We are getting married! As we learn how to plan a wedding, we found out that we should have a registry for our guests. While we could easily put together a long list, we also noticed that none of the items on the wish list matter to us that much. The items that we would put on a registry will make our life marginally better such as a nice vacuum or a new watch, however, we believe that your money could be used in more meaningful ways - such as saving lives.\u00a0   Since the outbreak of the coronavirus in Wuhan, more than 70,000 people have been infected and more than 1,500 have died globally, making it a more damaging epidemic than SARS.\u00a0   In one local hospital in Wuhan, nearly 3 in 10 patients are health professionals, according to a study published in the Journal of the American Medical Association ( link ).\u00a0   Among the health professionals who are fighting against the virus, many have to   work for extended hours and isolate themselves from their families for weeks. All of these are happening whilst there's a severe shortage of basic medical supplies such as surgical masks and protective clothing. Many doctors have to reuse protective goggles that are meant for single-use and use tapes to DIY their protective clothing ( NYTimes \u00a0).    Figure: A vigil in Hong Kong for Dr. Li Wenliang who died from the coronavirus. He was among the first 8 doctors to alarm the public about the outbreak but he was initially accused by the local authority as a rumormonger. (Anthony Wallace/AFP via Getty Images)  To honor their sacrifice, we have decided to start this fundraising initiative. All funds gathered by March 15 will be donated to Wuhan University Alumni Association to support the local hospitals and medical professionals who are risking their lives combatting the outbreak. This particular organization is selected because of its outstanding performance during this epidemic. It has raised over $700,000 with its own fundraising initiative ( link \u00a0) and is providing constant updates on the spending of the money. Although it will definitely take more than one wedding fundraising initiative to conquer this outbreak, we would like to be a small part of the solution and we invite you to join us. We really appreciate your support.  Note: If by the time we finish the fundraising, the virus has been eliminated or mitigated to a level that there is no need to donate to local hospitals or if no reliable logistic channels can be used to deliver the supplies, we plan to use this money to help with local students who are affected by this virus outbreak.",
