    "title": "Coronavirus vs. Spring Break",
    "description": "College... a time for new experiences and self growth.  One highlight from everyone's experience in college is of course spring break. We all imagine and long for it; a time of wild parties, bucket hats, alcohol, beaches, and warm turquoise water.\u00a0   My past spring breaks have been rainy, cold, and usually sitting in bed saddened by the lack in adventure placed on my life. College is soon going to become a distant past for me as a current 4th year.   This year I want it to be different.   I already have a group of 10 solid dudes ready to party it up on the warm beaches of Punta Cana. Everything is already planned out. However, due to the recent outbreak of Coronavirus, my extremely cautious Chinese parents will not condone nor sponsor my travel plans. They rightly fear for my safety. However, I believe it is unreasonable to think that traveling to a non affected country will bring me at risk of contracting the virus.\u00a0  As a broke college student, I ask you, people of the world, to help me realize my college dreams before I graduate. Lets turn that fear of Coronavirus into a cold golden drink in my hand.  Thank you, Lex",
