    "title": "International Student Stuck abroad due to COVID-19",
    "description": "My name is Ramone, a medical student, and an aspiring Pediatric Oncologist currently studying in China. I am a member of a core research team that focuses on Osteosarcomas, Multiple Myeloma, and the NK Cell-Based Immunotherapy, together with the Tumor Immunology of various other cancers. I\u00a0have co-authored and published several scientific research papers in a number of peer-reviewed journals. \n\nTowards the ending of January just before the Chinese New Year, I left China for what should have been a short travel to Malaysia. Within two days, I learned that there was an outbreak of a novel coronavirus in the Wuhan province. The worst was yet to come as three days later, the now named 2019-nCOV had virtually spread to all provinces in China and resulted in several deaths. \n\nAt this point, my program coordinator had made contact and informed me that based on the worsening situation of the now viral epidemic, I could not return to China and that I should extend my travel for a few more days until given notice to return. \n\nAbout a week later I again attempted to return but was informed that there were travel restrictions and a partial shutdown implemented by several provincial governments in addition to a number of airline cancellations and that I was not allowed to return under any circumstances until notified to do so by the University. Failure to abide by the preventative measures implemented by the educational department and the government to slow the spread of the viral outbreak would result in serious disciplinary action being taken.\n\nSince then, I have been stuck alone in a foreign country waiting and hoping each day that the situation will somehow get better, and I would be allowed to return to China as I was unable to travel elsewhere due to travel bans imposed by a number of countries. Already having spent several weeks here with still no clear sign as to when I will be able to return, I again queried and was notified that courses would be conducted online for the period, and I should return home until notice is given for the resumption of regular classes/rotations. Thereafter, depending on the progress of the situation, I can apply in advance to return, providing that the outbreak is under control.\n\nPlease, if able to donate to help me stay afloat until I can return home as well as help with travel expenses I would be grateful. I have depleted all my resources and will try traveling to Jamaica soon. \nThanks in advance. I appreciate your kind assistance.\nIf you wish to see some of my published research articles, you may visit  https://www.mendeley.com/profiles/ramone-a-williamson/",
