    "title": "Students Helping China Fight Coronavirus Outbreak",
    "description": "\n    Please consider donating ASAP as this is an urgent issue!  WHO declares the 2019-nCoV a GLOBAL EMERGENCY \n \n\n  Hi, we are Richard Z. and Katherine H. from Mountain View High School in Mountain View, CA. We are just students who want to help in an ongoing world issue.  As you may know already, the China coronavirus, known medically as the 2019-nCoV is currently spreading rapidly in China, and hospitals in Wuhan, the epicenter of this virus, are flooded with patients while not having enough medical supplies. The image is a letter from  The Second Affiliated Hospital of Guangzhou Medical University , asking for help from the public to donate  N95 respiratory masks, surgical masks, as well as hazardous material suits , with a certified government seal. The president of the Chinese Medical Association who works at  the Guangzhou Medical University , Zhong Nanshan, played a big role in controlling the outbreak of the 2003 SARS virus. He is also a leading scientist and researcher in this 2019-nCoV virus.  Currently the supply for these medical equipments in China are depleting quickly, as thousands of people a day rush to hospitals just for basic flu-like symptoms. The government has also sent medical professionals from this hospital by military plane to Wuhan to help stop the surprisingly contagious pandemic. Hospitals are filled with chaos, with not much to do and filled with patients to infect others, some which may have no problem with them at all. Sadly, the virus appeared during the Lunar New Year season, which means that people in the city return to their rural homes. Wuhan, a city of 12 million people, may have had much more infected people than the numbers posted by the Chinese government, and is most likely more widespread, as 5 million people left the epicenter of the outbreak just before they locked down.  We will  use your donations to purchase medical supplies and ship them to this hospital (The Second Affiliated Hospital of Guangzhou Medical University) , which will either ship them to hospitals in Wuhan, or use them as infection numbers increase. Richard's mother, Dr. Qiu, works at this hospital, and  the location is a certified donation point by the Chinese government . Anything is helpful. Please help us battle this virus together before it spreads to the places around you. Thank you.  For questions about this fundraiser, please feel free to contact us using the \"contact\" button down below. We will give you a response as soon as we can.",
