    "description": "    Virus has no borders   We have an urgent request for our concerned members of AMPSAA.\u00a0 We are looking for donations so that we can purchase and send over medical supplies to Wuhan and nearby cities in Hubei province, China.\u00a0 As you all may have heard in the news, the Coronavirus situation in Wuhan, China is critical. Worldwide over 1400 cases have been reported since the virus was first diagnosed in Wuhan on January 15, less than 10 days ago.\u00a0 These numbers are likely low, as individuals who have sent texts and emails from the region have reported that in some cases, because there are so many people going to the hospitals and there is not enough staff, people are just being sent home. Hospitals are over flowing in cases,\u00a0 running low or have no supplies of to offer supportive care and are lacking protective gear to protective their medical staff and contain and isolate infected cases.\u00a0  As of today, Wuhan and many other cities within the province have been quarantined. \u00a0 At least 17 cities within the province have been locked down. Individuals are not allowed to leave the cities, by plane, train, or any other means.\u00a0 Hospitals are overwhelmed and the Chinese government is building two emergency hospitals within the city. All public transportation within the city has been shutdown.\u00a0 Starting Sunday, use of private vehicles within the city will be banned.  Wuhan\u2019s need for medical assistance is severe.\u00a0 As the epicenter, with over 11 million people, the lack of adequate medical protection means that even those healthy individuals and the medical staff who are there to care for them are at great risk.\u00a0 It may seem that this is a \u201cChina problem, not a U.S. problem,\u201d but if the Coronavirus outbreak is not addressed now, by the time it reaches the same level of urgency in the U.S., it will have already reached emergency levels around the globe.\u00a0 We need to help China address the Coronavirus.  We are looking to send the following medical supplies, namely, surgical masks (N95 mask, YY 0469-2010), goggles to cover the entire face, disposable medical gloves, medical caps, shockproof eye masks, protective clothing (3M 4565), medical protective masks (GB 19083-2010).\u00a0 If you can donate these supplies, or donate money for us to purchase them, or have connections for AMPSAA to appeal directly, such help will be greatly appreciated. Please forward this to whomever you think can help. Thank you!",
