    "title": "Please help. I can draw you your portrait.",
    "description": "I was born in a country with an outdated educational system, a childhood of many incidents, and was a victim of crime. One day I decided that I only lived once, i had to live my own life, so i escaped. No one who knows me for the past 6 years knows my past, knows what I have suffered and overcome, alone. I have just started my own life for 6 years, from absolutely nothing. It took 6 years for me to build a life of my own.  Since i was a child, my dream is to become an artist. After 6 years of hard work to build a minimum life of a human being, I borrow money to study art and planned to use my monthly salary to pay off the loan. Its the bank that the company paying salary for employees through. The loan was deducted directly from my monthly salary.  Unfortunately, the COVID-19 epidemic occurred in December 2019, and the tourism industry in my country (an Indochina country, not China) is badly damaged, while I am working in a small travel company. The company has bankrupted and i lost my main job, which i supporsed to use to pay my loan tuition.   The bank asked me to pay the entire loan immediately, the deadline is 3 months later. I asked the school for a refund of the tuition fee and gave up my studies, but because I had already gone through half of the program, only half of the tuition was refunded. If I couldn't repay the loan, they would sue me and I would definitely go to jail. This will end my life, because the people who had committed crimes against me and I ran away from them, are the people in the police industry.  I have been doing a couple side jobs to pay monthly rent and expenses (I have worked ~14 hours per day all these years). Because the epidemic is still developing, my country's economy has plummeted, it's hard to find a new full-time job right now (Im still trying). Sometimes I think life is so unfair to me, but I know I'm still one of the luckiest people in the world when I'm still able to breathe everyday.  I knew that the epidemic would not end soon and the economy in my country would not recover soon, I tried to manage everything before finding the last way to seek support here. I am alone, without friend or relatives, without any support other than myself. I'm always proud of myself being my own superhero. But sometimes, specifically right now, the hero is already exhausted.  It is difficult for me to disclose all my personal information, because as I said above, my identity now is completely different from I was six years ago, and in a communist country, the publication of what I've been through can ruin my life. If you are interested, I will tell my story to you personally, please message me privately.   I know you will find it hard to believe my story, so please consider I'm begging you for a job, I know drawing and graphic design, please let me work for you, so you dont have to wonder if your kindness is being used. I would be happy to express my appreciation for your support by drawing you a portrait of yourself, or doing some graphic design like a banners or poster, anything you request - this is my firm commitment.  P/s : When I had money I used to donate monthly to a non-profit organization for the homeless and the blind, as a way of thanking life for giving me a second chance to live. When I posted this fundraiser, gofundme gave me a number of tasks to share with relatives, friends, social networking sites ... I suddenly felt hilarious for my destiny. I have no close ones in real life, and no friend on internet (I don't use any social networks - due to my special circumstances). If you come across my post, please do me a favour by sharing it on social media, because I don't have a chance to do that, and maybe very quickly this fundraiser will be forgotten. I still expect a miracle to happen here, even though I know the chances of it happening are very low...",
