    "description": "\n Hello Friends,  I've left up these photos of joy, generosity, and love from street vendors because we will return to this public practice of love, resiliency, and mutual aid one day, but in a different form.\u00a0   Meanwhile, we have shifted all our work to Mutual Aid Disaster Relief.  Many Languages One Voice, the non-profit I work for, has applied for a 10K grant to support the important work of Street Vendors turning into Promotores de Salud en Contra de Corona .\u00a0 You can  read it in last Sunday's edition of the Washington Post  .\u00a0 Every bit of the\u00a0 money we raise for this project will go to Vendedores Unidos.\u00a0   If you cannot get past the firewall, sign in with UserID =  hamilton8691@sbcglobal.net  with Password =  Hsdr634k  However will take weeks for those funds to work their way through the NGO world.  So, please donate generously to this  personal request from me  through GoFundMe.\u00a0 I have spent about as much of my personal money as I possibly can and my comrade, Calvin Jackson, has looked at my bank account and seen where I am at with this.\u00a0 He is one of my accountability people on money and so is Preeti Kanodia, our Mutual Aid Money Mover.\u00a0 They are both imminently qualified to do this.\u00a0  I have $476 in Mutual Aid Money that I started in CashApp, and $600 left in my personal bank account.\u00a0 This is all the money I have left in the world right now.\u00a0 Clearly, I needed Calvin and Preeti's help because they are way better with money than me.\u00a0 I'm just an organizer and a Catholic Worker and I give all mine away, lol.  Yesterday, 3/16/2020, Colochita was being a Promotora de Salud on 14th and Irving.\u00a0 Learn more in this beautiful story by Natalie Delgadillo about  Colochita , the Abuela of the Columbia Heights/Mt. Pleasant Street Vendors.     Genesis,  a 15-year-old girl\u00a0 DC police pu tin the hospital for selling plantain chips, also wants to be a Promotora de Salud en Contra de Corona.   Qaadir, showing support with the Fuera ICE Coalition, will be joining us in our efforts to bring in his most vulnerable community members, especially with vendors he knows through the People for Fairness Coalition and Street Sense.   Natacia Knapper with Marilyn, one of our youngest street vendors and organizers.\u00a0 Natacia has already donated $500 of money she raised through her efforts in creating Ward 1 Mutual Aid Infrastructure to Vendedores Unidos en Contra de Corona.",
