    "days_created": "27.0",
    "title": "coronavirus",
    "description": "Che cos'\u00e8 un Coronavirus? Coronavirus sono una vasta famiglia di virus noti per causare malattie che vanno dal comune raffreddore a malattie pi\u00f9 gravi come la Sindrome respiratoria mediorientale (MERS) e la Sindrome respiratoria acuta grave (SARS).  Sono virus RNA a filamento positivo, con aspetto simile a una corona al microscopio elettronico.\u00a0La sottofamiglia\u00a0Orthocoronavirinae\u00a0della famiglia\u00a0Coronaviridae\u00a0\u00e8 classificata in quattro generi di coronavirus (CoV): Alpha-, Beta-, Delta-- e\u00a0Gammacoronavirus.\u00a0Il\u00a0genere del\u00a0betacoronavirus\u00a0\u00e8 ulteriormente separato in cinque sottogeneri (tra i quali il\u00a0Sarbecovirus).  I Coronavirus sono stati identificati a met\u00e0 degli anni '60 e sono noti per infettare l'uomo ed alcuni animali (inclusi uccelli e mammiferi). Le cellule bersaglio primarie sono quelle epiteliali del tratto respiratorio e gastrointestinale.  Ad oggi, sette Coronavirus hanno dimostrato di essere in grado di infettare l'uomo:  Coronavirus umani comuni: HCoV-OC43 e HCoV-HKU1 (Betacoronavirus)\u00a0e\u00a0HCoV-229E e HCoV-NL63 (Alphacoronavirus); essi possono causare raffreddori comuni ma anche gravi infezioni del tratto respiratorio inferiore. Altri Coronavirus umani (Betacoronavirus): SARS-CoV, MERS-CoV e 2019-nCoV (ora denominato SARS-CoV-2).. 2. Che cos'\u00e8 un nuovo Coronavirus? Un nuovo Coronavirus (nCoV) \u00e8 un nuovo ceppo di coronavirus che non \u00e8 stato precedentemente mai identificato nell'uomo. In particolare quello denominato SARS-CoV-2 (precedentemente 2019-nCoV), non \u00e8 mai stato identificato prima di essere segnalato a Wuhan, Cina, a dicembre 2019.",
