    "title": "For finishing Study in the outbreak of Coronavirus",
    "description": "Rome, 19/02/2020  Friends,   My name is Sophia Lilin Wu. I am a lay Chinese student of Theology, in the second year of the first cycle in Pontifical Gregorian University. As you all know, since the beginning of this new year 2020, China, especially Wuhan has suffered from the coronavirus. And because of this strong influence, this virus soon spread beyond Wuhan to other parts of China and around the world.  Seeing such suffering happening every day, my heart is broken. In order to help the Chinese people fight the coronavirus, especially to help my family who are living in Shandong province, I bought nearly 700 masks and sent them to China both to Shandong and to Beijing. A friend of mine in Beijing told me that even the doctors and nurses in the Hospital cannot find masks now, to say nothing of other people. Therefore, I tried my best to help them. As you see, without a mask, you cannot move one step regarding the high risks. Scientists found that the coronavirus even can influence people by air just in two seconds.   They urgently need to have enough masks in order to have at least the basic protection. I am the only one child in my family. From my childhood until now, both my father and mother tried their best to give me everything I need, to educate me in the best school, to encourage me to graduate from the best University in China (Peking University) as a Doctor of Philosophy, to support me to study Catholic theology in Rome even though they themselves are not Christians. However, the real and deep love is that whatever the decision I made they supported me. Love should repay love. So, I decide to give them the best medical supplies. From Jan.25th, the Chinese New Year until now Feb.19th, 2020, almost each day, I am looking for masks or sending masks. Finally, until today, there are already seven hundred masks going to China. Nonetheless, the ordinary shipping cannot go to China nowadays regarding the high risks, only DHL could help me to ship masks to China. But the cheapest and the smallest box in DHL cost 58 euro. In order to guarantee that they have masks in China, I must send many times and only for shipping in this month, almost 500 euro was spent. And because of the high needs, the price of masks rises 2 to 3 times. For example, before one masks FFP2 cost 5 euro, now you need to pay 10 euro, and masks FFP3 before 7 euro, now you should pay from 15 to 20 euro. But it can only use 8 hours. Though some friends also help me with some contributions, one month later, my bankcard finally has no money left. I remember in the evening of Feb. 17th, the first day of the second semester, the pharmacy called me they found more masks of FFP2. However, from my bankcard I can only buy 29 masks, then there is no money on this card. This money is the fund for supporting my living and studying in Rome, my mom transferred to me in last September. She always thought if there is something in urgent need, for example, when I got sick need to buy medicine, or want to go home, I can buy tickets. But now all of them turned to be masks. Indeed, before if I have urgent need, I can ask for support from parents. However, now China is at a standstill. I even do not know whether or not my father still has salary. Then I decided that this time, it is not they support me but I who support them. So, friends, please help me to continue my life and study in Rome. Just left one and half year, I will finish my first cycle of theology in Gregorian University. I have a basic scholarship which can support me bed and food, therefore, I ask for your help for this small part, in these seven months (from now to September). I need some money to do scan and photocopy, to prepare documents for applying new scholarship and for the summer tickets to go and back between Rome and Cracow. I have a dream that when finishing all of these studies, to work and live in Poland, so during the summer, I already planned to return to Poland to learn Polish. The scholarship for learning Polish, however, does not include transportation.  The belief for the beauty of human hearts push me to write this letter. As the song which was singing in the Beijing Olympic 2008 expressed: you and me, heart to heart, we are family.  Thank you with my deep heart, and I believe God will repay for your kindness.",
