    "days_created": "20.0",
    "title": "A coronav\u00edrus id\u0151szak\u00e1nak vizsg\u00e1lat\u00e1hoz",
    "description": "R\u00f3ma, 2020.02.19  Bar\u00e1taim!  A nevem Sophia Lilin Wu. Laikus k\u00ednai teol\u00f3gia hallgat\u00f3 vagyok, a P\u00e1pai Gergely Egyetemen az els\u0151 ciklus m\u00e1sodik \u00e9v\u00e9ben. Mint mindannyian tudj\u00e1tok, a 2020-as \u00e9v kezdete \u00f3ta K\u00edna, k\u00fcl\u00f6n\u00f6sen Wuhan szenvedett a koronav\u00edrus miatt. \u00c9s ennek az er\u0151teljes influenz\u00e1nak k\u00f6sz\u00f6nhet\u0151en a v\u00edrus hamarosan Wuhanon \u00e1t \u00e1tterjedt K\u00edna m\u00e1s r\u00e9szeire \u00e9s a vil\u00e1g minden t\u00e1jaira is.  A szenved\u00e9st nap mint nap l\u00e1tva megszakad a sz\u00edvem. Annak \u00e9rdek\u00e9ben, hogy seg\u00edtsek a k\u00ednai n\u00e9pnek a koronav\u00edrus elleni k\u00fczdelemben, k\u00fcl\u00f6n\u00f6s tekintettel a Shandong tartom\u00e1nyban \u00e9l\u0151 csal\u00e1domnak, k\u00f6zel 700 maszkot v\u00e1s\u00e1roltam \u00e9s K\u00edn\u00e1ba k\u00fcldtem (mind Shandongba, mind Pekingbe). Egy pekingi bar\u00e1tom azt mondta nekem, hogy m\u00e9g a k\u00f3rh\u00e1z orvosai \u00e9s \u00e1pol\u00f3i sem tal\u00e1lnak maszkokat, nem is besz\u00e9lve az egyszer\u0171 emberekr\u0151l. Ez\u00e9rt minden t\u0151lem telhet\u0151t megtettem hogy megpr\u00f3b\u00e1ljak seg\u00edteni nekik. Mint l\u00e1tj\u00e1tok, maszk n\u00e9lk\u00fcl nem lehet tenni egy l\u00e9p\u00e9st sem az utc\u00e1n a magas kock\u00e1zat miatt. A tud\u00f3sok \u00e1ll\u00edtj\u00e1k hogy a koronav\u00edrus ak\u00e1r k\u00e9t m\u00e1sodperc alatt is k\u00e9pes leveg\u0151n \u00e1t megfert\u0151zni az embereket.  S\u00fcrg\u0151sen elegend\u0151 maszkkal kell rendelkezni\u00fck ahhoz, hogy legal\u00e1bb az alapvet\u0151 v\u00e9delmet biztos\u00edts\u00e1k. \u00c9n vagyok az egyetlen gyermek a csal\u00e1domban. Gyerekkoromt\u00f3l kezdve eg\u00e9szen mostan\u00e1ig \u00e9desap\u00e1m \u00e9s \u00e9desany\u00e1m minden t\u0151l\u00fck telhet\u0151t megtettek, hogy mindent megadhassanak, a legjobb iskol\u00e1ban neveljenek, \u00e9s arra \u00f6szt\u00f6n\u00f6zzenek, hogy filoz\u00f3fiai doktork\u00e9nt v\u00e9gezzem k\u00ednai legjobb egyetem\u00e9t (pekingi egyetem), hogy t\u00e1mogassanak a katolikus teol\u00f3gia tanul\u00e1s\u00e1ra R\u00f3m\u00e1ban, b\u00e1r \u0151k maguk nem kereszt\u00e9nyek. A val\u00f3di \u00e9s m\u00e9ly szeretet\u00fck abban \u00e1ll, hogy b\u00e1rmi is volt a d\u00f6nt\u00e9sem, t\u00e1mogattak engem. A szeretetnek vissza kell fizetnie a szeretetet. Sz\u00f3val \u00fagy d\u00f6nt\u00f6ttem, hogy a legjobb orvosi ell\u00e1t\u00e1st adom nekik. Janu\u00e1r 25-t\u0151l, a k\u00ednai \u00faj\u00e9vt\u0151l mostan\u00e1ig, 2020. febru\u00e1r 19-ig, szinte minden nap maszkot keresek vagy maszkot k\u00fcld\u00f6k. Ily m\u00f3don m\u00e1r siker\u00fclt h\u00e9tsz\u00e1z maszkot K\u00edn\u00e1ba k\u00fcldenem. Mindazon\u00e1ltal a szok\u00e1sos sz\u00e1ll\u00edt\u00e1s nem mehet K\u00edn\u00e1ba a magas kock\u00e1zatok miatt, csak a DHL tudott seg\u00edteni a maszkok K\u00edn\u00e1ba sz\u00e1ll\u00edt\u00e1s\u00e1ban. De a DHL legolcs\u00f3bb \u00e9s legkisebb doboza 58 eur\u00f3ba ker\u00fclt. Az\u00e9rt hogy legyen el\u00e9g maszk K\u00edn\u00e1ban, t\u00f6bb k\u00fcldem\u00e9nyt kellett k\u00fcldenem, \u00e9s csak ebben a h\u00f3napban a sz\u00e1ll\u00edt\u00e1sra k\u00f6zel 500 eur\u00f3t k\u00f6lt\u00f6ttem el. A nagy ig\u00e9nyek miatt a maszkok \u00e1ra is 2-3-szoros\u00e1ra emelkedett. P\u00e9ld\u00e1ul, kor\u00e1bban egy FFP2 maszk 5 eur\u00f3ba ker\u00fclt, most 10 eur\u00f3t kell fizetni \u00e9rte. Az FFP3 maszk\u00e9rt kor\u00e1bban 7 eur\u00f3t kellett fizetni, most 15-20 eur\u00f3ba ker\u00fcl. De ez csak 8 \u00f3r\u00e1n kereszt\u00fcl haszn\u00e1lhat\u00f3. B\u00e1r n\u00e9h\u00e1ny bar\u00e1tom is hozz\u00e1j\u00e1rult bizonyos kiad\u00e1saimhoz, egy h\u00f3nap eltelt\u00e9vel, a bankk\u00e1rty\u00e1mr\u00f3l v\u00e9g\u00fcl minden p\u00e9nz elfogyott. Eml\u00e9kszem, hogy febru\u00e1r 17-\u00e9n este, a m\u00e1sodik f\u00e9l\u00e9v els\u0151 napj\u00e1n a gy\u00f3gyszert\u00e1r felh\u00edvott, hogy tal\u00e1ltak t\u00f6bb maszkot az FFP2-b\u0151l. A bankk\u00e1rty\u00e1mon l\u00e9v\u0151 p\u00e9nzb\u0151l azonban csak 29 maszkot v\u00e1s\u00e1rolhatok. Ez a p\u00e9nz az alap a r\u00f3mai \u00e9letem \u00e9s tanul\u00e1som t\u00e1mogat\u00e1s\u00e1ra, \u00e9desany\u00e1m tavaly szeptemberben utalta \u00e1t nekem. Mindig azt gondolta, hogy ha lenne valami s\u00fcrg\u0151s sz\u00fcks\u00e9g, p\u00e9ld\u00e1ul ha gy\u00f3gyszert kellene v\u00e1s\u00e1rolnom, vagy haza kellene mennem, ebb\u0151l tudn\u00e9k magamnak jegyet venni. De most az eg\u00e9sz p\u00e9nzt maszkokra ford\u00edtottam. Val\u00f3ban, kor\u00e1bban s\u00fcrg\u0151s sz\u00fcks\u00e9g eset\u00e9n, t\u00e1mogat\u00e1st k\u00e9rhettem volna a sz\u00fcl\u0151kt\u0151l. Most azonban K\u00edna le van blokkolva. M\u00e9g azt sem tudom, hogy \u00e9desap\u00e1mnak van-e tov\u00e1bbra is fizet\u00e9se? Azt\u00e1n \u00fagy d\u00f6nt\u00f6ttem, hogy ez\u00fattal nem \u0151k t\u00e1mogatnak engem, hanem \u00e9n t\u00e1mogatom \u0151ket. Teh\u00e1t, bar\u00e1taim, k\u00e9rlek benneteket, seg\u00edtsetek nekem az \u00e9letem folytat\u00e1s\u00e1ban \u00e9s a r\u00f3mai tanulm\u00e1nyaimban! M\u00e1r csak f\u00e9l \u00e9v maradt hogy befejezzem az els\u0151 ciklust a Gregoriana egyetemen. Van egy alap \u00f6szt\u00f6nd\u00edjam, amely megadja nekem a meg\u00e9lhet\u00e9st. De az ezen t\u00falmen\u0151 kiad\u00e1saimhoz a seg\u00edts\u00e9geteket szeretn\u00e9m k\u00e9rni az elk\u00f6vetkez\u0151 h\u00e9t h\u00f3napban (mostant\u00f3l szeptemberig). Sz\u00fcks\u00e9gem van n\u00e9mi p\u00e9nzre a scannel\u00e9shez \u00e9s a f\u00e9nym\u00e1sol\u00e1shoz az egyetemen, tov\u00e1bb\u00e1 az \u00faj \u00f6szt\u00f6nd\u00edj ig\u00e9nybev\u00e9tel\u00e9hez sz\u00fcks\u00e9ges dokumentumok el\u0151k\u00e9sz\u00edt\u00e9s\u00e9hez, valamint a ny\u00e1ri utik\u00f6lts\u00e9gre R\u00f3ma \u00e9s Krakk\u00f3 k\u00f6z\u00f6tt. Van egy \u00e1lmom, hogy a tanulm\u00e1nyaim befejezt\u00e9vel Lengyelorsz\u00e1gban dolgozhatok \u00e9s \u00e9lhetek, teh\u00e1t a ny\u00e1r folyam\u00e1n m\u00e1r terveztem visszat\u00e9rni Lengyelorsz\u00e1gba lengyel nyelvet tanulni. A lengyel nyelv tanul\u00e1s\u00e1nak \u00f6szt\u00f6nd\u00edja azonban nem tartalmazza az \u00fatik\u00f6lts\u00e9get.  Az emberi sz\u00edv sz\u00e9ps\u00e9g\u00e9be vetett hit \u00f6szt\u00f6nz\u00f6tt arra, hogy meg\u00edrjam ezt a levelet. Ahogy a 2008-as pekingi olimpia \u00e9nek\u00e9ben is \u00e1ll: \u201cte \u00e9s \u00e9n, sz\u00edvb\u0151l sz\u00edvbe, egy csal\u00e1d vagyunk\u201d.  Sz\u00edvb\u0151l k\u00f6sz\u00f6n\u00f6m, \u00e9s hiszem, hogy Isten megfizeti a kedvess\u00e9geteket!",
