    "title": "Abschluss der Studie in der Zeit des Coronavirus",
    "description": "Rom, 19/02/2020  Liebe Freunde,  \u00a0  ich hei\u00dfe Sophia Lilin Wu. Ich bin eine chinesische Laiin und Theologie-Studentin im zweiten Jahr vom ersten Studienzyklus an der P\u00e4pstliche Gregoriana Universit\u00e4t. Wie Sie wissen, erleidet China, besonders Wuhan, das Coronavirus seit Anfang des neuen Jahres 2020. Da dieses Virus so resistent ist, hat es sich auch bald ausgebreitet in anderen Teilen Chinas und der Welt.  Mein Herz bricht wenn ich so viel t\u00e4gliches Leid anschauen muss. Um das chinesische Volk helfen zu k\u00f6nnen das Coronavirus zu bek\u00e4mpfen und insbesondere um meine Verwandten zu helfen, die in der Shandong-Provinz wohnen, habe ich fast 700 Mundmasken gekauft und nach China gesandt (Shandong und Beijing). Einer meiner Freunde in Beijing sagte mir dass sogar die \u00c4rzte und Krankenschwestern in den Spit\u00e4lern heutzutage keine Masken finden k\u00f6nnen, um \u00fcber andere Leute gar nicht zu reden. Darum habe ich versucht Ihnen zu helfen. Ohne Maske kann man ja nirgendswo hingehen wegen den gro\u00dfen Gesundheitsrisiken. Untersucher haben jetzt herausgefunden dass es sogar \u00fcber die Luft \u00fcbertragbar ist in nur zwei Sekunden.   Sie brauchen dringend gen\u00fcgend Masken um ein Grundschutz zu haben. Ich bin einziges Kind. Von meiner j\u00fcngsten Kindheit ab, haben meiner Vater und meine Mutter ihr Bestes gegeben um mir mit den besten Sorgen zu umgeben, in der besten Schule zu erziehen, mich zu ermutigen an der beste Universit\u00e4t Chinas zu promovieren als Doktor in Philosophie, meine Studien der katholischen Theologie in Rom zu unterst\u00fctzen \u2013 obwohl sie selber gar nicht christlich sind. Ihre echte und tiefe Liebe ist was ihr dazu gebracht mich in all meine Entscheidungen zu unterst\u00fctzen. Liebe braucht Gegenliebe. Deswegen entschied ich mich dazu ihnen die beste \u00e4rztliche Hilfsmittel zu geben. Vom 25. Januar, das chinesische Neujahr, bis heute habe ich fast jeden Tag ausgeschaut nach Masken um nach China zu schicken. Bis heute sind schon 700 Masken nach China gegangen. Schwierig ist aber dass die normale Transportwege nach China nicht mehr funktionieren, nur DHL konnte mir helfen diese Masken zu transportieren. Aber das billigste und kleinste DHL-Paket kostet schon 58 Euro. Um eine fixe Pr\u00e4senz von Masken in China zu garantieren, musste ich oft Pakete schicken \u2013 in dieser Monat habe ich fast 500 Euro f\u00fcr Transport zahlen m\u00fcssen. Und wegen der gro\u00dfe Nachfrage, steigern sich die Preise der Masken. Zum Beispiel: eine FFP2-Maske kostete 5 Euro, heute aber schon 10 Euro. Eine FFP3-Maske kostete vorher 7 Euro, jetzt 15 bis 20 Euro. Sie k\u00f6nnen aber nur 8 Stunden verwendet werden. Obwohl manche Freunde mir geholfen haben, habe ich nach eine Monat kein Geld mehr auf mein Bankkonto. I erinnere mich am Abend des 17. Februar, den ersten Tag des zweiten Semester, wenn die Apotheke mir anrief mit der Mitteilung dass sie mehr FFP2-Masken gefunden h\u00e4tten. Mit mein Geld konnte ich aber nur noch 29 Masken kaufen. Dieses Geld war mir in September von meiner Mutter gegeben f\u00fcr mein Lebensunterhalt und Studium in Rom. Se meinte immer dass ich etwas brauche f\u00fcr Notf\u00e4lle, z.B. um Medizinen zu kaufen wenn ich krank w\u00e4re oder ein Ticket nach Hause kaufen zu k\u00f6nnen. Jetzt hat sich aber all dieses Geld in Masken verwandelt. Fr\u00fcher konnte ich mich immer auf meine Eltern berufen wenn ich in Not war. Jetzt aber steht China still. Ich wei\u00df gar nicht ob mein Vater noch ein Gehalt bekommt. Darum entschloss ich mich dass ich diesmal ihnen helfen musste. Liebe Freunde, hilf mir bitte um mein Leben und Studium in Rom weitersetzen zu k\u00f6nnen. Es fehlt nur anderthalb Jahr um meinem ersten Zyklus der Theologie zu beenden an der Gregoriana Universit\u00e4t. Ich habe eine Studienb\u00f6rse die mir ein Unterkommen und Essen gibt, brauche aber etwas Geld f\u00fcr die n\u00e4chste sieben Monate (bis September): f\u00fcr Scans, Kopien, f\u00fcr die Vorbereitung von Anfragen f\u00fcr eine neue Studienb\u00f6rse und um Tickets von und nach Krakau zahlen zu k\u00f6nnen im Sommer. Ich tr\u00e4ume n\u00e4mlich nach meine Studien in Polen zu leben und zu arbeiten, darum habe ich schon ein Aufenthalt in Polen geplant im Sommer, um Polnisch zu studieren. Die Studienb\u00f6rse f\u00fcr das Polnisch-Unterricht deckt aber keine Transportkosten.  Der Glauben an die Sch\u00f6nheit der Menschenherzen treibt mich an dieser Brief zu schreiben. Wie das Lied der Olympischen Spiele in Beijing 2008 es ausdruckte: du und ich, Herz zu Herz, wir sind Familie.  Ich danke Ihnen von ganzem Herzen und glaube dass Gott ihre G\u00fcte vergelten wird!",
