    "days_active": "19.0",
    "days_created": "19.0",
    "title": "Pour terminer l'\u00e9tude \u00e0 l'\u00e9poque du coronavirus",
    "description": "Rome, 19/02/2020  Chers amis,  \u00a0  Je m'appelle Sophia Lilin Wu. Je suis une \u00e9tudiante de th\u00e9ologie chinoise, maintenant dans la deuxi\u00e8me ann\u00e9e du premier cycle \u00e0 l'Universit\u00e9 Pontificale Gr\u00e9gorienne. Comme vous savez bien, la Chine, en particulier Wuhan, souffre du virus corona d\u00e8s le d\u00e9but de 2020. Vu qu'il est tr\u00e8s r\u00e9sistent, ce virus se r\u00e9pands bien vite dans d'autres parties de la Chine et du monde.  Face \u00e0 cette d\u00e9tresse mon c\u0153ur se rompt. Pour aider le peuple chinois \u00e0 combattre ce virus et en particulier pour aider ma famille qui habite dans la province de Shandong, j'ai achet\u00e9 presque 700 masques et je les ai envoy\u00e9s \u00e0 Shandong et \u00e0 P\u00e9kin. Un ami \u00e0 P\u00e9kin m'a racont\u00e9 qu'entretemps m\u00eame les m\u00e9decins et les infirmi\u00e8res dans les h\u00f4pitaux ne trouvent plus de masques, pour ne pas parler des autres. C'est la raison pour laquelle je cherche de faire mon mieux pour leur donner un coup de main. En effet, on ne peut pas bouger sans masque \u00e0 cause des grandes risques de contamination. Les chercheurs ont entretemps retrouv\u00e9 que le virus se r\u00e9pande m\u00eame dans l'air dans seulement deux secondes.  Tout de suite ils ont besoin d'assez de masques pour garantir une protection minimale. Je suis enfant unique. De ma premi\u00e8re enfance jusqu'\u00e0 maintenant mon p\u00e8re et ma m\u00e8re ont fait leur mieux pour me donner tout dont j'avais besoin: une \u00e9ducation dans la meilleure \u00e9cole, l'encouragement \u00e0 obtenir un doctorat en philosophie \u00e0 la meilleure universit\u00e9 de Chine (l'Universit\u00e9 de P\u00e9kin), le soutien \u00e0 \u00e9tudier la th\u00e9ologie catholique \u00e0 Rome (bien qu'ils ne sont pas chr\u00e9tiens).C'est leur amour r\u00e9el et fort qui les a pouss\u00e9s \u00e0 me soutenir toujours. Amour redemande amour. Ainsi je me suis d\u00e9cid\u00e9 de leur donner les meilleures aides m\u00e9dicales. Du 25 janvier, la nouvelle ann\u00e9e chinoise, jusqu\u2019aujourd'hui j'ai cherch\u00e9 des masques \u00e0 envoyer en Chine. Entretemps 7000 masques sont en train d'y partir. Mais \u2026 les cargos normaux ne partent plus pour la Chine, seulement DHL pourrait m'aider. Leur paquet le plus petit et le plus \u00e9conomique coute n\u00e9anmoins 58 euros. Pour garantir un r\u00e9serve de masques en Chine je dois leur envoyer tr\u00e8s souvent des paquets. Ce mois-ci ca m\u2019a cout\u00e9 presque 500 euros. A cause du besoin le prix des masques augmente beaucoup. Auparavant un masque ne FFP2 co\u00fbtait que 5 euros, maintenant on a besoin de 10 euros. Un masque FFP3 co\u00fbtait 7 euros, maintenant 15 \u00e0 20 euros. Et \u00e7a ne peut \u00eatre utilis\u00e9 que durant 8 heures. Bien que certains amis ont contribu\u00e9, apr\u00e8s un mois je n'ai plus d'argent sur mon compte bancaire. Je me souviens le soir du 17 f\u00e9vrier quand la pharmacie m'appelait parce qu'ils avaient trouv\u00e9 d'autres masques FFP2. Mais avec ma carte bancaire je ne pouvais plus acheter que 29 masques. Cet argent, qui n'y est plus, m'avait \u00e9t\u00e9 donn\u00e9 par ma m\u00e8re en septembre pour financier ma vie et mes \u00e9tudes \u00e0 Rome. Ma maman voulait que j'aurais toujours les moyens de m'acheter des m\u00e9decins si je tomberais malade ou de me procurer un ticket pour tourner chez moi. Maintenant tout cet argent-l\u00e0 s'est transform\u00e9 en masques. Auparavant je pourrais toujours me tourner vers mes parents si j'\u00e9tais dans le besoin. Maintenant la Chine s'est bloqu\u00e9e. Je ne sais m\u00eame pas si mon p\u00e8re re\u00e7oit encore un salaire. Ainsi je me suis d\u00e9cid\u00e9 de les aider moi-m\u00eame, cette fois-ci. Donc, chers amis, je vous demande de m'aider \u00e0 continuer ma vie et mes \u00e9tudes \u00e0 Rome. Ainsi je pourrais finir mon premier cycle de th\u00e9ologie \u00e0 l\u2019Universit\u00e9 Gr\u00e9gorienne. J\u2019ai une bourse d\u2019\u00e9tudes qui me procure aussi l\u2019h\u00e9bergement et de la nourriture. C\u2019est donc seulement une petite aide que je vous demande pour ces sept mois (de maintenant jusqu\u2019\u00e0 septembre)\u00a0: j\u2019ai besoin d\u2019un petit peu d\u2019argent pour faire des scans et photocopies, pour pr\u00e9parer les applications pour une nouvelle bourse d\u2019\u00e9tudes et pour les tickets de voyage en \u00e9t\u00e9 entre Rome et Cracovie. Je songe d\u2019aller vivre et travailler en Pologne apr\u00e8s mes \u00e9tudes, donc durant l\u2019\u00e9t\u00e9 j\u2019ai un voyage d\u00e9j\u00e0 programm\u00e9 en Pologne pour y \u00e9tudier le polonais \u2013 mais la bourse n\u2019inclut pas le voyage.  C\u2019est ma foi dans la beaut\u00e9 des c\u0153urs humaines qui me pousse \u00e0 \u00e9crire cette lettre. Comme l\u2019exprimait la chanson des Jeux Olympiques de P\u00e9kin 2008\u00a0: toi et moi, c\u0153ur \u00e0 c\u0153ur, nous sommes famille.  Merci de tout c\u0153ur \u2013 Dieu vous r\u00e9compensera votre bont\u00e9.",
