    "description": "Il Coronavirus sappiamo tutti cosa sia. O meglio, sappiamo tutti quali sono gli effetti che provoca, ma nessuno di noi sa realmente cosa sia.\n\nEcco il punto di partenza di questa raccolta fondi.\nIl Coronavirus non \u00e8 cos\u00ec spaventoso per via delle morti in s\u00e9, ma quanto piuttosto per via del fatto che non esiste nessuna cura. Questa \u00e8 la cosa realmente inquietante. E questo \u00e8 ci\u00f2 che vogliamo risolvere.\n\nCon questa campagna fondi ci poniamo l'obbiettivo di indirizzare la ricerca verso una cura, di agire finalmente in modo attivo per una soluzione che possa salvarci in una spaventoso eventualit\u00e0 di contagio.\n\nNoi comuni mortali non possiamo fare nient'altro se non dare il nostro contributo in forma economica ed \u00e8 esattamente quello che ti chiediamo di fare. Dona 5\u20ac o quanto ritieni giusto per sovvenzionare i migliori ricercatori d'Italia e contribuisci pure tu alla scoperta di un antidoto al Coronavirus.\n\nIl ricavato verr\u00e0 devoluto ai ricercatori che avranno raggiunto i migliori risultati (in Italia) al momento della chiusura della raccolta fondi il 20 Marzo 2020.\nVerranno prese in considerazione solamente universit\u00e0 pubbliche italiane.\n\nTi ringraziamo in anticipo a nome di tutte le persone che verranno salvate grazie alla scoperta di un antidoto al Coronavirus.",
