    "title": "Coronavirus Help",
    "description": "Hello everyone, as most of you know I recently moved to China to start a new chapter of my life. \u00a0Once my father passed away I knew even more-so that this change was needed in my life. It\u2019s something I was so desperate to do not only to change my life for the better, \u00a0but to make myself and my family proud. Each day I wake up thankful to be here, thankful that I went through with this dream and continue to make my dad proud.\u00a0 Since the CoronaVirus decided to appear, not only has the world come to a stop still but also my mind and mental health as abruptly come crashing down. So much so I\u2019ve contemplating giving up this dream completely, so much so that Im sleep depriving myself, so much so that anxiety and panic attacks have become second nature. Then I think about leaving again, something I know will make me feel like an even bigger failure. During this outbreak it has left me uncertain of how I might continue to not only have a roof over my head, \u00a0but cover basic needs such as food and water. The virus has stopped all schools from opening, which in turn means us teachers are left with nothing. As it stands the schools are not due to open any time soon which does mean basic living necessities will be something I no longer have access to. Food and water will no longer be a viable option, let alone having somewhere to live.\u00a0 All I\u2019m asking for is help, in any way shape or form. Every penny counts, and I will use whatever funds are raised to cover living expenses as well as manage to feed and water myself. Any further funds that I manage to raise will goto a charity that helps individuals in crisis situations. I don\u2019t expect anyone to donate however if you choose to, just know that I am beyond grateful. I will forever be truly thankful \u2665\ufe0f",
