    "days_created": "18.0",
    "title": "Golden Saddle Coronavirus fund",
    "description": "Hello and thank you for visiting my campaign.  My name is Felicity Stanway and since June 2018 I've had the amazing opportunity to work in the beautiful city of Guilin as both coach, consultant and technical director of Golden Saddle Equestrian Club. It has been both a challenge and a joy in helping to raise the awareness of horse welfare and best work practices whilst educating the next generation of coaches and riders in what was a fast growing equestrian industry in the economic powerhouse that is China.    The goals at Golden Saddle were to become one of the leading equestrian educators in the country with the focus being on educating the local industry about best world practices for horse welfare, riding and coach education, whilst also being a sustainable learning centre for the greater public connecting people with the wonderful healing powers of the horse.\u00a0     The outbreak of the COVID19 virus it has created an unplanned industry crushing scenario.\u00a0 With the whole country in lockdown up to 70% of all businesses country wide have been forced to cease operations having what will be a national economic crisis. Ultimately this means that Golden Saddle along with many other equestrian clubs and businesses are trying to survive without any income.\u00a0\u00a0 The unfortunate situation that sets a business such as Golden Saddle apart is that in such a shutdown with 48 horses needing care the club cannot simply lay off staff and close production until things blow over. The horses still need care and exercise and all the daily chores still need doing.     I've created this fund to help the man that has shared with me his vision, Mr Yu, my boss, known by his English name Kerwin.\u00a0\u00a0 He had a dream at a young age to own his own horse club, and in October last year he made the very bold decision to buy out the other partner in the club in order to be able to have full control over the clubs future and entrusting the horses welfare and management to me.\u00a0 Unfortunately due to the virus outbreak and after much consultation the tough decision was made that I was to come home amidst the fears that the virus spread and lockdown would potentially continue for an unspecified amount of time and the financial future of the club was in question.\u00a0     Kerwin has been the most supportive and enthusiastic boss and it has been heartbreaking coming home and leaving my team and the horses behind with the fate of their future unknown.\u00a0 My goal of this Go Fund Me campaign is to raise enough funds to help support Kerwin over the next few months in keeping the club running whilst China recovers from this horrible unforeseen tragedy. Thankfully before the new year the club had purchased enough feed supply to keep the horses going to until at least the end of March, it's the staff costs that will be the main outgoings. With a fulltime staff of 6 coaches and 4 support staff, who are all currently in lockdown living at the\u00a0club, my dedicated former team are already willing to sacrifice part of their pay just to stay and keep the club going.\u00a0 These people have not only been my work colleagues over the last 18 months they have become my family, so although I am now not able to be with them my goal is to help keep them all employed and give the club the best possible chance of recovery for the future.         Your donations will be massively appreciated and contribute not only to the Golden Saddle club but the future of horse welfare in China starting with the wonderful 48 horses that call Golden Saddle home.  There will also be plan for the future to create a website where you will be able to check in and virtually meet all of the Golden Saddle staff and horses personally and see the difference your donation has made.  So in conclusion I would like to personally thank each of you for reading my cause and donating to keep Golden Saddle alive, and hope that one day you may get a chance to visit the team at Golden Saddle and take pride in the knowledge that you helped keep an amazing dream alive.",
