    "title": "Fundings to buy masks for hospitals in Wuhan",
    "description": "\n  Hello everyone! We are a group of students of Wuhan! Some of us are back to their countries for quarantine but we want to help our city win this battle with the #coronavirus!! We decided to make this gofundme project to help with the little we can and buy some masks for hospitals in #Wuhan.   \n \n\n  Chinese health officials reported on 2/29/2020 that there had been 2838 deaths from the outbreak and 79394 cases of the coronavirus.  \n \n\n Tons of medical workers are still struggling on the front line , the day and night\u00a0battling with the virus and trying to save as many people as possible, but they need to protect themselves first to do so!! We achieved our first goal and helped the first hospital but we are not going to stop and we want to continue helping with the help of our friends around the world.     With the money we already raised, we sent an order for masks, gloves and suits by the doctors of a hospital that arrived this 02/23/2020       \n \n\n        \n \n\n   From February 29 to March 1, the Mercadito ON in Arica, Chile, together with volunteers from China, invite you to be part of donations to help Jingxia District Red Cross Hospital to face the CoVid19 virus. Address: Anzuelo y Carbones Restaurant, Camino Azapan n 4040, Arica, Chile  \n \n\n  \n \n\n  Wuhan and China gave us a lot, a home, a job, a place to study, this is the moment to give back!! If you want to contribute for this cause, share the link and thank you a thousand times!    Let\u2019s fight together! Wuhan jiayou \u6b66\u6c49\u52a0\u6cb9\uff01      \n \n\n    \u00a1Hola a todos! Somos un grupo de estudiantes de Wuhan! \u00a1Algunos de nosotros ya regresaron a sus pa\u00edses para la cuarentena, pero queremos ayudar a nuestra ciudad a ganar esta batalla contra el #coronavirus! Decidimos hacer este proyecto de gofundme para ayudar con lo poco que podemos y comprar \u00a0materiales m\u00e9dicos para hospitales en #Wuhan.   Funcionarios de salud chinos informaron el 29/02/2020 que hubo 2838 muertes por el brote y 79394 casos de coronavirus.   Muchos doctores y enfermeros todav\u00eda est\u00e1n en la l\u00ednea del frente, el d\u00eda y la noche luchando contra el virus y tratando de salvar a la mayor cantidad de personas posible, \u00a1pero necesitan protegerse primero para hacerlo! Logramos nuestro primer objetivo y ayudamos al primer hospital pero no nos vamos a parar y queremos seguir ayudando con la ayuda de nuestros amigos en todo el mundo.   Con el dinero que ya recaudamos, enviamos un pedido de mascarillas, guantes y trajes por los doctores de un hospital que llegaron este 23/02/2020      \n \n\n       Desde el 29 de Febrero hasta el 1 de Marzo el Mercadito ON de Arica, Chile juntos con los voluntarios de China os invitan a ser parte de las donaciones en ayuda de Jingxia District Red Cross Hospital para enfrentar al virus CoVid19. Direcci\u00f3n: Restaurante Anzuelo y Carbones , Camino Azapan \u00a0n 4040, Arica, Chile       Wuhan y China nos dieron mucho, una casa, un trabajo, un lugar para estudiar, \u00a1este es el momento de retribuir! Si quieres contribuir por esta causa, comparte el enlace y \u00a1mil gracias! \u00a1Luchemos juntos! Wuhan jiayou \u6b66\u6c49 \u52a0\u6cb9\uff01",
