    "title": "Ac Sapphire music Release & corona cancels tour:(",
    "description": "Hello dear friends of the world!\u00a0  I have been writing, recording, transforming and moving emotions around in my heart to release music into the world for quite some time now!\u00a0  I have paid for everything thus far myself and need to recoup my recording costs as well as make physical copies of my music to sell at shows and other cool merchandise! I also need to get some work done on my car before I go on the tour and buy some new gear to take on the road with me! There are so many expenses on this music path!\u00a0  I need to raise the money as soon as possible to get it all sorted before I go on tour in the middle of March with  Lauren Ruth Ward .\u00a0 It's a dream come true to go on tour with her and I couldn't have gotten this far without your support.\u00a0\u00a0   Anyone that donates will receive a digital download of my upcoming EP Omni Present, all of my releases for 2020 and a few other past releases.\u00a0\u00a0   If reach my goal of $7770 I will be donating \u00a010% to the  Rock n' Roll Camp for Girls. \u00a0 This is an amazing nonprofit that empower girls and non-binary children through music.    I sing from my heart for the love of music and for the love of sharing something personal with people. I feel honored to be on the life path of being a musician and your contribution will help me stay on that path!   Thank you so much for your generosity, love, and support!",
