    "description": "Most of you may not realize this, but I have a brother who still lives in China. We were separated when I was at a young age . God has always been gracious and faithful to me, I was blessed with a new family and given a new home and was raised in a Christian environment. My brother Jimmy however was raised by my grandmother who later passed away leaving him an orphan raising himself at the age of 16. Even though we didn\u2019t grow up together, Jimmy always has a special place in my heart, he is my blood, he is my brother. The corona virus has hit his hometown pretty hard. ..He has not been able to go to work for almost a month now, he\u2019s getting down to barely any food in his apartment. Food and supplies are getting really low and his bank account is also dwindling down. Everybody is scared over there, the government is even arresting people for not wearing their masks on the street. He has reached out to me for help, and I was able to send him money via western union to help out, but what I can do is limited as well. I\u2019m not usually one to do this and I have never done a go fund me page before But Jimmy can really use all the help that he can get and if I can tell his story and get just a little bit a help sent a long his way I will be so grateful!",
