    "title": "Coronavirus Enters Through Your Eyes",
    "description": " We are Infecting Ourselvs \u00a0  If you have been following the\u00a0 the Coronavirus outbreak, you may remember Dr. Li Wenliang. He was the whistleblower\u00a0 doctor who tried to\u00a0 worn others about the a new Coronavirus were showing up in patients eyes.  Dr. Wenliang was an ophthalmologist who first identified the Coronavirus as patients with severe infection in one or both eyes were presenting. He saw the relationship between these unusual eye infections and this developing into pneumonia.\n\n \u00a0\n \n\n The world was saddened by his death after constructing the Coronavirus now known as Covid19.\u00a0     People are Infecting Themselves \u00a0  The virus is spread through hand to face or hand to eye contact. People are touching infected\u00a0 surfaces\u00a0 such as\u00a0 door knobs ,\u00a0 elevator buttons\u00a0 grocery carts and many other hard surfaces. It has being proven that the coronavirus can live on hard surfaces as long as 9 days.\u00a0  If someone is infected with the Coronavirus and coughs into their hands or is simplimatic the transmission occurs when you touch that same door handle then rub your eyes. This is how coronavirus is spread.      Doctors Urge Patients to Wash\u00a0 \u00a0Hands Frequently\u00a0   Doctors are urging the public to becone more vigilant and aware of the surfaces they are touching. Any surface especially hard surfaces which are touched frequently may be contaminated with the Coronavirus. In a busy setting such as a school or office building, hundreds of people are touching the same door handles railings and other hard surfaces then touching their face and eyes.   The Average Person Touches Their Face 2,000 Tines a Day   Several studies have shown that on average we touch our faces between 1,200 and 2,000 times each day. We must become much more aware our habit of touching door handles and other common areas then touching our faces or rubbing our eyes. Dr. Li Wenliang said \"If we can't break the habit of touching our faces we will never beat Coronavirus\".    Wearing Googles Prevent Hand Eye Contact \u00a0  \u00a0 Wearing goggles is one simple measure we can take two dramatically decrease the speed in which this virus is spreading. The goggles will also remind us not to touch other areas of the face.   3D Printed Goggles \u00a0      People who are blind generally touch more surfaces then\u00a0 the average sighted\u00a0person. This dramatically increases the chances they will become infected.   You might remember me mentioning my interest with 3D printing. Right now I have all of my available printers replicating goggles of all sizes. I can currently\u00a0 print 40 sets of goggles\u00a0 each day. I desperately need more printers to meet the demand. I am also emailing the files to anybody with a 3D printer who wish to produce goggles for their friends and families.\u00a0   \u00a0I am handing the googles for free to anybody who is in need. I am asking others with 3D printers to do the same.   I have established a GoFundMe account to help cover the cost of filament and other expenses expenses associated with\u00a0 making and distributing the goggles.     gf.me/u/xkzvw9  Below is a short 3 minute video warning about hand eye contact.    https://youtu.be/DfGyYrtTheI     Here is an in-depth 21 minute video that discusses the issue in greater detail.    https://youtu.be/DPkLApDRJME",
