    "title": "Coronavirus Improvised Masks",
    "description": "\n Dear Friends,\n \n\n  The Coronavirus (COVID19)  continues to spread throughout the world. Controlling the spread requires the mobilization of our combined efforts to fight the threat of the pandemic. A glaring problem is that there is a possible shortage of medical supplies including N95 respirator masks. The biggest producer (China) is the epicenter of the virus and might not have enough for themselves much less for the rest of the world. This means that if the virus spreads to more countries, there will be a global shortage of N95 masks. Without proper protection, individuals will be more likely to contract the virus spread it to even more people.\n \n\n   Article on demand for 270 million face masks \u00a0 \n \n\n One possible solution is to create improvised respirator masks. These masks would have to be relatively cheap to make from household materials. One possible design is an improvised gas mask with Cut 2-Liter soda bottle, duct tape, rubber bands, cloth, and crushed charcoal. Such a design will help prevent contracting the virus not only from airborne contaminants but also preventing the user from touching their face which is also an entry point of the virus through their eyes, nose, mouth. This simple design could be made by anyone willing any improvements would be most welcome.\n \n\n My proposal would be to use modern technology and methods to mobilize efforts for distributed production of improvised respirator masks. Using shared Google Sheets and Google Forms, orders can be grouped by city and zip code.\u00a0 Facebook marketplace could also be a place to advertise. \"Manufacturers\" would buy materials and construct the masks. Customers would fill Google forms and be matched with local manufactures who would then, like Uber/Postmates, deliver the masks. To mitigate legal/fees, transactions would be made by cash(after being disinfected)/venmo/paypal upon delivery accounting for material/labor costs. Hopefully, healthy competition and innovation will mitigate price gouging that is inherent in emergency scenarios.\n \n\n The purpose of this fundraiser is to incentivise action and create infrastructure around the project in order to scale properly and hopefully globally. Money donated will also be given to manufacturers to create masks for local hospitals in areas affected. Hopefully, together we can ensure action to fight this impending threat and provide a glimmer of hope to those affected.\n \n\n \u00a0\n \n\n  Thank you for your support.",
