    "title": "Help Fight Coronavirus in Wuhan",
    "description": "  What we can do to help    The Greater China Club at the Wharton School (GCC) is organizing a fundraiser to help those in need in Wuhan to access critically important medical supplies, including facial masks, protective gloves, suits and other protective garments.   We are fortunate to have received support and to be closely working with Wharton alumni in China, including the founder of 1 Drugstore (111.com.cn, NASDAQ:YI) which is one the largest direct online pharmacy networks in China.   Our current plan is to procure medical supplies through our network in China (and potentially internationally) and to directly deliver to the designated treatment hospitals in Wuhan where the most urgent needs are.  GCC commits to providing 100% transparency to the entire process, including (1) providing prompt updates to donors on final destination of funds, (2) providing a donor-by-donor list of donations at the end of the fundraising process, and (3) engage in ongoing Q A and updates on progress of fundraise and supply procurement process, within reason.   Given we are a student organization and have no official bank account, we will be withdrawing money into the personal bank account of Eileen Gao, one of the GCC board members. The funds will be converted from USD to RMB and sent to our supplier and logistics partner 1 Drugstore's corporate account via international wire transfer. We will provide update on proof of receipt and transfer of funds when we have the details.   * Kind reminder: the platform may prompt you to enter a tip which is not related to our donation campaign. Please select \"Other\" if you do not wish to tip the platform in addition to your donation.    Current facts    The number of lab-confirmed cases stands at 14,000 in 23 countries as of February 2. There have been over 300 deaths, all but one in China.    To help dispel some prevailing myths around the coronavirus:    Myths: Corona is the most dangerous virus that exists Facts: The common flu kills 60 times more people annual than Corona \u00a0 Myths: I will die if I am diagnosed with the coronavirus Facts: An estimated 2% of cases have reported deaths and most of these deaths were associated with weaker immune systems (e.g. old age) \u00a0 Myths: I need to buy a hazmat suit and a N95 mask to stay protected Facts: Washing hands and sneezing into elbows are best practices to protect yourself \u00a0 Myths: We all need to stay away from anyone from China Facts: Coronavirus has an incubation period of around 2-14 days. Therefore if a person of Chinese descent has been living outside of China for the last 14 days or more, he/she is at no higher risk of transmitting the virus than anyone else in the broader community. \u00a0 As the virus has spread in China, and especially in Wuhan, hospitals reportedly have been inundated with suspected cases, and have rapidly run out of critical medical supplies, most importantly protective facial masks and suits. Below are recent official statements released by some of the hardest hit hospitals in Wuhan, appealing directly to the public for donation of medical goods.  At the same time, many governments around the world have imposed strict travel restrictions to and from China, and some have placed export restrictions on critically needed medical supplies by the abovementioned hospitals in Wuhan.  Whilst we appreciate and acknowledge the need for the efforts made by national governments to protect their own citizens, we believe times like this are when true compassion and humanitarianism need to shine through the dark clouds.    Thank you.",
