    "title": "Fight for Corona Virus in Daegu, South Korea",
    "description": "Dear good people of the world,  I am a licensed clinical social worker and therapist in San Jose, California, LCSW 93644.  I am an immigrant myself from Daegu, South Korea and my relatives and mother still live in Daegu.   Daegu's corona virus epidemic news tells that three main emergency rooms at three hospitals have been closed/reopened due to serving patients in the last three weeks. I've heard that many public health doctors, who are medical corps non-combat physicians, are obligated to serve for treatment at Daegu, in South Korea, but they had not been provided any hotel expenses.  My hometown, Daegu, South Korea is in great stress for utilizing medical staff at hospitals in the area.   I would like to help medical staff in the hospital at Daegu so people in my hometown may get served properly.   Would you join me?   I will donate money to medical staff at hospital and doctors in Daegu, South Korea.  Hope I can raise the money by the end of March, 2020.   According to the Korea Times,   \"The Daegu medical infrastructure is under great stress,\" he said. \"They may be as exhausted as those in Wuhan. You can't let them hang out to dry\"   https://www.koreatimes.co.kr/www/nation/2020/02/119_285142.html    https://www.wsj.com/articles/american-soldier-contracts-coronavirus-in-south-korea-as-government-struggles-11582706980   Today, at the New York times, I read an article relating sufferings from Syrian refugee children, donated little money to Syrian non-profit organization, Violet.   Why not my hometown Korea, this evening, my thoughts are in my hometown and what I can do for my friends, extended relatives, neighbors where I grew up.",
