    "title": "Coronavirus relief fund",
    "description": "What if you know of a problem and a way you can help?  The problem, People around the world are being affected by current events regarding the coronavirus. Transportation suspended, postponed and cancelled for the fear of spreading the virus. Businesses shutting down because their revenue streams have stopped or slowed so much they can\u2019t afford to pay the employees. People who work in the service industry feel the effects of this and are feeling it hard. Tips, which many in the industry depend on has come to a halt and the income they depend on to feed their family, pay the rent, and buy food has stopped. They are struggling to provide the same basic needs you and I have yet can\u2019t because their revenue stream has come to a halt.   I know people in this industry who are telling me this is exactly what is happening to them. They reside in areas of countries where the yearly income is less than $9000 a year. When their revenue comes to a halt, it hurts, it really hurts. We feel the need to reach out and help and We can\u2019t do it alone. Its the human thing to do, right? To help those as we would want help if were are in need. There is something said for there is power in numbers.\u00a0   That is where this fund and you come in. You have the opportunity to help. With your generous donation, you will provide those who are currently harmed by this event with a form of revenue. Your donation will be distributed among those hit hard. It will provide the needed help that will allow them to feed their families, make that payment for rent, buy medicine and more. It\u2019s not the long term solution, that will come when the world gets the virus under control. In the meantime, with the help from people like you, we can provide some amount of relief that will get them by one more day.\u00a0   Bless you for your gift. It means a million to them.",
