    "title": "Help Save Wuhan and China!!!! (Coronavirus Relief)",
    "description": "We know there have been other GoFundMe campaigns started, but none from Southern CA. Lets show everyone that we care (not just Southern CA).   ***UPDATE***  The Organizer Team (made up of Real Estate Professionals) has received official endorsements from: China Institute of Real Estate Appraisers and Agents (CIREA) China Alliance of Real Estate Agencies (CAREA) and we are expecting multiple others. Endorsements can be viewed at:   https://www.dropbox.com/sh/jagcamh39kxt48y/AACdwoPNSU4K1qQqjrtHCIa7a?dl=0     ***UPDATE 2***  Our first shipment has been sent out on February 18, 2020 and included 53x N95 Face Mask Respirators, 825x Face Mask Respirators, 24x Safety Glasses, and 81x \"Sealed\" Safety Goggles. Purchased and shipped via Mexico and ETA February 28, 2020. Shipments have been sent to Beijing in order to be distributed to Wuhan and Hubei region where it is needed the most.   WHY DONATIONS ARE NEEDED:  Now more than ever we all need to stand up and show our support to combat this Global Crisis that coronavirus has caused and continues to cause. This is not limited to just China/Asia and effects are starting to show around the Globe; socially, culturally, and economically.\u00a0  OVER 70,000 individuals have contracted the virus, and while the bulk of cases are in China, cases are spreading all over the Globe.  -Many cities in China are in \"lockdown\" mode with many residents afraid to even go outside (even to shop for daily goods). Posts floating around the internet show Beijing and Shanghai looking like a ghost town. Over 50 Million residents in Wuhan City and Hubei Province are in lockdown. -Chinese New Year Holiday (also known as Spring Festival) which is traditionally a time of celebration and visiting friends/family has been detrimentally affected. Many restaurants, stores, malls, amusement parks (Both of Asia's Disneyland's), shopping malls, etc have been voluntarily closed down until further notice to help reduce the spread of coronavirus. The CNY has officially been extended to keep part of the workforce from going back to work. Schools have been out and will be off indefinitely until the situation improves. -Multiple Global airlines have reduced or outright cancelled their China routes to help combat the spread of coronavirus, some as far as May 2020 (Delta, United, American Airlines, Cathay Pacific, Air India, etc). Chinese travel agencies were given a mandate by the government to cease travel bookings/operations until further notice with hefty fines if they continue business -Multiple counties have restricted access from travelers traveling from China.    HOW TO HELP:  Step 1: Donate here, any amount will be a GREAT help in this time of need.  Step 2: We will collect the money raised to purchase N-95 masks, surgical masks, protective goggles, gloves, gowns, and other in-demand medical supplies. -Supplies will be purchased both locally in USA and within China to be shipped directly to hospitals in need. -Funds will be disbursed to local Organizations/Associations within Wuhan and Greater Hebei Province (including Social Welfare Groups, Medical Assistance Groups, etc)  Step 3: We will ship the supplies directly to Wuhan, China and/or surrounding areas! As well as work only with trusted and reputable organizations/associations. (FYI that Red Cross China unfortunately is NOT the most reputable and has been scandal ridden in recent years. They have a huge inventory of facemarks that they refuse to distribute, sitting in warehouses).  Step 4: We will provide photo proof/receipts as funds are used or disbursed.\u00a0 Dropbox link with photos/documentation:\u00a0 https://www.dropbox.com/sh/jagcamh39kxt48y/AACdwoPNSU4K1qQqjrtHCIa7a?dl=0    VOLUNTEERS NEEDED: \u00a0 -help spread this GoFundMe campaign -source local avenues to purchase listed medical supplies at wholesale price, as well as locate cheaper options for freight shipping goods direct to affected areas in China -identify organizations/associations within China that can best disburse donated funds to assistance most needed in China -contact  spencer@thehoogroup.com \u00a0or  robertmiller@robertmiller.com \u00a0to inquire and be added to our volunteer team.   ABOUT THE CAMPAIGN ORGANIZERS:  -Spencer Hoo is a Global Real Estate Professional (some might say influencer) who has worked extensively with China and Greater Asia for over the last decade. Both bringing Buyer and Investors over to the USA as well as providing safe and stable investments within Asia (and soon Latin America). He is often invited to speak internationally or interviewed for publications (online and print) on Global Real Estate related topics. He is currently the Chair for the California Association of REALTORS (200,000+ membership) Global Real Estate Forum and member of their Board of Directors. He has also served as Chair for the Award Winning Orange County REALTORS (OCR) Global Business Alliance Committee and past member of their Board of Directors, as well as active member or leadership with National Association of REALTORS, Asian Real Estate Association of America, National Association of Hispanic Real Estate Professionals, Chinese American Real Estate Professionals Association, etc.  -Robert Miller is a Global Financier and Rainmaker who has advised individuals, businesses and governments for over five decades, on four continents and in two languages (English and Spanish). He is the author of \u201cRainmaking: Impacting the World Through the Power of Emotions and the Magic of Storytelling\u201d and a frequent public speaker.. He is active in the local community as well as Asian Real Estate Association of America and National Association of Hispanic Real Estate Professionals.",
