    "title": "Help Korea Fight the New Coronavirus",
    "description": "  South Korea has emerged as a new frontline in the global fight against the COVID-19 pandemic.   \uacb0\uad6d \ub300\ud55c\ubbfc\uad6d\uc774 \uc2e0\uc885 \ucf54\ub85c\ub098\ubc14\uc774\ub7ec\uc2a4\uc758 \ucd5c\uc804\uc120\uc5d0 \uc704\uce58\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.  Although Wuhan, China remains the epicenter of the COVID-19 pandemic, South Korea is experiencing an exponential rise in the number of confirmed cases of COVID-19 infection, particularly in the city of Daegu.  \uc911\uad6d\uc774 \uc2e0\uc885 \ucf54\ub85c\ub098\ubc14\uc774\ub7ec\uc2a4\uc758 \ubc1c\uc6d0\uc9c0\uc774\uc9c0\ub9cc \ud55c\uad6d\uc740 \ud604\uc7ac \ub300\uad6c\ub97c \uc911\uc2ec\uc73c\ub85c \uae09\uaca9\ud558\uac8c \ud655\uc9c4\uc790\uc758 \uc22b\uc790\uac00 \uc99d\uac00\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\u00a0 \u00a0  As a result of the sudden and rapid increase in the number of infections, doctors and nurses in the frontline are facing steep shortages of various medical supplies including surgical masks and hand sanitizers.  \uac11\uc791\uc2a4\ub7ec\uc6b4 \uc22b\uc790\uc758 \uc99d\uac00\ub85c \uc778\ud574 \ucd5c\uc804\uc120\uc5d0 \uc2f8\uc6b0\uace0 \uc788\ub294 \uc758\ub8cc\uc9c4\ub4e4\uc774 \ub9c8\uc2a4\ud06c\uc640 \uc190\uc138\uc815\uc7ac\ub97c \ud3ec\ud568\ud55c \uc5ec\ub7ec \uc758\ub8cc \ubb3c\ud488\uc774 \ubd80\uc871\ud55c \uc0c1\ud669\uc785\ub2c8\ub2e4.  While Korea is half away around the globe, helping doctors and nurses in Korea stop the virus from further spreading in their countries is one of the best ways to ensure that the epidemic does not reach the United States.\u00a0\u00a0  \ud55c\uad6d\uc740 \ube44\ub85d \uc815 \ubc18\ub300\uc5d0 \uc704\uce58\ud574 \uc788\uc9c0\ub9cc \uc758\ub8cc\uc9c4\ub4e4\uc744 \ub3c4\uc640 \uc774 \uc804\uc5fc\ubcd1\uc744 \ud55c\uad6d\uc5d0\uc11c \uba48\ucd94\uac8c \ud558\ub294\uac83\uc774 \ubbf8\uad6d\uc5d0 \uc774 \ubc14\uc774\ub7ec\uc2a4\uac00 \ud37c\uc9c0\uc9c0 \uc54a\uac8c \ud558\ub294 \uac00\uc7a5 \uc88b\uc740 \ubc29\ubc95\uc77c \uac83\uc785\ub2c8\ub2e4.    In coordination with the  Korean Association of Public Health Doctors (KAPHD) , all proceeds will be used to purchase surgical masks, hand sanitizers, and food for the medical professionals currently working in Daegu, Korea.\u00a0  \ubaa8\ub4e0 \uae08\uc561\uc740  \ub300\ud55c\uacf5\uc911\ubcf4\uac74\uc758\uc0ac\ud611\uc758\ud68c \u00a0\uc640 \ud611\ub825\ud558\uc5ec \ub300\uad6c\uc5d0 \uc77c\ud558\uace0 \uacc4\uc2dc\ub294 \uc758\ub8cc\uc9c4\ub4e4\uc5d0\uac8c \ub9c8\uc2a4\ud06c, \uc190\uc138\uc815\uc7ac, \uadf8\ub9ac\uace0 \uc74c\uc2dd\uc758 \ud615\ud0dc\ub85c \uc804\ub2ec\ub420 \uc608\uc815\uc785\ub2c8\ub2e4.\u00a0 \u00a0 \u00a0  Every dollar counts.\u00a0 Please donate any amount that you feel comfortable with.\u00a0 Every dollar goes towards helping doctors and nurses in Korea fight COVID-19 and delays the virus from reaching the United States.\u00a0  \uc791\uc740 \uae08\uc561\uc774\ub77c\ub3c4 \ud070 \ud798\uc774 \ub429\ub2c8\ub2e4.\u00a0 \ubd80\ub2f4\ub418\uc9c0 \uc54a\ub294 \uc120\uc5d0\uc11c \uae30\ubd80\ub97c \ud1b5\ud574 \ub3c4\uc6c0\uc744 \uc8fc\uc2dc\uba74 \uac10\uc0ac\ud558\uaca0\uc2b5\ub2c8\ub2e4.\u00a0 \uc6b0\ub9ac\uc758 \uc815\uc131\uc740 \ud55c\uad6d\uc5d0\uc11c \uc77c\ud558\uace0 \uacc4\uc2dc\ub294 \uc758\ub8cc\uc9c4\ubd84\ub4e4\uc5d0\uac8c \ud070 \ud798\uc774 \ub418\uace0 \ucf54\ub85c\ub098 \ubc14\uc774\ub7ec\uc2a4\uac00 \ubbf8\uad6d\uae4c\uc9c0 \uc804\uc5fc\ub418\ub294 \uc2dc\uac04\uc744 \uc9c0\uc5f0\uc2dc\ud0ac \uc218 \uc788\uc744 \uac83 \uc785\ub2c8\ub2e4.",
