    "description": "  See our website \u00a0  Coronavirus Disease 2019, commonly known as 'Coronavirus' or Covid-19, has fallen into our lives, firstly was as a problem for others:\u00a0 In China there was a strange pneumonia epidemic, derived from bats or snakes.....one of the many news on TV!. \u00a0 Our lives continued to flow regularly, nothing seemed to be able to shake them so deeply, so quickly, as it actually happened within a weekend; that will remain forever etched in the memory, mine and of millions of other people.\u00a0  A weekend during which in northern Italy, psychosis spread freely, without any type of government filter, perhaps placed to protect businesses, from microscopic ones to multinationals. The media screamed all day long in an emergency, causing a panic reaction in the population, who rushed to stock up on food even if we were at war, deserted the streets, shops and restaurants. The same news was then reported by the media from all over the world, in fact generating what is today the real national emergency, or the inevitable and strong \"economic crisis\" that will affect most anyone who has to do with incoming tourism in Italy. DEFINITELY throughout 2020.\u00a0 \u00a0 \"My name is Stefano Santaiti, and I am the General Manager of Villa Patriarca hotel, in Mirano (Ve)\".  A beautiful Venetian Villa from the 1700s; located in the lands of Tiepolo, in Mirano, a town full of historic parks and enchanting places absolutely to be seen, a few minutes from Venice. We have infected people very close but none of them are here in our municipality/town.  However, Coronavirus IMMEDIATELY brought us enormous economic hardships.\u00a0 We had 95% of the rooms booked canceled. The prospect, UNFORTUNATELY, is to close FOREVER our VILLA..would be a tragedy not only for me but also for the families of all my staff, on average 20 people.  My pride prevents me from asking for charity, even in this difficult situation, therefore I had this idea:\u00a0 \u00a0 Selling 'social' vouchers: let me explain better: anyone who wants to help us not end up in the middle of a road, will receive an 8-year voucher for the same amount, which can be spent in any of our services: pizzeria, restaurant, hotel, swimming pool.  Basically, if you want to support us, you will have a unique opportunity: You will have helped good people in difficulty due to this situation, and in return you will receive a voucher valid for 8 years (the residual duration of my rent-contract) That you can use here our beautiful property when you will want and, I will have the opportunity to shake your hand and thank you personally on behalf of all the staff, for helping us in a moment of extreme need.   Thank you.\u00a0  ---------------------   Guarda il nostro sito web \u00a0  Il Coronavirus Desease 2019, comunemente detto \u2018Coronavirus\u2019 o Covid-19, \u00e8 entrato in sordina nelle nostre vite, prima come un problema di altri: nella lontana Cina stava verificandosi una strana epidemia di polmonite, derivata dai pipistrelli o serpenti... una delle tante notizie da Tg.  Le nostre vite continuavano a scorrere regolarmente, nulla sembrava poterle scuotere cos\u00ec profondamente, cos\u00ec velocemente, come \u00e8 poi effettivamente successo nel giro di un weekend; che rimarr\u00e0 perennemente impresso nella memoria, mia e di altre milioni di persone.  Un weekend durante il quale nel nord Italia, la psicosi ha dilagato liberamente, senza alcun tipo di filtro governativo, posto magari a tutela delle imprese, da quelle microscopiche alle multinazionali. I media hanno urlato per tutto il giorno all\u2019emergenza, provocando una reazione di panico nella popolazione, che si \u00e8 precipitata a far scorte alimentari nemmeno fossimo in guerra, ha disertato le strade, i negozi ed i ristoranti. Le stesse notizie sono poi state riportate dai media di tutto il mondo, generando di fatto quella che \u00e8 oggi la vera emergenza nazionale, ovvero la inevitabile e forte crisi economica che colpir\u00e0 maggiormente chiunque abbia a che fare con il turismo incoming in Italia. Sicuramente per tutto il 2020.  Mi chiamo Stefano Santaiti, e sono il gestore di Villa Patriarca hotel , a Mirano (Ve)  Una bellissima Villa Veneta del 1700; posta nelle terre del Tiepolo, a Mirano, cittadina piena di parchi storici e luoghi incantevoli assolutamente da vedere, a pochi minuti da Venezia. Abbiamo dei contagiati molto vicini. Ma nessuno qui nel comune.  Ciononostante Il Coronavirus ci ha messi in ginocchio. Abbiamo avuto la cancellazione del 95% delle camere prenotate. La prospettiva \u00e8 quella di chiudere, che sarebbe la rovina , oltre che per la mia, anche per le famiglie di tutti i nostri collaboratori, in media 20 persone.  L\u2019orgoglio mi impedisce di chiedere la carit\u00e0, anche in questa difficile situazione, pertanto ho avuto questa idea:  Vendere dei voucher \u2018sociali\u2019: mi spiego meglio: chiunque vorr\u00e0 contribuire a non farci finire in mezzo ad una strada, ricever\u00e0 un buono valido 8 anni di pari importo, spendibile in qualsiasi nostro servizio: pizzeria, ristorante, hotel, piscina.  In pratica, se vorrete sostenerci, avrete un\u2019occasione unica: Avrete aiutato delle brave persone in difficolt\u00e0 a causa di questa epidemia , e riceverete in cambio un buono valido 8 anni ( la durata residua del mio contratto!) da poter usare qui da noi quando vorrete, in modo che io possa avere l\u2019occasione di stringervi la mano e ringraziarvi personalmente a nome di tutto lo staff, per averci aiutato in un momento di estremo bisogno.   Grazie.   Lo staff  Villa Patriarca Hotel   Mirano (VENEZIA)",
