    "title": "Help LLP Expand the SHOP & Survive COVID-19",
    "description": "    Welcome!  For those of you who may not be aware, I quit my full-time job after quite a traumatic and emotionally abusive school year. I was completely shattered and disillusioned by the systems in place that often times push out educators such as myself. The educators who hold radical visions for our future and utilize art to reimagine our reality. Although it was a battle lost, I have decided to continue fighting to win the war. I will invest my gifts and my energy in sustaining a business that is accountable, grounded in truth, is constantly shifting towards best practices, and is invested in decolonization and the cyclical force of community.     Call to Action: \u00a0 Please donate anything you can to support my business\u00a0 LOVE. LIGHT   POETRY (LLP) by  MAR 31TH. Just before National Poetry Month!        2020 Fundraising Goals:     The goal for LOVE. LIGHT   POETRY (LLP) is expansion and abundance. We are working to construct a stronger and sustainable foundation for the growth of LLP.    Become an LLC      LLP will construct a sustainable foundation for LLP by becoming an LLC. February 1, will mark LLP\u2019s 3rd year in existence fulfilling its mission to expose the world to the medicinal elements of poetry and to fortify the accessibility of poetry workshops that urge individuals to be in constant dialogue with their life's purpose.\u00a0     Expand the SHOP       We would like to expand the SHOP with new apparel exhibiting lines of poetry that further spread the mission of LLP.\u00a0 Our apparel has successfully blessed individuals that come in reach with the radiating sun logo with love and light throughout the U.S and internationally.      Strides in 2019:         \u00a0*\u00a0 The video above is a peak into the Open Mic portion of a workshop *    - In 2019, LOVE. LIGHT   POETRY (LLP) serviced approximately 80 individuals in 9 workshops. LLP has hired two young women of color to intern experiencing first hand the functions of a business and have access to social/emotional development through our poetry workshops.   - Our apparel has successfully expanding beyond the 50 states and have been worn in Ghana, the Dominican Republic, Barbados, and Indonesia.   - Furthermore, we have been blessed to have run LLP with the support of our intimate communities and partnerships with organizations such as the People\u2019s Forum, May Day Space, The Audre Lorde Project, Children\u2019s Art Carnival, Survival Arts and more.\u00a0         Closing Message:     Every morning I arise and see the quote on my wall \u201cEverything seems impossible until it is done,\u201d by Nelson Mandela.     The only way our dreams come true is through the faith resting within ourselves and that of which is affirmed by the   communities  \u00a0 we create.  Anything  you can contribute is greatly appreciated! Please SHARE this GoFundMe within your communities to spread the word!\u00a0   Many blessings to you in the new year. The world is all yours, how you will you fill it with LOVE   LIGHT?     To learn more about LOVE. LIGHT   POETRY,\u00a0 visit our website  here \u00a0\u00a0.",
