    "title": "Patriotic American seeks help evading Coronavirus",
    "description": "I refused to study on Sunday for 2 years in college; then I refused to get on the dole all throughout the Obama economic Depression, even though I was unemployed then only 1 year.\u00a0 I predicted the economic collapse of 2008 5 years in advance.\u00a0\u00a0 \u00a0 \u00a0 \u00a0 I was a very idealistic but bumbling person in college.\u00a0 I was all alone and refused to study on Sunday for at least the last two years of my time in college.\u00a0 I was not lazy and did not have a substance abuse problem, a girl problem, or any hobbies that took up much time.\u00a0 I've never used drugs, including opioids.\u00a0 I studied engineering and then chemistry, subjects in which I was not talented.\u00a0 I refused to study on Sunday because I was converting to Catholicism and was under the mistaken impression that that was a sound thing to do, though I came to realize I had been wrong when it was already too late.\u00a0 I'm not a lazy person; I believe in hard work.\u00a0\u00a0 \u00a0 \u00a0 \u00a0I have been unemployed for the last eight years, and for the last 5 years, I have had debilitating health problems.\u00a0 My health before then was also very bad.\u00a0 After developing chronic insomnia in 2012, I went to the famous Dr. Don Colbert of Florida, an excellent holistic doctor who made the mistake of letting me take too much active folate, a B-vitamin to improve my concentration.\u00a0 It gave me \"walking disease\", which forced me to walk vigorously up to 5 hours a day.\u00a0 This could be considered a case of Akathisia, which is usually found in completely different circumtances.\u00a0 I continued like this for two years; it destroyed my adrenal glands.\u00a0 In November 2016, I stopped taking the active folate.\u00a0 After two months, my body came off my \"active folate high\", revealing that my adrenal glands were destroyed.\u00a0  \u00a0 \u00a0 \u00a0 \u00a0Since January 2017, I have had debilitating and chronic fatigue.\u00a0 I cannot just take iron pills or energy drinks to recover.\u00a0 My fatigue is so bad that after typing about fifteen to thirty minutes, my wrists will become very painful from fatigue.\u00a0 I cannot do office work.\u00a0 I am even too tired to read most books that I find enjoyable.\u00a0 This is not laziness or a lack of will power, but a major physical disability.\u00a0 Sustainable and meaningful recover requires a long process of supplements and treatments arranged by the famous specialist in adrenal fatigue, Dr. Carrie Lam of Orange County, California. \u00a0 \u00a0 \u00a0My health is so bad that in the very likely case that I catch the coronavirus, I am almost certain to die from it even though I am 36 years old.\u00a0 This is because it affects mainly old people and those with pre-existing conditions - exactly like mine.\u00a0 Therefore, I am desperate to find a way to recover from the coronavirus, as well as to help my parents pay my medical bills for Dr. Lam.\u00a0 I could not accept money from strangers unless I had some pretty precise and well-thought out plans, which I am rapidly working to devise.\u00a0 \u00a0My current plan is to go out into a very sparsely populated rural area and either rent a small cabin/apartment for three months or to live in a tent if necessary in a state park.\u00a0 I will consult multiple doctors to see if this is a sound idea.\u00a0 I believe I could do this for as little as $2000-$3000.\u00a0\u00a0 \u00a0 \u00a0 I would be as grateful as any man can be for somebody saving my life from certain death, which is basically what they would be doing as far as I am concerned.\u00a0 Right now, I depend on my parents for all my needs, but my parents, even though I love and respect them, are not competent or prudent.\u00a0 They will probably die from the virus too, but they are not taking it seriously.\u00a0  \u00a0 \u00a0 I would try very hard to pay my donors back and if necessary, I could get on the dole so my private donors wouldn't have to pay for my food.\u00a0 I have never had an aptitude for planning, but I have a lot of talent and I am still idealistic enough that I am willing to undergo a lot of hardship.\u00a0 I have a strong belief in personal responsibility, but I was too idealistic, unrealistic, and lonely in college to have the sense to study on Sundays.\u00a0 I have some Presbyterian, Scotch-Irish blood in me and as a result, I am stubborn and self-reliant to a fault.\u00a0  \u00a0 \u00a0 \u00a0 \u00a0Now, though, I desperately need help to save my life.\u00a0 I am ashamed to ask for help, but I did refuse to get on the dole or on Social Security disability for 11 years.\u00a0 I could have been on the latter for five years with perfect justification, but I hate asking others for money.\u00a0 I will try very hard to repay you.\u00a0\u00a0 \u00a0 \u00a0 \u00a0I am still very idealistic, but for twelve years I have been fully aware that I must match my idealism with a very strong work ethic and that I was mistaken in college about studying on Sunday.\u00a0 In certain, real ways, I have never had much of a chance in life.\u00a0 My idealism was based on the idea that America was in desperately bad shape and needed timeless wisdom to recover.\u00a0 I still think America could benefit from the world's best source of not-so common common sense, Aristotle, if that makes sense.\u00a0 Aristotle has been called \"the common sense philosopher\".\u00a0 Reading him, and other old classic western books, is key to being conservative.\u00a0 This important idea is promoted at Hillsdale College, which I deeply respect.\u00a0 Democracy is collapsing, but that is something the founding Fathers themselves realized would happen after 1789.\u00a0 I strongly believe that based on the thought of Plato; Aristotle; the first Duke of Wellington (the British soldier who defeated Napoleon); and Hans Hermann Hoppe.\u00a0 While I am a patriotic American, supporting the 2nd Amendment and other bedrock American institutions, I believe America has always been decadent and doomed to collapse relatively quickly.\u00a0\u00a0 \u00a0 \u00a0 \u00a0 I want to make the world a much more beautiful and happier place.\u00a0 I have a lot of talent and a lot of the kind of deep, classical, western-based learning that our universities should be trying to promote instead of rampant political correctness, socialism, and other non-western ideas.\u00a0 I even used to have great physical charisma, the remnants of which I still hope to use to get married and transmit to my children some day.\u00a0 I would be willing to marry a woman from a poor country, if necessary.\u00a0 Maybe my [future] children [since I have never slept with anybody or otherwise had children] can use their charisma to become famous leaders and spread a love of morality, personal responsibility, and liberty to future generations.\u00a0 I'm not pretentious or arrogant, but very humble and embarrassed.\u00a0\u00a0 \u00a0 \u00a0 Unfortunately, I would love to have enough money to head to the hills as soon as possible.\u00a0 I would have been planning this a month ago, but my health is bad enough that I could not plan as quickly as I wanted.\u00a0 Yes, I am goofy and very awkward, but as goofy as I am, I can do enormous good with my life.\u00a0 \u00a0 \u00a0 \u00a0 \u00a0PLEASE HELP ME SAVE MY OWN LIFE.",
