    "title": "Covid-19, istruttori sportivi senza stipendio",
    "description": "\n\n\n Il virus che sta terrorizzando il mondo in queste settimane, l\u2019ormai tristemente famoso\u00a0Covid-19, ha colpito in particolar modo le zone del Nord Italia e sta penalizzando a livello economico numerosissimi settori, alcuni pi\u00f9 di altri. Pochi, purtroppo, sono a conoscenza delle condizioni in cui versano le palestre e i centri sportivi italiani in questo momento.  Nelle regioni settentrionali ,  le palestre sono state chiuse a causa del virus e per questo gli istruttori di sala (come personal trainer) e gli istruttori di nuoto sono senza stipendio da settimane . Le piccole palestre rischiano la chiusura e migliaia di persone rischiano il posto di lavoro. Se gli istruttori non lavorano, non guadagnano neppure un fisso mensile.  In pi\u00f9, al momento il governo sta promettendo di stanziare aiuti economici solamente per le zone rosse e, anche l\u00ec, ESCLUDENDO totalmente questo settore. Ma i centri sportivi che sono stati obbligati a chiudere sono presenti in tutte le regioni pi\u00f9 colpite dal Coronavirus.  \n\n\n \n\n\n\n Io purtroppo non posso aiutarli  da sola, per questo rivolgo a tutti voi questa piccola richiesta di aiuto, sperando che possa poi ingrandirsi e raggiungere pi\u00f9 persone possibile.  Grazie mille .",
