    "title": "Helping Devon",
    "description": "For this young man to have to go through a traumatic event like this, which could have been prevented, we as community should come together and help as much as possible. This is a page to help raise not only money to help the family with his medical expenses, but to also help raise awareness and prevent other incidents like this from happening again and maybe shedding some knowledge to some that it's ok to continue learning from those who are knowledgable and willing to help in certain areas. We want to help and allow Devon to experience life without restrictions. Please take the time to read this incredible young man's journey. He is wise beyond his years and stronger than most his age. \u00a0\u00a0  \"On the morning of January 15th there was an accident in the weight room at Academy High School which resulted in the amputation of my pointer and middle finger. As you can imagine this has been very traumatic for me and some days are worse than others, and it will continue to get worse for me mentally for a little while. Actually varies moment by moment. I expect to return to school when I am released to do so. Due to the anxiety of this situation, I am asking to please not ask me questions about the accident when I return, it may cause me to replay the moment in my head and that won\u2019t end well. I will open up and talk when I am ready, please respect my privacy and space. I look forward to returning to my normal activities but I will be learning my new normal. While I am prepared this will take some time, I will be very quiet and sad, and at times very frustrated, please just understand I need time but I know I will be stronger and better than ever before I know it. I will continue to be in athletics of course and this only inspires me to work harder in what I do, but I do hope the school district does what they should do to make the weight room safer. I am grateful because it could\u2019ve ended in worse circumstances. I am also extremely grateful it was me that it happened to instead of any of my fellow loved classmates, this way it\u2019ll bring the districts attention to the situation and they could easily prevent it from happening to anybody else. I\u2019m very worried about everybody, but I understand everybody is worried about me as well, so thank you so much for your support and love during this extremely difficult time. It helps me during this time. The encouragement of family and friends that have visited and checked on me mean more to me then any of you will ever know.\" -Devon Hulsey",
