    "title": "Minnesota: COVID-19 Direct Relief Fund",
    "description": "A few years ago, I raised money to help kids across our state by eliminating their school lunch debt. I took action because I saw a need. Collectively, I knew we could do something about it. And we did: We wiped out lunch debt in schools across the state of Minnesota.  Today, we\u2019re facing a bigger challenge. The coronavirus is hitting Washington hard. Unfortunately, 29 people have died and 366 people have tested positive, according to the Health. Government officials warn it could reach 64,000 in a few months if our leaders do not take the steps necessary to stop the spread of the virus.\u00a0  We hope and encourage our government officials to do all they can to test, treat, and prevent the spread of the coronavirus.\u00a0  People need immediate help. During this crisis, those with the least suffer the most. Some folks can\u2019t go to the doctor because they don\u2019t have healthcare. Public schools are closed for at least two weeks and some people can\u2019t afford to take off work because they don\u2019t have paid sick leave. Some parents have to choose between paying the rent and feeding their kids.\u00a0  This will get worse before it gets better. But the good news is that there\u2019s a path forward.  You may wonder, like I have, if there\u2019s anything we can do to help. We don\u2019t have to sit idly by waiting for someone else to solve the problem. We can take action. We need to come together and lift up the folks that need a helping hand.\u00a0  I recently read about the Minnesota Foundation\u2019s COVID-19 Response Fund. The Seattle Foundation is an important organization providing direct relief to those that need it most. They will provide money to \u201cresidents without health insurance and/or access to sick days, people with limited English language proficiency, healthcare and gig economy workers, and communities of color, among others.\u201d The Fund is working closely with King County\u2019s Pandemic Community Advisory Group to identify organizations currently providing or receiving requests for support and will use the money raised on our campaign to assist with these efforts.  I will not have access to the funds. Every dollar donated will be transferred directly to the Minnesota Foundation. Your donation is tax-deductible.\u00a0  Please join me in becoming part of the solution. Donate $5, $10, or $25 bucks. Every contribution counts. Let your voice be heard and let the people know that we have their backs.",
