    "title": "Help us escape Covid19 with our dogs",
    "description": "\n \u00a0 \u00a0 Hello everybody! Our names are Alan and Ceren. We have been living in China for almost 5 years as English teachers. Currently, we are in Xiamen, Fujian Province.\n \n\n We have two adopted dogs:      This is Munchies. He is 4 years old. We found him as a 2-month-old puppy in Beijing, Wudaokou area. He has been a part of our family since then.    And this one is our \"Girl\" aka Miss Paws. We found her starving on the street in September 2019, in Xiamen. We have been trying to find her a forever family but unfortunately, we couldn`t find anybody.\u00a0 (The picture above is a part of the poster we prepared before for the adoption.) So, now she has become the newest addition to our family.  Until January 2020, everything was going nicely in our lives. But then,\u00a0  the Coronavirus outbreak has started and everything turned upside down.\u00a0 We are living under a nationwide quarantine. Finding masks and supplies is difficult. People couldn`t go to work for almost a month.\u00a0 Most companies resumed working on the 19th of February in most provinces, but schools are still closed and there is no specific starting date.\u00a0\n \n\n Out training center has been hurt by this deeply and we still have not gotten our salaries for January and February. Our management keeps telling us the only thing we can do is to wait until schools reopen, but even after that, there is no guarantee that they will pay us.\u00a0  Right now the only thing we are trying to do is get back to America, yet with our current financial situation, it is not possible. We need to buy plane tickets not only for us but for our pets which currently is more expensive given the situation.\u00a0 Our options are limited by the lack of airlines flying to China.\u00a0 Also, the paperwork which is required for our\u00a0 dogs to get on the planes is very expensive. We had considered staying longer yet with our rent and daily expenses we are not able to support ourselves. We already used all our savings and currently, we are surviving by the money our families have lent us and need to find a solution as fast as possible.  This unexpected pandemic is hurting everybody in a different way. We\u00a0 just want to go back home and be safe. Leaving our dogs behind is not an option.\u00a0   Please help us get home, we only have one month to finish everything and move our lives to America. We have lived here for five years and this has been one of the hardest things we have ever had to do. Our lives are here in China and to leave this all behind has been a challenge for us both mentally and physically.",
