    "description": "As the current rates of the coronavirus grow exponentially, higher than any other virus outbreak in history, the risk of mankind is at risk. By reducing interactions from human to human through a hazmat suit, we as a human race will be able to prevent and slow down these sky-rocketing rates. By raising these funds, hazmat suits will be donated to areas around the world currently such as Italy and Wuhan, China, to help doctors and medical professionals in need of sterilized equipment and apparel. As simple household medical supplies are being sold out and the current ones in stock have tripled their price and sometimes even quadruple, lower economy households will not be able to purchase these necessities themselves. So not only will these funds help with purchasing hazmat suits, but they will also help to give households around the U.S. simple things like hand sanitizer and soap. This is a critical issue in our society RIGHT NOW and we need to act fast, or else this will become a pandemic that people were just ignoring for the past couple weeks.",
