    "title": "Help keep my parents home for COVID-19 quarantine",
    "description": "I love my parents.\u00a0 They are the heart and soul of our family... and we want to keep them around for as long as possible.  Over the weekend, a Coronavirus outbreak occurred in Kirkland, Washington - a city not far from where my parents live.\u00a0 Today, Wednesday, March 4th, King County Public Health officials urged that the following groups of people should stay home: - People 60 and older - People with underlying health conditions including heart disease, lung disease, or diabetes - People who have weakened immune systems - People who are pregnant  Though my parents don't feel like it and don't realize it, they are actually considered \"elderly.\"\u00a0 (Shhhhhh!)\u00a0 Additionally, my dad has respiratory issues which seems to make him more susceptible to pneumonia and lung infections.\u00a0 Since the outbreak, I have been urging them to stay home, but with little success.\u00a0 They love to volunteer in the community, as it fills them up and keeps them busy.  My 15-year-old daughter reminded me that over the past month they have binged watched some shows on Netflix that kept them so enthralled that they actually stayed home for hours at a time.\u00a0 I had an \"a-ha\" moment.\u00a0   So, this morning - after urging them to pack up their Vanagon and just go camping for the next month or two (they laughed that idea off) - I passed along a list of shows they could binge on Netflix, with the idea that this might keep them busy and help them to be more content staying home and not volunteering out in the community.\u00a0   They really love crime dramas, mysteries, thrillers, British mysteries and thrillers.\u00a0 They are - at this very moment - watching Harlan Coben's \"Safe\"... but I know that soon they will run out of shows from my Netflix suggestions list to watch!  So, I am trying to raise some money for them to get subscriptions to BritBox, AcornTV and Hulu so that they can possibly get sucked in and forget that hours, days, weeks are passing by... all the while the Coronavirus can do its thing and my parents can remain healthy.  And while I am doing this a bit tongue in cheek, I am also doing it because I want my parents to know that they are cared about, valued and loved beyond measure.\u00a0 Any donation you can make towards these entertainment subscriptions would be so appreciated.\u00a0 Any suggestions or other ideas would be appreciated, too!  Thank you!\u00a0 Stay healthy and be well out there.\u00a0 Hug your parents!",
