    "title": "Battle Against The Coronavirus",
    "description": "In the first month of this year, however, a sudden outbreak of the novel Coronavirus turned the entire world into a mess and put everyone on alert. This novel Coronavirus is a contagious virus originated from Wuhan, China that can cause symptoms such as fever, cough, breathing difficulties, pneumonia, severe respiratory syndromes, and even death. It expanded rapidly after it was developed through different ways of transmission including animals to humans and humans to humans, just like how common cold is spread.  Several countries around the globe including Italy, China, United States, Japan, Australia, France, Germany, Canada, Singapore, Malaysia, Korea, and Finland were already found to be infected with this lethal virus. \n\nAccording to the Chinese government officials, this novel Coronavirus first appeared in a seafood market on December 12, 2019. Within a short month, the number of people who are confirmed to be infected with this coronavirus had already become 86,657 along with 2305 deaths. the W.H.O (World Health Organization) declared the outbreak of this novel Coronavirus to be a global health emergency. Starting from February 1, 2020, travel to China , Italy , Iran, South Correa was restricted and this would lead to huge economic downfalls in every single country. \n\n\nCurrently, tons of doctors and medical workers were fighting against the Coronavirus at the front line, and many of them had sacrificed their lives. With a tremendous amount of infected patients, China and many countries were facing medical shortages. Most of the hospitals in China desperately need supplies including masks, goggles, and protective suits. Without these types of equipment, the medical workers can be easily exposed to the Coronavirus and this can make the situation worse. \n\nSo, we need your help! We appreciate everyone that is willing to participate in this fundraiser and all of the generous contributions from you will be used to purchase protective medical equipment including protective suits, N95 masks, and medical goggles. All of these were in urgent need for those medical workers in the front line. We will ensure all funds that we received will be used to purchase these types of equipment and we will update the processes. \n\n\nLet\u2019s all fight against the Coronavirus together",
