    "title": "CoronaVirus family rescue",
    "description": " Imagine being overseas in another country with your wife and son,\u00a0 and finding out you have been stranded!  Government travel bans have caused Airlines to cancel tickets, without refunds/exchanges.    This Journey actually Began\u00a0 way back in 2013. I came here to volunteer and help out. I taught, and helped multiple pastors during that time. I also married my best friend. She had been in my life, although from a distance for a long time. My time for departure was arriving and I was spending the last of my money I had extra over what i would need to eat, gas in car to get to work etc.     Dengue Fever  didn't care about any of that! A mosquito bit me contaminating my body with the Dengue Virus causing massive loss, along with a deadly brutal sickness.\u00a0     Missed flight-2013  was a horrid disaster. My visa expired a few days after the missed flight. While I laid sick bedridden my visa expired adding violation fees to the necessary extension fees. The Missed flight was a disaster. No money, and no way out. The airline even agreed to just let me standby fly out for another $150.00 if could leave that same week. Yet my body wracked with pains and fever was not up to the task of travel even if it meant getting better.   I Survived Dengue,  and after seven more months of living on an average of around $30.00 per month, losing nearly 80 lbs, I was helped by a great fellow from a church to make it back to the states.     Another Virus, CoronaVirus seeks\u00a0 to wreak havoc in my life. That is why I brought up the Dengue experience. I lost my vehicles, tools for my business, furniture, clothes. I lost everything the first time with Dengue Fever. Due to being destitute I couldn't file papers to bring my wife home as we planned, being destitute meant leaving finally when I was helped, by myself to work and climb my way back up.  I paid all the loans back and slowly got back on my feet. It was a multiyear nightmare. Living on a hundred dollar per month food budget, no clothes budget, car budget, etc.    My family suffered being torn apart  for two years of only small contact with phonecards and Facebook Messenger.\u00a0 Then at three years I was able to scrounge enough to visit 2 weeks on a poverty budget. The next year I filed papers to bring my wife and they told me I needed to prove I made enough, I thought well does the asylum seekers need enough financial support? They come mooching having never paid taxes, I have paid taxes since 14 years of age and never taken even unemployment. So this seems wrong, not saying don't help asylum seekers and those that need, but don't then discriminate against your own citizens. Her being here would increase income, and keep my earnings in the country instead of the need to send a big portion to her to live.   Today I sit scared  as my wife and son were finally going to come. With our last appointment at the embassy my wife is coming home! I want her to fly same flight, it cost a lot as most seats are booked on my flight.    Flight Canceled  with no recourse, or solution in sight. \u00a0I don't have enough to replace my ticket, not even a dream or fantasy I will find a way or be blessed enough to get my wife and son replacement tickets too on a route and flight not canceled or high CoronaVirus locations.     I am asking,  even though I never have been a mooch and don't even know how, and really doubting anyone will care, and finding this hopeless, I am asking for your help.     Please\u00a0 help me get home so I can work, pay my rent and not lose all that I have worked these long hard years to get back. If possible I would like to raise $1,000 to get the ticket with aisle seat(I'm wide wont fit in economy except aisle). Yes I am cheap I fly cheap seats except for choosing aisle. I don't know if that is enough even as each day the prices change, and with more and more canceled travelers looking I expect it to become higher.\u00a0 That is the minimum, it will get me home to work, then hopefully In time I can get my wife a ticket and son and they will get home too.   Best option  would be finding way to bring them too by raising enough to pay their airfare also.\u00a0 Her visa is at stake as she has a window to enter the USA and waiting excessive time they sometimes wont even grant the whole window. I leave that up to you folks. I am no mooch but I am desperate as I am work injured an cannot work for the monies I used to when younger and healthier. I wouldn't recover from losing everything again.   Some Pictures Follow   One thing Great Happened while stuck in the Philippines, I watched my son be delivered.\u00a0 It happened at a small midwife clinic in middle of nowhere. Was scary, like out of the 1800's.    Last visit i was finally able to afford taking family and extended(2 sis in-laws and niece)to eat at a American quality equivalent restaurant. Was amazing cost around $16 per person but was better than any buffet i have been in America. They still are thankful, and smile so big when Vikings is brought up. For folks who make $2 or so a day with food costs at or around Americans(to buy they just don't buy the same foods eating lot cheaper than we do), they really appreciated it. As you can see I'm wearing a bulk pack white tee, I have learned from them to budget a lot more strictly.    For years I missed Birthdays and Christmas for not only my wife, but my son too. This was really hard for him. He wants to drive a backhoe so Papa can be home more. I cried when I heard that. I work hard, don't get drunk or waste money. Sometimes I wonder why has to be this hard. Work injury took my career away where I made enough to really provide a descent(not rich or even well off)life. I made 50-65k as a truck driver OTR.\u00a0 I switched to a local job so i could be with family when they came but the Union company turned out to be a not a great choice.  I was hurt and was their fault they even admitted as much, I am permanently injured and Doctors say unlikely to drive a truck again. The company didn't even pay the light duty work. Just refused forcing me to have to work or die of starvation and family hate me when they can't eat because I didn't send money. My injury is real, my pain is real, yet because they could force me to have to work just to survive they haven't even paid the surgery that would fix my shoulder to a point it may be possible to work again at 30% chance.  Some say I have lived a life under a black cloud of bad luck, Eric a great friend of mine says he has never met anyone with as bad a luck as I have. I may have bad Luck and it may seem like there is no hope, so what, each day is a new day it may just get better.\u00a0  I for one would like to believe I am done missing birthdays and Christmas presents getting opened and seeing my son smile. He is honor role and does try so hard even he has ADHD so bad like his dad(me). We are teaching him to learn to self adjust so he can function normally, something I only learned about in twenties and have learned through personal experience does work, but takes work and time.     Hopefully Last Airport parting\u00a0 was what I thought and believed before this travesty happened. Each time I flew out we took the pic here at the plaque outside the airport. Each time it was miserable and hard. Lost my house, all my business equipment and tools, clothes, just about everything else. I didn't lose the most important thing, my family. I may lost time I will never get back, but I still have my family. If you read this far please help, even its so small a gift, or just sharing to your church Facebook page etc.\u00a0 I have never collected a dollar on one of these, but I have given hundreds to help others, I did it even broke as I was, I knew others might be better off, but that doesn't mean they care.  Thank you all for reading my sob story, it is hard and I thank you for your time, thank those who gave, I know you didn't have to, thank you.",
