    "title": "Computer for Coronavirus research",
    "description": "I have been involved with distributed computing for the better part of a year. \u00a0Distributed computing is the process of taking a large chunk of computational data, breaking it up, sending it to individual users for automatic analyzation on their computer and sending the completed data back to the participating institution. \u00a0There are two main COVID-19 distributed computing research projects: Rosetta, run by the University of Washington, and Folding, run by Stanford. \u00a0Both have already made extremely important contributions to the understanding of COVID-19. \u00a0The more we know about this virus, the faster we will reach a cure.  When COVID-19 (Coronavirus) started to spread, I \u00a0brought several old computers back online to help with this work. \u00a0While this does help with research, my computers are between 8 and 12 years old...they are several orders of magnitude less powerful than modern scientific workstations. \u00a0They are unable perform modern heavy workloads, and combined consume roughly 2000 watts, 24 hours a day, 7 days a week.  I am looking to build a research workstation that will allow me to process heavy COVID-19 research workloads. \u00a0 A link to the computer build is listed. \u00a0This computer will be used ONLY for COVID-19 related research and data analyzation. \u00a0It will NOT be used for recreational activities, crypto mining, etc.  I am happy to answer any questions regarding COVID-19 research and the purpose of this computer. \u00a0Feel free to reach out to me at any time.",
