    "description": "Summary A new coronavirus named COVID-19 has spread across multiple continents and infected thousands of people. The virus has caused more than 3,000 deaths, primarily in China. Donations to this fund will help stop the spread of COVID-19 and support response efforts. (Please note: We cannot accept donations originating from Mainland China in accordance with the Law of the People's Republic of China on Administration of Activities of Overseas Nongovernmental Organizations.)  Challenge It is critical to stop the spread of the virus and provide medical care to those who need it. Patients and front-line medical responders in high-risk and quarantined areas need supplies and continued support as the crisis unfolds.  Solution Donations to this fund will bring services to affected communities and help stop the virus's spread. Initially, the fund will help meet immediate needs for healthcare, food, and water in partnership with our nonprofit partners. As the situation unfolds, it will transition to support longer-term education and recovery efforts run by local, vetted organizations in affected regions. We will work with our partners on the ground to allocate funds where they're most needed.  Long-Term Impact We believe that organizations that are deeply rooted in local communities are in the best position to provide long-term support for survivors of outbreaks and other crises. By funding the relief efforts of local organizations, donations to this fund have the potential to build stronger response capacity so that these organizations are better equipped to face future outbreaks. EmmaGiving will post reports about how funds have been used and will email these reports to donors.",
