    "title": "Covid-19 - Free access to truths/Ger\u00e7eklere eri\u015fim",
    "description": "Sevgili okuyucular,  Covid-19 salg\u0131n\u0131 ile alakal\u0131 hem TV ve gazete hem de sosyal medyada bilgi kirlili\u011finin ortas\u0131nday\u0131z.  Ge\u00e7ti\u011fimiz \u015eubat ay\u0131nda kendimi, do\u011fru bilgileri g\u00fcvenilmez olanlardan ay\u0131rmak i\u00e7in \u00e7ok zaman harcad\u0131\u011f\u0131m zor bir durumda buldum. Ayr\u0131ca, \u0130ngilizce konu\u015famayan T\u00fcrkiye'deki arkada\u015flar\u0131m\u0131n ya da aile \u00fcyelerimin SARSCoV2 ile ilgili haberleri takip edebilecekleri g\u00fcvenilir bir platform olmad\u0131\u011f\u0131n\u0131 fark ettim.  Bu nedenle, D\u00fcnya Sa\u011fl\u0131k \u00d6rg\u00fct\u00fc, resmi organlar veya g\u00fcvenilir haber kurulu\u015flar\u0131 gibi resmi kaynaklardan g\u00fcncellemeleri ve bilgileri toplad\u0131\u011f\u0131m bir web sitesi kurmaya karar verdim:   https://coronavirusu.net/  \u00a0  Ana motivasyonum, resmi g\u00fcncellemeleri ve g\u00fcvenilir kaynaklardan do\u011frulanm\u0131\u015f bilgileri sizlere iletmek. Platformda herhangi bir ki\u015fisel, politik, ideolojik d\u00fc\u015f\u00fcnce mevcut de\u011fil. Ayr\u0131ca, web sitesinde kullan\u0131lan her kaynak kesinlikle belirtiliyor. Reklamlarla finanse edebilece\u011fimi d\u00fc\u015f\u00fcnd\u00fcm, ancak \u015fu ana kadar toplam 22,85 TL (kabaca 3,5 EUR) elde edebildim. Hi\u00e7bir \u015feye faydas\u0131 olmad\u0131\u011f\u0131 i\u00e7in onlar\u0131 da kald\u0131rmak veya minimuma indirmek istiyorum.  Haberleri takip etmek, web sitesini g\u00fcncellemek, \u00e7eviri yapmak ve web sitesinin teknik y\u00f6n\u00fcn\u00fc korumak gibi faaliyetlerimi s\u00fcrd\u00fcrmek i\u00e7in deste\u011fe ihtiyac\u0131m var.  T\u00fcm soru ve \u00f6nerileriniz i\u00e7in 2019koronavirusu@gmail.com arac\u0131l\u0131\u011f\u0131yla do\u011frudan benimle ileti\u015fime ge\u00e7ebilirsiniz.  Sayg\u0131lar\u0131mla, Orkun  ----------------------  Dear readers,  Since Covid-19 has hit the world and continues to spread, we are in the middle of the info pollution both on traditional and social media.  Last February, I found myself in a difficult situation where I spend a lot of time to differentiate the correct information from the unreliable ones. Also, I noticed my friends or family members in Turkey, who cannot speak English, did not have one single platform where they can follow the news about SARSCoV2.  That\u2019s why I decided to set up a website, where I collect the updates and information from official sources such as the World Health Organization, official bodies or reliable news organizations:   https://coronavirusu.net/  \u00a0  The website is in Turkish for various reasons: \u2022 There are a lot of people in Turkey can\u2019t follow the English-language sources. We translate them for the Turkish speaking people. \u2022 Information pollution is even bigger when we don\u2019t reach the first source and under the censorship.  My main motivation is to convey official updates and confirmed information to people from reliable sources. I am not adding any personal, political, ideological opinon of anyone. Also, each source used in the website is certainly cited in the website. I thought I can finance it with ads but so far the profit is 22.85 TRY(roughly 3.5 EUR). Therefore I want to get rid of them to avoid distractions.  I need support in order to continue my activities such as following the news, updating the website, making the translations and maintaining the technical aspect of the website.   For all the questions and advices you can directly contact me via 2019koronavirusu@gmail.com  Kind regards, Orkun",
