    "title": "COVID-19 Vaccine Research",
    "description": " This is a fundraising initiative to pursue the creation of\u00a0a COVID-19 Vaccine by Dr. Wilfred Jefferies and his team.\u00a0   Dr. Wilfred Jefferies is a Professor in the Michael Smith Laboratories and a Senior Research Scientist in the Vancouver Prostate Centre at the University of British Columbia. Dr. Jefferies is working towards creating and testing a safe and effective vaccine for the novel coronavirus, COVID-19. His approach is explained here:    https://globalnews.ca/video/6622294/ubc-research-teams-work-on-high-performance-covid-19-vaccine    In January 2020, a novel coronavirus (COVID-19) was identified as the cause of an outbreak of pneumonia originating in Wuhan, China and has since spread to at least 89 countries and territories around the world.\u00a0Small-molecule anti-viral \u00a0therapies targeting different stages of the corona virus lifecycle may be\u00a0effective in treating COVID-19, however, in the absence of an effective vaccine, the probability of containment is low and the world must be\u00a0prepared for a pandemic. Therefore, the rapid\u00a0development of protective vaccines against COVID-19 has become a societal priority but remains a scientific challenge. The ideal COVID-19 vaccine would elicit highly potent neutralizing antibody responses against a broad spectrum of emerging COVID-19 viral strains; induce protection against infection and transmission; and be safe by not inducing any harmful immune or inflammatory responses. These are particular challenges in vaccination against viruses such as COVID-19. This funding initiative builds upon groundbreaking research by Dr. Jefferies and his team on vaccines against Rubella, West Nile Virus, Smallpox, Influenza, and Cancers and seeks to create and test a safe and effective COVID-19 vaccine for rapid implementation.\u00a0  The Sullivan Urology Foundation supports Dr Jefferies in his work at UBC and the Vancouver Prostate Centre and is partnering with this GoFundMe in support of the development of a COVID-19 vaccine.\u00a0 The Sullivan Urology Foundation provides financial support to the Department of Urologic Sciences at the University of British Columbia for basic scientific translational and clinical research.\u00a0   http://www.urologyfoundation.ca/",
