    "description": "As a resident of California and a Citizen of this great nation, the United States of America, I wanted to feel like I was helping the Homeless Population of California.\u00a0 I was introduced to this great charity that I feel has the proper management and mission purpose to help the Homeless.\u00a0 What would happen to those poor individuals and families on the streets if and when the Coronavirus infects them?\u00a0 This organization could help. Whatever your Faith, Gender, or Political Affiliation, it means nothing when it comes to helping those in need.\u00a0\u00a0  \"As of January 2019, California had an estimated 151,278 experiencing homelessness on any given day, as reported by Continuums of Care to the U.S. Department of Housing and Urban Development (HUD). Of that Total, 7,044 were family households, 10,980 were Veterans, 11,993 were unaccompanied young adults (aged 18-24), and 41,557 were individuals experiencing chronic homelessness.  Public school data reported to the U.S. Department of Education during the 2017-2018 school year shows that an estimated 263,058 public school students experienced homelessness over the course of the year. Of that total, 10,407 students were unsheltered, 17,299 were in shelters, 13,713 were in hotels/motels, and 221,639 were doubled up.\"  Source:  Homeless Statistics \u00a0   If 15,000 of us in this great state of California and Great Country would just donate $10 to this organization, we could meet our goal of donating around $10 bucks for every 10 homeless people in California!   I will not drink my favorite specialty coffee TODAY and donate the first $10 to this organization.  THANK YOU for reading this!   More information about Lutheran Social Services of Southern California: Today LSSSC annually serves thousands of individuals and families in need throughout Southern California with over 50 different programs/services at over 20 different locations.\u00a0 LSSSC is associated with other Lutheran Social Services all over the United States!   \u00a0 Picture Source",
