    "title": "COVID-19: Connecting People with Chronic Illness",
    "description": "As we face the COVID-19 pandemic in the US and worldwide, we all are wondering how we will get through it, individually and collectively. And people with chronic illnesses need specific strategies.  I'll get to the point:   I'm working with organizations and people across the country to help launch a powerful national network of people with chronic illnesses.    --  We need your support, your wisdom, and your love -- and if possible, financial contributions.  --      What We're Doing:  For now, we're calling it Chronic Illness Leadership For Emergent Times (CILFET). But what's most important is what we have done and will do  --  We hosted a video meeting on Saturday, March 7 that's now a  Healing Justice Podcast episode   ---  Thanks to: PeoplesHub, AIDS United, BEAM (Black Emotional and Mental Health Collective) Counter Narrative Project, Health Justice Commons, #MEAction Network, Positive Women's Network - USA and The Reunion Project  And to our webinar speakers, facilitators, promoters, strategists and producers Kate Werning of Healing Justice Podcast, Evvie Ormon of EmergingPhoenix consulting, Dr. Crissaris Sarnelli, Elandria Williams of PeoplesHub, Emily Szklarski, Joan Dark, Kate Sorensen, Andrew Reynolds,\u00a0 and Daisy Becerra.  --  We have materials from the webinar and resources up at  bit.ly/cilfetstuff.\u00a0   --  We will continue hosting and supporting mutual aid and conversations centering people with chronic illnesses and disabilities  --  We're planning and initiating a rapidly-scalable plan for this network based on emergent strategies and mutual aid. We need your support to move forward as quickly and effectively as possible.  Why We are Doing This:  As you know, people living with some chronic illnesses and disabilities are at greater risk of acquiring a coronavirus, having a more severe course of it and complications during or afterwards, and higher mortality rates.  And those facing oppression, marginalization and criminalization are most affected by heightened demands on health care systems and supply chains, economic turmoil, and rising stigma and bias.  (let\u2019s all take a breath or a little pause\u2026)  But queer and trans people have always had to find new paths for our survival. Our strategies for dealing with chronic illnesses, like our communities themselves, are diverse, creative and take nothing for granted.  We are building a small but amazing team of network strategists, health professionals and healers, facilitators, fiscal managers, disaster response pros, project managers and tech experts, communicators and media producers. We want to situate this vital network in a stable home or formation so it can do what it needs to do.  Your support goes directly to help this team do what we need to do -- which are primarily queer and trans people living with multiple chronic conditions.  Thank you.   GoFundMe has asked for people raising funds about COVID-19 to provide this specific information:    1. Who you are: JD Davids    2. Where you're from: I live in Brooklyn, NY    3. Your relationship to the parties you're raising funds for: They are for myself and a small team working on this effort. (see next question).    4. How the funds will be spent (be specific as possible): The funds will be used to donate to the small team of people who I am working with who are giving up time on other paid work or who are working with low pay to launch this important network. It includes me, and a social media and communications manager who lives in New Jersey, an artist and filmmaker in Utah, a recent graduate school graduate in New Orleans with a degree in disaster response, an organizer in Brooklyn who also works part time at a radical bookstore, and will include one of two people in NYC I am talking to who are experts in creating networks and sustainable cooperative groups.",
