    "description": "As you may know, the grave situation in Wuhan and China continue to worsen by the day. Currently, the government is mass quarantining people who have been infected in poor conditions and in places that were not designed to house large amounts of people for long periods of times (i.e sports stadiums, exhibits, etc). There is a growing shortage of basic medical supplies such as masks and medical kits for proper diagnoses\u2014this is expected to only be exacerbated with the continued lock down and eventually include food, water, etc. In most parts of China there is a significant shortage of masks and other protective wear, making the prevention and protection of civilians increasingly challenging.   We can not afford to allow basic protection/resources be the reason this mass spreads, kills more on a global scale and further impact the global economy.\u00a0 In 2003, SARS cost the global economy\u00a0 $40B.\u00a0 At that time, China's GDP was\u00a0 25% \u00a0of what it is today.\u00a0  Did you know?  Masks should be changed out every four hours in order to prevent virus from contaminating/penetrating the mask.   \n\nDue to shortages of medical kits the numbers are currently very underreported (31k diagnosed, 600+ deaths as of 2/6) and hospitals are forced to turn people away due to these shortages and hospital overcrowding.\n\nFor those who don\u2019t know me, my name is Alice and I am from the greater Philadelphia area. I currently reside in San Francisco. 100% of the money raised will go towards the procuring and shipping supplies from the US to less urban areas of China where they are most challenged with basic resources to keep themselves safe.  My mom is currently in a small town (Jiangxi province) and has a group of volunteers that are willing to travel to neighboring towns to deliver and donate masks and other supplies to local hospitals.   This plan is set to evolve depending on how much we are able to raise. The more ambitious goal is to air ship supplies directly there (multiple times). Cost estimates and potential impact below (based on amazon prices--will also be researching wholesalers to improve quantities):  - $8,000  can buy ~ 2,200   N95 masks  that can be distributed to hospitals and quarantine facilities (to be used to protect nurses and doctors) - $8,000  can buy  40,000 flu masks  that will be distributed for civilian protection - $30,000  can buy  7,200 8 oz.  hand sanitizers -air ship cost: TBD. Placeholder for $5k for now.  Anything helps!! Thank you in advance!!\n\nUpdate Feb 13th: purchased and shipped 10 boxes of N95 masks via amazon ($1450)\n\nUpdate March 6th: first two boxes have arrived!!\n\nUpcoming plans: sending hand sanitizers to Wuhan directly to my cousins address for donations to local hospitals and schools.",
