    "title": "Do It For Liam",
    "description": "Liam\u2019s journey started on September 9, 2019. The day my world got a lot brighter and joyful To be a parent. Liam is 7 months old. About two months ago he was diagnosed with Guillain-Barr\u00e9 syndrome if you don\u2019t know what that is, it\u2019s is a serious health problem that occurs when the body's defense (immune) system mistakenly attacks part of the peripheral nervous system. This leads to nerve inflammation that causes muscle weakness or paralysis and other symptoms. That day I cried my eyes out and my whole world turned upside down. But when I looked at Liam he had the greatest joy and giggled when I said peek a boo, your my little sunshine. It breaks my heart knowing that one day my baby boy could die. But he is stronger than anything in the whole wide world and he has a heart\nOf gold. For the past two months I have been going to specialists and surgeons and doctors appoints to get some info on how it gets better and about two\nDays ago Dr. Leung contacted me and said there is an experimental treatment but because he is so young it will cost a lot of money and me and my wife Lauren can\u2019t handle the cost. The surgery is Spinal tap (lumbar puncture). A small amount of fluid is withdrawn from the spinal canal in your lower back. The fluid is tested for a type of change that commonly occurs in people who have Guillain-Barr\u00e9 syndrome. That alone cost us $18,000. But that\u2019s not the problem the treatment is Immunoglobulin therapy. Immunoglobulin containing healthy antibodies from blood donors is given through a vein (intravenously). High doses of immunoglobulin can block the damaging antibodies that may contribute to Guillain-Barr\u00e9 syndrome. And cause it to dissipate to the point where he is clean and healthy and it cost us around $73,450. This treatment could allow me to be able to teach my son Liam how to play baseball \u26be\ufe0f and I would truly love that just as much as he would love to go to the park and enjoy life. PLEASE HELP US MAKE PUT BABY BOY BE ABLE TO CRAWL, WALK, And be free.",
