    "description": "\n Not so long ago I didn't really think about what was going on in China with the coronavirus. How many people are sick with it. I thought the media was just panicking.\n \n\n But 2 days ago my friend Mike got the coronavirus in Italy. He was there on vacation with his family, now doctors forbid even to visit him.  After that, I wondered what I could do to help fight the virus. What can we do?\n \n\n But we can do a lot!  COVID-19 is a fairly strong virus with high persistence, which increases in hematologic progression. The only thing that mankind can do at the moment is to have a vaccine that will take 5 years or more to develop (along with trials).   Now mankind can only prevent it from spreading so fast. To do so, you need to reduce contact with humans and wear masks.   At the moment, people in Europe are in great need of masks. As in Korea, especially China. But Europe was not ready for such a rapid spread of the virus, so they now have an acute shortage of masks.  That's why we want to help with our own means as well as to attract donors to buy/create N95 masks and send them to Europe. To countries such as Italy, France, Germany, and others.\n \n\n In this environment, many speculators have appeared. Which inflates the prices of masks ten times. Not everyone can afford these masks.  But we plan to send more than MILLIONS of masks.   Every cent is important to us.  Stop the virus spreading together!",
