    "title": "FRONTLINES COVID_19 -KILLING IT, with Kindness!",
    "description": "Life in the USA Coronavirus Epicenter. Killing it with kindness!! Helping others is something that elevates the spirit.\u00a0 Uplifting your spirit makes it harder for you to get and stay sick.\u00a0 There is proof of that everyday around the world. \n\nOur Mission? Killin it with Kindness: Giving and Undertaking a scary and endless task \u00a0for those in need! And right now in our home state there is MASSIVE NEED!\n\nWe live in the epicenter of the Coronavirus epidemic for the USA, Bellevue Washington.\u00a0 Just a few miles from Kirkland, Washington, where virtually all our states deaths have ensued. We are in respectable physical health and BELIEVE our immune systems are resilient. We are saddened to see so many people terrified and so few that are willing to help; do to fear and rightly so. We feel the need to do what is on our hearts and volunteer to suit up and go to Battle with this Epidemic. \u00a0To start, we want to offer our services to completely disinfect areas around King, Pierce, Snohomish County, and surrounding areas. \u00a0No job too small or big, we would firstly like to focus on places centered on those with already compromised immune systems, people who have self-quarantined and need some extra help to disinfect their location\u00a0 Communal gathering Places, Schools, and Churches. Stores and restaurants \n\n\n\nWe ask YOU to please consider a donation of even 5$ to support attainment the costly supplies needed to do this job!! These things include (but are not limited to):\n\n\n\n\n\u00a0Powerful germ killing Steam Cleaners that can range from $300-$2000\n\nHot water power washers,\n\nIndustrial disinfectant, sanitization kits\n\nSanitization suits, a piece of personal protective equipment that consists of an impermeable whole-body garment worn as protection against hazardous materials.\u00a0\u00a0\n\nGLOVES\n\nRespirator with inserts for bio/ chemical filtration\n\nSoap and antibacterial BODY WASH\n\nVitamins and supplements to keep our healthy team that way!!\n\nLiving in the epicenter of this virus right now is seriously eerie, when the streets of Seattle are bare and the roads are clear. People are held hostage in their own homes under this virus and its still spreading , we vow to fight this TILL THE END. We are asking for a goal of $15,000 to allow us to purchase these needed tools ASAP and get to Work!!\n\nAs long as the donations allow it we will be working nonstop going to the front lines with our weapons of mass destruction until the coronavirus has left the building! Services will be complimentary for those who cannot afford it. Period. LET\u2019S DO THIS.\n\nWho are we? Just a small group of Janitorial Workers, and Property Maintenance and management personnel who are healthy and not crippled by fear, who are willing to do the job that very few are willing to do, we will update regularly on what our team is doing to help slow and stop this virus from spreading any further.\u00a0\u00a0Thank you and God bless, if you cannot donate please share!",
