    "title": "My fantastic death bed featuring COVID-19",
    "description": "Unfortunately its all come down to this. After a 10 day trip visiting my family in Florida I had what appeared to be a panic attack on January 27th on my way back home across the country to Arizona. A shortness of breath came over me,my blood pressure rose, and my heart started palpitating like crazy. Needless to say I thought I was having a heart attack and was going to die.  \u00a0 \u00a0 I had a connecting flight in Dallas but sent my luggage through to Arizona and got taken to the hospital. They did loads of blood tests, nasal swab, the works. Everything came back normal and they sent me on my way.  \u00a0 \u00a0The next day I woke up with a really dry mouth and a fever in the hotel, that tightness in my chest was still there and I felt as though I couldn't breathe but this time I was alone. \u00a0 \u00a0This is all in the midst of the Coronavirus scare so I was somewhat worried especially since I was in the same hospital as the Texas first case. Before many Americans were taking it seriously. I had a choice to make; go home thousands of miles from my family or get my flight changed and get to the bottom of this.  \u00a0 \u00a0 Fast forward to now. I've been to the E.R. 4 times and saw my primary care for the first time last week. I had another fever and dry mouth and a dry cough for the first time. They tested me for the flu and it came back negative. \u00a0 \u00a0Now everyday my breathing has been getting worse. Then I find out that COVID-19 has shown up in Florida cities away from eachother with no travel history of patients. I've attempted to get tested for COVID-19 but it all failed despite being at three seperate international airports and Florida hotspots before travel restrictions were implemented. Somehow I still dont fit the testing criteria.  \u00a0 \u00a0Now I'm with my family who is trying to be cool and collected but I feel I'm just a burden. I have no income and one weeks woth of clothes. Whats worse is I'm seeing them getting sick as well and they're trying to ignore it. I'm now stuck with medical bills and dont think I'll be able to make it and pay them. I lost my job over this illness and just want to be able to keep my family comfortable if I die.  \u00a0 As much as I hate sob stories and begging for money I ask you fine folk to please get the word about this out there. I would hate for my community to fall victim to such a terrifying disease. I'll keep updates via youtube most likely. If anyone has any medical supplies they would be willing to spare that would also be appreciated. \u00a0 \u00a0 If I'm able to get tested for COVID-19 before this gets any worse I'll update you. If I find out what's actually happening I'll update you. If I get quarantined I'll update you. I just want to keep my loved ones safe. As should all of you. \u00a0 \u00a0 Any advice on where to support COVID-19 patients would be very helpful as well because I would like to put 20% of donations toward families affected by COVID-19. As a hurricane Katrina survivor I understand what its like to be in an idle position where you feel hopeless and helpless. I dont want my loved ones to be in that position ever again. Youtube updates",
