    "title": "Help us manufacture supplies to fight Coronavirus",
    "description": "\n  Help us fight the CoronaVirus by donating! \n \n\n  What is Covid-19 \u2013 the illness that started in Wuhan?  It is caused by a member of the coronavirus family that has never been encountered before. Like other coronaviruses, it has come from animals. Many of those initially infected either worked or frequently shopped in the Huanan seafood wholesale market in the centre of the Chinese city.   What are the symptoms this coronavirus causes?  The virus can cause pneumonia. Those who have fallen ill are reported to suffer coughs, fever and breathing difficulties. In severe cases there can be organ failure. As this is viral pneumonia, antibiotics are of no use. The antiviral drugs we have against flu will not work. Recovery depends on the strength of the immune system. Many of those who have died were already in poor health.   Is the virus being transmitted from one person to another?  China\u2019s national health commission has confirmed human-to-human transmission, and there have been such transmissions elsewhere.   How many people have been affected?  As of 6 March, the global death toll was 3,404, while more than 100,000 people have been infected in more than 80 countries, according to the Johns Hopkins University Center for Systems Science and Engineering.  The death toll has passed 3,000 in China, where there have been over 80,000 cases. South Korea, the nation worst hit by the outbreak outside China, has had 6,593 cases. More than 55,000 people in China have recovered from Covid-19.   Why is this worse than normal influenza, and how worried are the experts?  We don\u2019t yet know how dangerous the new coronavirus is, and we won\u2019t know until more data comes in. The mortality rate is around 2% in the epicentre of the outbreak, Hubei province, and less than that elsewhere. For comparison, seasonal flu typically has a mortality rate below 1% and is thought to cause about 400,000 deathseach year globally. Sars had a death rate of more than 10%.  Another key unknown is how contagious the coronavirus is. A crucial difference is that unlike flu, there is no vaccine for the new coronavirus, which means it is more difficult for vulnerable members of the population \u2013 elderly people or those with existing respiratory or immune problems \u2013 to protect themselves. Hand-washing and avoiding other people if you feel unwell are important. One sensible step is to get the flu vaccine, which will reduce the burden on health services if the outbreak turns into a wider epidemic.\n \n\n  Why we want to help?  As you may be aware, people\u00a0all across the globe are flocking to grocery stores and wholesale clubs as the number of coronavirus cases continues to grow. Those of us who are fortunate enough to be able to go and buy in bulk,\u00a0everything we need, such as; masks, gloves, canned foods, hand sanitizer etc. are fine, but as this continues, the price gouging continues as does the major retail stores facing short to long term shortages. We want to help those who are not fortunate enough to able to take these basic cautionary steps, whether the reason is they are elderly, homeless, simply can not afford it or have mobility issues.\n \n\n  What we want to do to help fight the virus?  Our main focus is to keep supplying what is needed in order for all of us as a community to fight this. This is why we will be using the money you generously donate, to lease a factory warehouse, purchase the machines and equipment necessary to manufacture N95 Respiratory masks, gloves, overall protective wear, hand sanitizers as well as be able to source and stock on canned foods and the essentials we all need to protect ourselves and stay healthy.  Thank you for taking your time to read through and we hope you donate to help us!  Please contact us for any questions you may have!",
