    "title": "Benefit Concert for COVID-19 Relief  at Bard",
    "description": "The coronavirus disease started in December 2019. It was first identified in Wuhan, the capital of Hubei province in China. The study so far shows that it originated from another animal and subsequently spread between people. Symptoms may include fever, cough, and shortness of breath. Up to now, there is no vaccine or specific treatment. Patients are treated with symptoms management and supportive therapy.   Up to Feb 21, 2020, over 75,000 people were diagnosed as patients of coronavirus disease. 2236 people died. Since the first week of the outbreak, the medical supplies have been in shortage. None of the hospitals had enough reserves of medical materials. A lot of medical workers and volunteers were almost unprotected.     As young adults, we want to do something for them. Before this benefit concert, we raised around $12,000 and connected with a hospital in Huanggang. The good news is that the supplies we purchased departed on Feb 21 from Chicago to China. And Huanggang Central Hospital will receive them within a few days.\u00a0    Please click the link below   for more info of Benefit Concert for Coronavirus Relief at Bard College:   https://www.facebook.com/ziyue.he.9828/posts/101526228115263?__tn__=K-R      Speech from President Leon Botstein at the beginning   With the generous support of Bard College and Bard College Conservatory of Music, we organized a benefit concert within ten days and the result was so inspiring and optimistic that went beyond our expectation.     Zongheng Zhang the Conductor of the Orchestra   1. Sonata-Reminiscenza, Op.38 No.1 /By Nikolai Medtner 2. \u4e1d\u8def\u9a7c\u94c3 \u2014 The Silk Road Camel. /By Yong Ning 3. \u601d\u4e61\u66f2 \u2014 Nostalgia. /By Sicong Ma 4. \u6566\u714c \u2014 Dun Huang. /By Ying Jiang 5. Orchestra \u00a0 \u00a0 \u00a0 \u00a0 a. Flowing Streams. /By Yuankai Bao \u00a0 \u00a0 \u00a0 \u00a0 b. Dialogue of Flowers. /By Yuankai Bao \u00a0 \u00a0 \u00a0 \u00a0 c. The Dance of Yao People. /By Yuan Mao \u00a0 \u00a0 \u00a0 \u00a0 d. The Symphony Overture No.1. /By Xia Guan    Talk from Caroline (Ziyue) He   \"Fear is our instinct. The way we conquer it and empower ourselves is to take responsibility, no matter how big or small. Our responsibility is to resist. When society doesn\u2019t encourage us to build real connections, it is a kind of solidarity and resistance that we keep reaching out to each other, and build friendships.\"    Donation Box   Up to Feb 25, 2020, 0:00 (EST), we raised:  Cash $1807.93 + \u00a51000/$142.19 (Exchange rate 2/25) Venmo $1675.00 Check $170 Total $3795.12 THANK YOU ALL!!\u2764\ufe0f   Our online donation channel would be Go Fund Me in the future.      Orchestra     Orchestra   If you have any questions, feel free to contact us via email.",
