    "title": "Help Doctors and Nurses fighting Coronavirus",
    "description": "\"Dear friends, as many of you know I am a doctor. [...] I have been working tirelessly day and night for the past two weeks alongside my colleagues at St. Anna hospital in Brescia. The hospital is full, the intensive care unit is full. Every day we get more patients fighting Coronavirus but our resources are finished. I am not talking about face masks or hand gel. I am talking about oxygen, and breathing machines for pneumonia, and antiviral treatments.\u00a0 \n[...] \nThis means every day me and my colleagues have to choose. We choose who gets treatment, and who just has to go home and wait. Like in wartime.\"\n\nThis is part of a message shared by a friend at the forefront of the current outbreak in Lombardy, Italy.\u00a0 \n\nI am from a small town close to Brescia, but I live in the UK. My whole family still lives there.\nI woke up last Sunday to the news that the whole region was quarantined. Nobody in, nobody out.\nA couple of phone calls were enough for me to understand the severity of the situation, and to feel the urge to help, which is why I created this page.\n\nOver 5000 people tested positive to COVID-19 in the past two weeks in Italy, including 10% of the health professionals who are working to contain the emergency.\u00a0 \n\nIn the most affected northern area, 95% of the total intensive care beds are taken. \n\nMore beds, more medical equipment, more medications are necessary to end this. The sooner this ends in Italy, China, and all worst-hit regions, the smaller the chance the virus reaches your Country, your City, and your family. \n\nPlease help with whatever you can today. \n\nAll donations will go to Azienda Ospedaliera Spedali Civili di Brescia, and will be used to purchase equipment and medications to treat COVID-19. Link below.\u00a0\n http://www.asst-spedalicivili.it/servizi/Menu/dinamica.aspx?idSezione=20471 idArea=20814 idCat=20474 ID=20474 TipoElemento=categoria \u00a0\n\n\u00a0 *Coronavirus is a global emergency and we can all contribute to contain it by following the suggested measures from the WHO ( https://www.who.int/emergencies/diseases/novel-coronavirus-2019  ) \n\nThank you for your help\u00a0  3\n#bettertogether",
