    "description": "Due to the current Coronavirus outbreak or pandemic, it is better to provide prevention of sick people exposing themselves to the general public.  A friend of mine had told me about a thermal imaging device that captures pictures of that person and gantry control with A.I. which was invented by a Chinese company during this crisis. They are working around the clock to provide to the Chinese government and companies.  It can detect heat signatures over 37 degrees and gives a warning. It can also be incorporated into gantry and autogate systems. Putting up these devices at the entrance of shopping malls, supermarkets, churches can help to detect those people with fever (common symptoms of Coronavirus, SARS, MERS, etc.). Then a security officer can advise the sick to go home and rest.  Places and areas like (trains, buses, restaurants, malls, cinemas, stadiums, etc.) are common spread of viruses to the mass public. So prevention is always better than cure.  Currently, these devices are only in the Chinese language and I have requested them to do an English version. They are too busy to just produce an English unit and send it as a sample. They will provide an update tool (APP) so that I can do changes myself if I make a purchase. The cost of one unit is AUD$4000. So I hoping that through gofundme, I can get these funds to do my first purchase then make the language update and then send out this sample to respective businesses and government agencies for them to test and get them to start helping the general public with better detection.",
