    "title": "Aiutiamo gli Ospedali del Sud contro il COVID-19",
    "description": "Sono un medico italiano, vivo a Londra e parlo ogni giorno, ormai da settimane, della questione coronavirus con i miei amici pugliesi disperati per ci\u00f2 che sta accadendo in Italia. L'idea che la nostra terra venga messa in ginocchio da un virus che, ad oggi, non sappiamo come sconfiggere, non ci d\u00e0 pace e sentiamo il bisogno di fare qualcosa per aiutare il nostro sistema sanitario e quindi noi stessi.  Leggiamo in questi giorni che gli ospedali  nel sud Italia  non hanno i fondi per affrontare le spese legate a questa imprevista emergenza sanitaria.  Quando i numeri di contagio aumenteranno, i  nostri\u00a0ospedali  non avranno posti letto per tutti, non ci saranno\u00a0 ventilatori polmonari per tutti i pazienti critici.\u00a0 Presto anche i medici, cos\u00ec come sta succedendo nel nord Italia, risulteranno positivi al virus, cos\u00ec\u00a0 anche i medici, scarseggeranno.\u00a0 Il nostro SUD rischia di non farcela.  Non so quanto, con questo breve messaggio, riusciremo a smuovere lo scetticismo della gente che non crede nelle raccolte fondi, e a fare credere loro che se solo riuscissimo a riunire le forze potremmo fare la differenza.  Non siamo i Ferragnez, lo sappiamo, siamo solo in gruppo di amici e non sappiamo se questo tentativo riuscir\u00e0. Quello che sappiamo\u00a0\u00e8 che l'Italia \u00e8 un paese che non si arrende, che gli italiani sono in grado di sorprendere, e che siamo famosi nel mondo per tante ragioni ma la pi\u00f9 importante \u00e8 che abbiamo un cuore grande.\u00a0  Non permetteremo al coronavirus di prendersi i nostri cari, le nostre nonne, i nostri pap\u00e0. Non lo permetteremo perch\u00e9 insieme possiamo fare la differenza.  Questi soldi serviranno per rinforzare gli ospedali del sud per comprare ventilatori polmonari da donare negli ospedali che cureranno i nostri cari. Forza ragazzi!",
