    "title": "Aiutiamo gli Ospedali della Provincia di Pavia",
    "description": "     Aiutiamo gli ospedali della Provincia\u00a0 di Pavia, anche per ricordare e far continuare a battere il grande cuore del Dr. Perluigi Testa  #BLOCCHIAMOLOINSIEME  Italiano:           SOSTEGNO EMERGENZA CORONAVIRUS          Sono figlia di un medico che lavora negli Ospedali di Voghera e Stradella, che, come altri, stanno affrontando con tutte le loro forze e risorse l\u2019emergenza sanitaria del Covid-19. Sto vivendo la preoccupazione attraverso i suoi occhi e le sue parole. Passa la maggior parte della sua vita in ospedale, sono due settimane che non lo posso abbracciare e dorme in un\u2019altra stanza della casa per tutelare la nostra salute.\u00a0  E come lui, \u00a0tutti i medici e gli infermieri lavorano in silenzio, senza sosta, senza riflettori, impegnati a dare il loro contributo per bloccare questo virus che non guarda in faccia nessuno.  Gli ospedali di provincia stanno combattendo una guerra al virus molto difficile, non godendo della visibilit\u00e0 e del sostegno che l\u2019Italia e il mondo stanno dando invece alle strutture pi\u00f9 grandi.  Eppure anche qui, nei piccoli ospedali, ci sono vite da salvare. E salvare una vita \u00e8 una cosa grande. \u00a0   Non tutti hanno la possibilit\u00e0 e la capacit\u00e0 di lottare in prima in linea, ma tutti possono contribuire affinch\u00e8 sempre pi\u00f9 medici e infermieri siano messi nelle condizioni di poterlo fare.  \u00a0  Aiutiamo gli ospedali della provincia di Pavia a bloccare questo virus, prima che ci blocchi lui.   #BLOCCHIAMOLOINSIEME              In questo momento le attrezzature necessarie per affrontare al meglio il virus nella terapia intensiva e subintensiva sono:            Ventilatori          Dispositivi di ventilazione non invasiva          Monitoraggio emodinamico          Monitor          DPI           E tutto ci\u00f2 che pu\u00f2 essere necessario in questo momento negli interventi            Anche una piccola donazione pu\u00f2 fare la differenza.             I fondi raccolti saranno direttamente devoluti all'ASST di Pavia, per il rafforzamento della terapia intensiva e per qualsiasi genere di attrezzatura.            NB:            SOSTEGNO EMERGENZA CORONAVIRUS            Campagna di donazione a favore dell'ASST-PAVIA               Inglese:         CORONAVIRUS EMERGENCY SUPPORT   Donation campaign for ASST-PAVIA Asst-Pavia was informed directly of the fundraising.   We would like to help everyone, even the little ones, and even with a small donation.  ASST Pavia:  Ospedale Civile Di Voghera  Ospedale unificato di Broni-Stradella  Ospedale Civile di Vigevano  Ospedale Asilo Vittoria di Mortara  Ospedale SS Annunziata di Varzi  Ospedale San Martino di Mede  Ospedale Carlo Mira di Casorate Primo  At this moment, the necessary equipment to better cope with the virus in both intensive and sub-intensive care are:  Fans Non-invasive ventilation devices Hemodynamic monitoring Monitors DPI   And everything that operators may need right now.  Even a small donation can make a big difference.  The funds raised will be directly donated to ASST Pavia to strengthen intensive care and for any kind of equipment that is necessary.\u00a0    IMPORTANT:   CORONAVIRUS EMERGENCY SUPPORT   Donation campaign for ASST-PAVIA   Asst-Pavia was informed directly of the fundraising",
