    "title": "Coronavirus Assistance",
    "description": "The World is under attack from an unseen enemy, called the Coronavirus, also known as the COVID-19 virus. It is no longer a question of \u201cif\u201d but \u201cwhen\u201d Americans will be faced with decisions about whether to work, or self quarantine because they are not feeling well and may have the virus. Many Americans work paycheck to paycheck and missing a minimum 14 days work in order not to spread this virus can have a devastating effect of their everyday lives, not to mention the further spread of this potentially life threatening virus out of desperation.  It is our Mission to help those who have acted responsible under this situation to make the correct choice and self quarantine without fear of falling so far behind that you could end up homeless.\u00a0Nearly half of\u00a0Americans live paycheck to paycheck: Bank survey. A near majority of\u00a0Americans, 49%, are\u00a0living paycheck to paycheck, according to a new survey by the First National Bank of Omaha. The survey also found that 53% of respondents do not have an emergency fund that covers at least three months of expenses. Are goal is to bring assistance to poor and distressed households that will be effected by this outbreak. By Americans getting involved in this effort we can lesson the burdens of the government.  \u00a0We will help all qualified applicants to pay 80% their bills, which will include Rent, or mortgage payments, utilities and bills related medicines to treat this virus.  \u00a0By assisting those who cannot afford to simply stay home, which is the low income sectors, like service industry related jobs, manufacturing and construction fields of the American population, we hope to do our part in the containment of this devastating pandemic that has reached our shores.  \u00a0It is not simply the responsibility of our government on the local to National levels to work to protect us it is Our responsibility to help ourselves and our Country. If you were suddenly hit with a $500 unexpected bill, would you be able to cover it?  If the answer is no, you're not alone.  \u00a0Nearly six in 10 Americans don't have enough savings to cover a $500 or $1,000 unplanned expense, according to a new report from Bankrate.  \u00a0Only 41% of adults reported having enough in their savings account to cover a surprise bill of this magnitude. A little more than 20% said they would put it on a credit card, the report said, while 20% would cut their spending and 11% would turn to friends and family for financial assistance.  This is an all hands on battle for our future, the future of our Nation, and\u00a0 possibly the future of humanity. Many people are going become sick, many of them if they have underlying health issues and are elderly may die.\u00a0 Join us, and together we can defeat this pandemic by helping those who are financially unable to help themselves in making the right decision to self-quarantine without fear. We can spend a few pennies today and be proactive or spend huge sums of money to try an catch up. There is no doubt that containment seems to be the key.",
