    "description": "\n\n\n In una situazione tragica come questa che sta vivendo il nostro paese  a causa del covid-19, ho pensato a cosa potessi fare per aiutare la mia cara citt\u00e0 \u201cNapoli\u201d che sta combattendo con tutte le risorse disponibili ma purtroppo non sufficienti per questa pandemia. Basta una semplice donazione affinch\u00e9 i nostri ospedali possano acquistare ci\u00f2 che ritengono essenziale per combattere \u00a0il covid-19 e curare i gi\u00e0 tanti ammalati.\u00a0  In a tragic situation like this that we are experiencing all over the world because of covid-19, I thought about what I could do to help my dear city \"Naples\" which is fighting with all the available resources but unfortunately this pandemic is not enough.\u00a0 A simple donation is enough for our hospitals to buy what they deem essential to combat covid-19 and treat the already many sick  \n \n\n\n\n En una situaci\u00f3n tr\u00e1gica como esta que estamos experimentando en todo el mundo debido a covid-19, pens\u00e9 en lo que podr\u00eda hacer para ayudar a mi querida ciudad \"N\u00e1poles\", que est\u00e1 luchando con todos los recursos disponibles, pero desafortunadamente esta pandemia no es suficiente. Una simple donaci\u00f3n es suficiente para que nuestros hospitales compren lo que consideran esencial para combatir covid-19 y tratar a los muchos enfermos.  In einer tragischen Situation wie dieser, die wir aufgrund von Covid-19 auf der ganzen Welt erleben, dachte ich dar\u00fcber nach, was ich tun k\u00f6nnte, um meiner lieben Stadt \"Neapel\" zu helfen, die mit allen verf\u00fcgbaren Ressourcen k\u00e4mpft, aber leider reicht diese Pandemie nicht aus. Eine einfache Spende reicht f\u00fcr unsere Krankenh\u00e4user aus, um das zu kaufen, was sie f\u00fcr die Bek\u00e4mpfung von Covid-19 und die Behandlung der bereits vielen Kranken f\u00fcr wesentlich halten.  Dans une situation tragique comme celle que nous vivons dans le monde entier \u00e0 cause de Covid-19, j'ai pens\u00e9 \u00e0 ce que je pouvais faire pour aider ma ch\u00e8re ville \"Naples\" qui se bat avec toutes les ressources disponibles mais malheureusement cette pand\u00e9mie n'est pas suffisante. Un simple don suffit \u00e0 nos h\u00f4pitaux pour acheter ce qu'ils jugent essentiel pour combattre covid-19 et soigner les nombreux malades.",
