    "days_created": "5.0",
    "title": "COVID-19 Emergency in Parma",
    "description": " COVID-19\u00a0 Emergency in Parma, donations for Azienda Ospedaliera di Parma (Parma Hospital)   FOR ENGLISH PLEASE SEE BELOW  Ciao a tutti, Sono Andrea, parmigiano, che vive in Olanda. Puoi trovare ulteriori informazioni su di me su  https://www.linkedin.com/in/andreamodenini/   Inutile dire che il Coronavirus (COVID-19) sta diventando un'emergenza globale. A partire da ieri, la mia cara Parma \u00e8 entrata nella \"zona rossa\". I miei genitori, entrambi 60enni, lavorano in ospedale e direttamente con pazienti affetti da Coronavirus. Ero senza parole quando mio padre mi disse per telefono:   \"Andrea, in 35 anni di carriera, non ho mai visto una cosa del genere. Non \u00e8 una semplice influenza. Stiamo lavorando 12-14 ore al giorno, 7 giorni su 7. Spero che usciremo da questa emergenza. Stiamo esaurendo il personale, i letti per i pazienti, e quant'altro\".   e potete immaginare come ci si puo' sentire impotenti a 1000 km di distanza. Ed \u00e8 per questo che sono qui! Sto organizzando questa raccolta fondi per l'Ospedale di Parma appositamente per l'emergenza Coronavirus ( https://www.ao.pr.it/chi-siamo/beneficenza/ ).  Gestir\u00f2 tutti i documenti (in conformit\u00e0 con la legge), vi terr\u00f2 aggiornatoie ovviamente una volta che avro' raggiunto l'obiettivo, vi fornir\u00f2 tutta la documentazione della donazione.   Se potete per favore aiutami in questa raccolta, vi prego di donare e condividere con tutti i vostri contatti!   -------------------  ENGLISH  Hi all, \u00a0I'm Andrea, an Italian from Parma, living in Netherlands. You can find more about me on   https://www.linkedin.com/in/andreamodenini/    Needless to say that Coronavirus (COVID-19) is becoming a global emergency. Starting from yesterday, my home city Parma entered in the \"red zone\", meaning no entry nor exit. My parents, both 60 years old, work at the Hospital and they are working directly in the division for treating patients affected by Coronavirus. I was speechless when my father told me with his own words by telephone the following:  \" Andrea, in 35 years of career, I've never seen something like that.\u00a0 It's not just a simple flu. We're working 12-14 hours/day, 7/7. I hope we're gonna get out of this emergency. We're running out of personnel, beds for patients, etc. \"  and you can imagine feeling 1000 km away powerless.\u00a0 And that's why I'm here! I'm raising a funding for the Parma Hospital specifically for Coronavirus emergency (  https://www.ao.pr.it/chi-siamo/beneficenza/  ).  I will manage all the paperwork (in compliance to Italian law), keep you posted, and obviously once reached the target I will provide proof of the donation.    If you could please help me in this, please donate and share with all your contacts!",
