    "donators": "10",
    "days_active": "4.0",
    "days_created": "4.0",
    "title": "Covid-19 Sostegno Osp. San Carlo Borromeo Milano",
    "description": "  I FONDI RACCOLTI VERRANNO DONATI ALL'OSPEDALE SAN CARLO BORROMEO DI MILANO PER POTENZIARE IL REPARTO DI TERAPIA INTENSIVA E RIANIMAZIONE   Covid-19, noto confidenzialmente con il nome di Corona Virus.\u00a0  Questo \u00e8 il nome del nemico che in questi giorni sta sfidando non uno specifico paese, non una particolare etnia n\u00e8 un certo tipo di fascia sociale o culturale, bens\u00ec potenzialmente chiunque di noi.  Covid-19 non guarda in faccia a nessuno.\u00a0  Questa situazione \u00e8 senza precedenti in epoca moderna e sta avendo numerose ripercussioni a livello sociale ed economico. Tuttavia sta avendo anche un altro tipo di risvolto: sta portando alla luce nuovi aspetti delle persone, nel bene e nel male.  Nel male ha suscitato: psicosi di massa, supermercati saccheggiati, disinformazione, minimizzazione o negazione del problema, esodi sconsiderati di persone potenzialmente infette, paura, odio ed episodi di razzismo.  Nel bene tuttavia: ha portato le persone a documentarsi, il servizio sanitario, tanto spesso criticato con leggerezza, ha reagito in maniera estremamente efficace con i mezzi a disposizione, molte strutture sono state potenziate, ha sensibilizzato molte persone ad azioni di solidariet\u00e0 e di prevenzione, ha fatto prendere coscienza a molti di quanto i nostri operatori sanitari, forze dell'ordine e tanti altri si adoperino quotidianamente per la comunit\u00e0. E ci sono state anche tante altre reazioni positive a livello personale e sociale, l'elenco potrebbe essere lungo.  Tuttavia ancora non basta: l'emergenza esiste, ed \u00e8 di portata davvero straordinaria. Il nostro sistema sanitario non \u00e8 in grado di reggere la pressione che questa situazione sta portando n\u00e8 a livello di personale, n\u00e8 a livello di strutture (inteso come posti in rianimazione e terapia intensiva), n\u00e8 a livello di attrezzature.\u00a0  Sia chiaro: io sono uno qualsiasi, come tanti di voi che. Sono uno che ha sempre cercato di trasmettere agli altri dei messaggi positivi e, nel suo piccolo, di fare qualcosa di buono per gli altri.\u00a0 Sto vivendo questa situazione da vicino perch\u00e8 la mia compagna \u00e8 medico rianimatore, quindi sono sensibile a ci\u00f2 che vive lei, ma prima di tutto sono una persona che sta cercando di capire cosa sta succedendo. Sono uno che, come voi, sta vivendo questa epoca strana, in cui c'\u00e8 tanta confusione.  Forse \u00e8 una metafora un po' forte, ma possiamo dire che sono giorni in cui la Morte cammina per le strade, va al cinema, va nelle scuole, prende la metropolitana, va in ufficio... fa una vita qualsiasi, una vita come quella di tanti di noi.  E, percorrendo le nostre stesse strade, vivendo la nostra quotidianit\u00e0, pu\u00f2 incrociarci in qualsiasi momento e decidere di baciarci... un bacio freddo, che toglie il respiro. Ma non te ne accorgi subito e magari, nel frattempo, quel bacio tu lo dai alla tua compagna, ai tuoi genitori, ai tuoi figli...  Eppure ancora c'\u00e8 tanta disinformazione in merito, tanto menefreghismo, tanta superficialit\u00e0.  Oggi riflettevo sul fatto che se ognuno di noi diffondesse della buona informazione a chi gli sta intorno, si potrebbe riuscire ad arginare la diffusione del virus.\u00a0 Da qui il passo \u00e8 stato breve e mi sono chiesto: \"ma se ognuno di noi mettesse un nichelino, non si potrebbe aiutare il sistema sanitario con delle attrezzature o qualcosa in pi\u00f9?\" Nell'era dei social abbiamo la possibilit\u00e0 di avere la giusta diffusione e uno strumento magnifico come il crowdfunding per permettere a tutti di contribuire.  Cos\u00ec ho deciso di provarci, di fare il passo e fare qualcosa di concreto e permettere ad altri di aiutarmi, di aiutarci l'un l'altro  La somma che ho scelto non \u00e8 stata calcolata su budget o conti scientifici e, oggettivamente, non so quanto possa influire in una battaglia su questa scala.  Ma penso sia comunque un gesto importante, che pu\u00f2 permettere a tante persone di fare qualcosa, di agire. Ogni azione comporta un cambiamento, per quanto piccola. E' il cosiddetto \"effetto farfalla\".  Proviamoci... anche se possono sembrare gesti piccoli, facciamoli!  Dopo tutto, mettendo insieme delle gocce si pu\u00f2 formare una pozzanghera, ma anche un oceano!  Fatelo! Facciamolo!\u00a0  Per noi, per le persone a cui teniamo... e anche per tutti gli altri in fondo! Perch\u00e8, in qualche modo, tutta questa storia ci pu\u00f2 unire! E penso che questa sia la cosa pi\u00f9 fantastica che pu\u00f2 venire da tutta questa confusione. Il fatto di vincerla ed uscirne pi\u00f9 uniti di prima. Non come nazione, o come identit\u00e0 culturale, ma come PERSONE!  Io ci provo. Sono uno di voi. Aiutiamoci!  Grazie a tutti!  Giampaolo   I FONDI RACCOLTI VERRANNO DONATI ALL'OSPEDALE SAN CARLO BORROMEO DI MILANO PER POTENZIARE IL REPARTO DI TERAPIA INTENSIVA E RIANIMAZIONE",
