    "description": " Story   In December, our well pump died and we\u2019ve been without running water ever since. We're raising $1500 to replace the well and $500 to survive until we can get it replaced.   We\u2019ve been using bottled water, but it\u2019s expensive and hard to deal with. We\u2019re both disabled and this a big hardship for us.   [Image by  Willfried Wende  from  Pixabay ]  Now people have been buying out all the bottled water stock at our local stores in preparation for a COVID19 outbreak, and it will be much harder for us to source potable water.  The replacements we use in lieu of running water, like bathing wipes, dry shampoo, bottled drinks and disposable utensils, are not good for us, our finances, or the environment.    [Image by  Bilderjet  from  Pixabay ]  Please help us fix our well so we can go back to living more normal lives.   Thank you for your donations and for sharing our fundraiser! With your help we can get this done.   [Image by  Susanne Jutzeler, suju-foto \u00a0 from  Pixabay ]   Costs   We estimate that the well repair will be about $1500 including a new pump and labor. We\u2019ve included an extra $500 in the goal to help us buy the things we need in the meantime, which will be a lot of disposable utensils and ready made meals since we have no way to wash dishes.    Risks   It\u2019s possible that the repairs will be more expensive than my estimate, but that seems unlikely.   It's also possible that we won't raise enough money to replace the pump and we won't be able to make up the difference for a while.    Notes   Title Image by  Ron Porter  from  Pixabay .   I hope we can update the campaign with images from our own lives soon. I just wanted to get this live as soon as possible so that we can get water again.",
